framefield.script:
				INITIALIZE =
DECLARE
ENDDECLARE
BEGIN
    $_CurFld.cf_panel    = COMPOSITEFIELD( FIELD($_CurFld).FieldByName( name = 'colormtx' ));
    $_CurFld.ff_selected = FIELD($_CurFld).FieldByName( name = 'selected' );

    $_CurFld.SetColor( Color = $_CurFld.i_default_color );
    $_CurFld.Hide(); // Default hidden
    $_CurFld.cf_panel.ParentField = CurFrame.TopForm;
END;

ON CLICKPOINT $_CurFld.selected =
BEGIN
    IF $_CurFld.IsShowing() = TRUE
    THEN
        $_CurFld.Hide();
        CurFrame.PurgeUserEvent( EventName = 'Hide_$_CurFld' );
    ELSE 
        $_CurFld.Show();
        CurFrame.SendUserEvent( EventName = 'Hide_$_CurFld',
                                Delay     = $_CurFld.i_delay );
    ENDIF;
END

ON USEREVENT 'Hide_$_CurFld' =
BEGIN
    $_CurFld.Hide();
END

ON CHILDCLICKPOINT $_CurFld.colormtx =
BEGIN
    $_CurFld.SetColor( Color = FORMFIELD(CurFrame.TriggerField).BgColor );
    CurFrame.PurgeUserEvent( EventName = 'Hide_$_CurFld' );
    $_CurFld.Hide();
END

COMPONENT.script:
			/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/* Global Procedure: Expand envionment variables.                                                 */
/*                                                                                                */
/* Procedure Name  : expand_envars                                                                */
/*                                                                                                */
/* System Name     : ProxyGen                                                                     */
/*                                                                                                */
/* Sub-System Name : N/A                                                                          */
/*                                                                                                */
/* Author          : I. Utley       (Luminary Solutions)                                          */
/*                                                                                                */
/* Date            : 07/09/2002                                                                   */
/*                                                                                                */
/* Description     : Substitute environment variables within a string for their correct values.   */
/*                   Return the substituted string rather than passing back by reference.         */
/*                                                                                                */
/* Version History                                                                                */
/*                                                                                                */
/* Version Date     Who   Description                                                             */
/* ------- -------- ----- -----------                                                             */
/* 1.0     07/09/02 IU    Original version.                                                       */
/* 1.1     05/12/07 DJN   Modified for open source release.                                       */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/

#define $S1_INIT       1
#define $S2_UNEXPANDED 2

PROCEDURE expand_envvars
(
/*------------------------------------------------------------------------------------------------*/
/* Parameters passed by value                                                                     */
/*------------------------------------------------------------------------------------------------*/

p_so = StringObject,

/*------------------------------------------------------------------------------------------------*/
/* Parameters passed BYREF                                                                        */
/*------------------------------------------------------------------------------------------------*/

/* none */

) =
DECLARE

/*------------------------------------------------------------------------------------------------*/
/* Variables local to this procedure                                                              */
/*------------------------------------------------------------------------------------------------*/

i         = INTEGER      NOT NULL;
v_curvar  = VARCHAR(256) NOT NULL;
v_curchar = VARCHAR(1)   NOT NULL;
v_env     = VARCHAR(256) NOT NULL;
i_state   = INTEGER      NOT NULL;
i_start   = INTEGER      NOT NULL;

so_right = StringObject DEFAULT NULL;

/*------------------------------------------------------------------------------------------------*/
/* Procedures local to this global procedure                                                      */
/*------------------------------------------------------------------------------------------------*/

/* none */

ENDDECLARE
BEGIN

    /*--------------------------------------------------------------------------------------------*/
    /* Search through a string object for substrings starting with a "$". When found, check for   */
    /* an environment variable with the same name as the following characters, increasing the     */
    /* number of characters one at a time until the name is found in the environment.             */
    /* When found, substitute the value for the name.                                             */
    /*--------------------------------------------------------------------------------------------*/

    i_state = $S1_INIT;
    i = 1;

    WHILE i < p_so.Length
    DO
        v_curchar = p_so.SubString( StartPosition = i, Length = 1 );

        CASE i_state OF
            $S1_INIT:
            BEGIN
                IF v_curchar = '$'
                THEN
                    v_curvar = '';
                    i_state  = $S2_UNEXPANDED;
                    i_start  = i;
                ENDIF;
            END
            $S2_UNEXPANDED:
            BEGIN
                IF v_curchar = '$'
                THEN
                    v_curvar = '';
                    i_start  = i;
                ELSE
                    v_curvar = v_curvar + v_curchar;
                    v_env = CurSession.GetEnv( Name = v_curvar );

                    IF v_env <> ''
                    THEN
                                                  /*----------------------------------------------*/
                                                  /* We have found an expansion, replace the      */
                                                  /* string.                                      */
                                                  /*----------------------------------------------*/

                        so_right = p_so.Duplicate();
                        so_right.LeftTruncate( EndPosition = i );
                        p_so.RightTruncate( StartPosition = i_start);
                        p_so.ConcatVarchar( Text = v_env );
                        p_so.ConcatString( String = so_right );

                        i_state = $S1_INIT;

                    ELSE
                                                  /*----------------------------------------------*/
                                                  /* Not expanded yet...                          */
                                                  /*----------------------------------------------*/

                    ENDIF;
                ENDIF;
            END

        ENDCASE;

        i = i + 1;

    ENDWHILE;

    RETURN p_so;

END

/*------------------------------------------------------------------------------------------------*/
/* ------------------------------- End of Global Procedure Script ------------------------------- */
/*------------------------------------------------------------------------------------------------*/

