INITIALISE =

DECLARE

/*------------------------------------------------------------------------------------------------*/
/* Procedures local to this user class                                                            */
/*------------------------------------------------------------------------------------------------*/

/* none */

ENDDECLARE


/*------------------------------------------------------------------------------------------------*/
/* Method          :    ProcessStartTag                                                           */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    This is called when the start of a tag is found.                          */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD ProcessStartTag
(
)=
DECLARE
    UCClassDef    = uc_class_definition DEFAULT NULL,
    UCSCPDef      = uc_scp_definition DEFAULT NULL,
    UCDataDef     = uc_data_definition DEFAULT NULL,
    so_tmp        = StringObject,
    v_name        = VARCHAR(32) NOT NULL,
    v_qualified   = VARCHAR(65) NOT NULL,
    UCTag_current = _uc_tag DEFAULT NULL,
ENDDECLARE
BEGIN
    UCTag_current = CurObject.arr_tags[ CurObject.i_depth ];

    CASE CurObject.v_current_tag OF

    'class':
    {
        UCClassDef = uc_class_definition.Create();
        so_tmp = UCTag_current.GetValue( p_v_name = 'name' );

        IF so_tmp IS NOT NULL
        THEN
            UCClassDef.v_name = so_tmp.Value;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'qualified' );

        IF so_tmp IS NOT NULL
        THEN
            UCClassDef.v_qualified = so_tmp.Value;
            v_name = LEFT(so_tmp.Value,LOCATE(so_tmp.Value,'!')-1);

            IF CurObject.arr_includedapps.Find( attributename = 'Value',
                                               value = v_name ) = ER_ROWNOTFOUND
            THEN
                so_tmp.Value = v_name;
                CurObject.arr_includedapps.InsertRow( RowObject = so_tmp.Duplicate() );
            ENDIF;
        ENDIF;

        CurObject.UCClassDef = UCClassDef;
    }

    'attr':
    {
        UCDataDef = uc_data_definition.Create();
        so_tmp = UCTag_current.GetValue( p_v_name = 'name' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.v_name = so_tmp.Value;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'array' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.i_isarray = INT4(so_tmp.Value);
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'private' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.i_isprivate = INT4(so_tmp.Value);
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'default' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.v_default = so_tmp.Value;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'defaulttype' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.i_defaulttype = INT4(so_tmp.Value);
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'nullable' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.i_isnullable = INT4(so_tmp.Value);
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'ref' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.i_isref = INT4(so_tmp.Value);
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'type' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.v_datatype = so_tmp.Value;
        ENDIF;

        CurObject.UCDataDef = UCDataDef;
    }

    'scp':
    {
        IF CurObject.fe_main IS NOT NULL
        THEN
            CurObject.fe_main.StatusText = CurObject.fe_main.StatusText + '*';
        ENDIF;

        UCSCPDef = uc_scp_definition.Create();
        so_tmp = UCTag_current.GetValue( p_v_name = 'name' );

        IF so_tmp IS NOT NULL
        THEN
            UCSCPDef.v_name = so_tmp.Value;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'type' );

        IF so_tmp IS NOT NULL
        THEN

            UCSCPDef.v_type = so_tmp.Value;

            IF so_tmp.Value = 'method'
            THEN
                so_tmp = UCTag_current.GetValue( p_v_name =  'origin' );

                IF so_tmp.Value IS NOT NULL
                THEN
                    UCSCPDef.v_class = so_tmp.Value;
                ENDIF;

                so_tmp = UCTag_current.GetValue( p_v_name = 'method' );

                IF so_tmp IS NOT NULL
                THEN
                    UCSCPDef.v_method = so_tmp.Value;
                ENDIF;


            ELSEIF so_tmp.Value = 'procedure'
            THEN
                so_tmp = UCTag_current.GetValue( p_v_name =  'origin' );

                IF so_tmp.Value IS NOT NULL
                THEN
                    UCSCPDef.v_procedure = so_tmp.Value;
                ENDIF;
            ENDIF;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'application' );

        IF so_tmp IS NOT NULL
        THEN
            UCSCPDef.v_application = so_tmp.Value;
        ENDIF;

        CurObject.UCSCPDef = UCSCPDef;
    }

    'param':
    {
        UCDataDef = uc_data_definition.Create();
        so_tmp = UCTag_current.GetValue( p_v_name = 'name' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.v_name = so_tmp.Value;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'array' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.i_isarray = INT4(so_tmp.Value);
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'default' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.v_default = so_tmp.Value;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'defaulttype' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.i_defaulttype = INT4(so_tmp.Value);
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'nullable' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.i_isnullable = INT4(so_tmp.Value);
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'type' );

        IF so_tmp IS NOT NULL
        THEN
            UCDataDef.v_datatype = so_tmp.Value;
        ENDIF;

        CurObject.UCDataDef = UCDataDef;

    }

    'interface':
    {
        so_tmp = UCTag_current.GetValue( p_v_name = 'name' );

        IF so_tmp IS NOT NULL
        THEN
            CurObject.v_interfacename = so_tmp.Value;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'version' );

        IF so_tmp IS NOT NULL
        THEN
            CurObject.v_interfaceversion = so_tmp.Value;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'generationdate' );

        IF so_tmp IS NOT NULL
        THEN
            CurObject.v_interfacedate = so_tmp.Value;
        ENDIF;
    }

    DEFAULT:;

    ENDCASE;

END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    ProcessEndTag                                                             */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    This is called when the end of a tag is found.                            */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD ProcessEndTag
(
)=
DECLARE
ENDDECLARE
BEGIN
    CASE CurObject.v_current_tag OF

    'class':
    {
        CurObject.arr_ucclassdef.InsertRow( 
            RowNumber = CurObject.arr_ucclassdef.LastRow + 1,
            RowObject = CurObject.UCClassDef );
    }

    'attr':
    {
        CurObject.UCClassDef.AddAttribute( p_ucdatadef = CurObject.UCDataDef );
    }

    'scp':
    {
        CurObject.arr_ucscpdef.InsertRow(
            RowNumber = CurObject.arr_ucscpdef.LastRow + 1,
            RowObject = CurObject.UCSCPDef );
    }

    'param':
    {
        CurObject.UCSCPDef.AddParameter( p_ucdatadef = CurObject.UCDataDef );
    }

    DEFAULT: ;

    ENDCASE;
END


