METHOD ProcessStartDocument
(
)=
DECLARE
ENDDECLARE
BEGIN
    CurObject.arr_ucscpdef.Clear();
    CurObject.arr_ucclassdef.Clear();
    CurObject.arr_includedapps.Clear();
    CurObject.arr_includedapps.InsertRow(RowObject = StringObject.Create());
    StringObject(CurObject.arr_includedapps[1]).Value = 'core';
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    Dispose                                                                   */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    Clean Up                                                                  */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD Dispose
(
)=
DECLARE
    i = INTEGER NOT NULL,
ENDDECLARE
BEGIN
    CurObject.UCClassDef = NULL;
    CurObject.UCDataDef  = NULL;
    CurObject.UCSCPDef   = NULL;

    FOR i=CurObject.arr_ucclassdef.LastRow DOWNTO 1
    DO
        CurObject.arr_ucclassdef[i] = NULL;
        CurObject.arr_ucclassdef.RemoveRow( RowNumber = i );
    ENDFOR;

    CurObject.arr_ucclassdef.Clear();

    FOR i=CurObject.arr_ucscpdef.LastRow DOWNTO 1
    DO
        CurObject.arr_ucscpdef[i] = NULL;
        CurObject.arr_ucscpdef.RemoveRow( RowNumber = i );
    ENDFOR;

    CurObject.arr_ucscpdef.Clear();

    CurMethod.SendSuperClass();
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    GetSCPsByClass                                                            */
/* Params in       :    p_v_classname: Name of class to filter by.                                */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    arr_ucscpdef : array of uc_scp_definition                                 */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    Get an array of the SCPs for the specified class.                         */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD GetSCPSByClass
(
    p_v_classname = VARCHAR(65) NOT NULL,
)=
DECLARE
    i = INTEGER NOT NULL;
    j = INTEGER NOT NULL;
    k = INTEGER NOT NULL;
    arr_ucscpdef = ARRAY OF uc_scp_definition,
    v_unqualified = VARCHAR(32) NOT NULL,
ENDDECLARE
BEGIN
    k = 1;
    j = Curobject.arr_ucscpdef.LastRow;

    p_v_classname = LOWERCASE(p_v_classname);
    v_unqualified = SHIFT(p_v_classname , -LOCATE(p_v_classname,'!'));

    FOR i = 1 TO j
    DO
        IF LOWERCASE(CurObject.arr_ucscpdef[i].v_class) = p_v_classname
        OR LOWERCASE(CurObject.arr_ucscpdef[i].v_class) = v_unqualified
        THEN
            arr_ucscpdef.InsertRow( 
                    RowNumber = k,
                    RowObject=CurObject.arr_ucscpdef[i] );

            k = k + 1;
        ENDIF;
    ENDFOR;

    RETURN arr_ucscpdef;
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    GetMethodGSCPClasses                                                      */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    arr_ucscpdef : array of uc_class_definition                               */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    Get an array of classes for generated SCPs.                               */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD GetMethodGSCPClasses
(
)=
DECLARE
    i_status = INTEGER NOT NULL;
    i = INTEGER NOT NULL;
    j = INTEGER NOT NULL;
    k = INTEGER NOT NULL;
    arr_ucclassdef = ARRAY OF uc_class_definition,
ENDDECLARE
BEGIN
    j = Curobject.arr_ucscpdef.LastRow;

    FOR i = 1 TO j
    DO
        IF CurObject.arr_ucscpdef[i].v_class <> ''
        THEN
                                                  /*----------------------------------------------*/
                                                  /* Only add the class if we haven't already     */
                                                  /* done so.                                     */
                                                  /*----------------------------------------------*/

            i_status = arr_ucclassdef.Find(
                AttributeName = 'v_name',
                Value = CurObject.arr_ucscpdef[i].v_class,
                CaseSensitive = FALSE,
                RowNumber = BYREF(k));

            IF i_status <> ER_OK
            THEN

            i_status = CurObject.arr_ucclassdef.Find( 
                AttributeName = 'v_name',
                Value         = CurObject.arr_ucscpdef[i].v_class,
                CaseSensitive = FALSE,
                RowNumber     = BYREF(k));

                IF i_status = ER_OK
                THEN
                    arr_ucclassdef.InsertRow(
                        RowNumber = arr_ucclassdef.LastRow + 1,
                        RowObject = CurObject.arr_ucclassdef[k] );
                ENDIF;
            ENDIF;
        ENDIF;
    ENDFOR;

    RETURN arr_ucclassdef;
END


