    RETURN arr_ucscpdef;
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    GetUserSCPs                                                               */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    arr_ucscpdef : array of uc_scp_definition                                 */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    Get an array of the user SCPs.                                            */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD GetUserSCPs
(
)=
DECLARE
    i = INTEGER NOT NULL;
    j = INTEGER NOT NULL;
    k = INTEGER NOT NULL;
    arr_ucscpdef = ARRAY OF uc_scp_definition,
ENDDECLARE
BEGIN
    k = 1;
    j = Curobject.arr_ucscpdef.LastRow;

    FOR i = 1 TO j
    DO
        IF  CurObject.arr_ucscpdef[i].v_procedure = ''
        AND CurObject.arr_ucscpdef[i].v_class= ''
        AND CurObject.arr_ucscpdef[i].v_type='user'
        THEN
            arr_ucscpdef.InsertRow( 
                    RowNumber = k,
                    RowObject=CurObject.arr_ucscpdef[i] );

            k = k + 1;
        ENDIF;
    ENDFOR;

    RETURN arr_ucscpdef;
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    GetClassByName                                                            */
/* Params in       :    p_v_classname : name of class                                             */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    Instance of uc_class_definition                                           */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    Returns the class with the specified name.                                */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD GetClassByName
(
    p_v_classname = VARCHAR(65) NOT NULL,
)=
DECLARE
    i = INTEGER NOT NULL;
    j = INTEGER NOT NULL;
    v_attribute = VARCHAR(32) NOT NULL,
    v_value = VARCHAR(65) NOT NULL,

ENDDECLARE
BEGIN
    j = Curobject.arr_ucclassdef.LastRow;

    IF p_v_classname LIKE '%!%'
    THEN
        v_attribute = 'v_qualified';
    ELSE
        v_attribute = 'v_name';
    ENDIF;

    p_v_classname = LOWERCASE(p_v_classname);

    FOR i = 1 TO j
    DO
        CurObject.arr_ucclassdef[i].GetAttribute( :v_attribute = BYREF(v_value));

        IF LOWERCASE(v_value) = p_v_classname
        THEN
            RETURN CurObject.arr_ucclassdef[i];
        ENDIF;
    ENDFOR;

    RETURN NULL;
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    GetSCPByName                                                              */
/* Params in       :    p_v_classname : name of class                                             */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    Instance of uc_scp_definition                                             */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    Returns an SCP with the passed name.                                      */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD GetSCPByName
(
    p_v_name = VARCHAR(32) NOT NULL,
)=
DECLARE
    i = INTEGER NOT NULL;
    j = INTEGER NOT NULL;
ENDDECLARE
BEGIN
    p_v_name = LOWERCASE(p_v_name);

    j = CurObject.arr_ucscpdef.LastRow;

    FOR i = 1 TO j
    DO
        IF LOWERCASE(CurObject.arr_ucscpdef[i].v_name) = p_v_name
        THEN
            RETURN CurObject.arr_ucscpdef[i];
        ENDIF;
    ENDFOR;

    RETURN NULL;

END

