INITIALISE
(
/*------------------------------------------------------------------------------------------------*/
/* Parameters passed by value                                                                     */
/*------------------------------------------------------------------------------------------------*/

/* none */

/*------------------------------------------------------------------------------------------------*/
/* Parameters passed BYREF                                                                        */
/*------------------------------------------------------------------------------------------------*/

/* none */

)=

DECLARE
    srparser    = searchreplaceparser;
    parser      = metagenparser DEFAULT NULL;
    parsercopy  = metagenparser DEFAULT NULL;
    so_tmp      = StringObject;
    cl_popup    = ChoiceList;
    v_proxy     = VARCHAR(2000) NOT NULL;
    v_proxy2    = VARCHAR(2000) NOT NULL;
    v_slash     = VARCHAR(1) NOT NULL;
    v_dir       = VARCHAR(2000) NOT NULL;
    i_state     = INTEGER NOT NULL;
    v_iisystem  = VARCHAR(256) NOT NULL;
    i_count     = INTEGER NOT NULL;
    i_pos       = INTEGER NOT NULL;
    i_batchmode = INTEGER NOT NULL DEFAULT FALSE;

    PopulateTree = PROCEDURE RETURNING NONE;
    SetState     = PROCEDURE RETURNING NONE;
    Inform       = PROCEDURE RETURNING VARCHAR(256) NOT NULL;
    ParseJobFile = PROCEDURE RETURNING INTEGER NOT NULL;
    GetMetaData  = PROCEDURE RETURNING INTEGER NOT NULL;
ENDDECLARE
BEGIN
    v_iisystem = CurSession.GetEnv( Name = 'II_SYSTEM' );

    IF CurSession.OperatingSystem = SY_UNIX
    THEN
        v_slash = '/';
    ELSE
        v_slash = '\';
    ENDIF;

    /*------------------------------------------------------------------------*/
    /* Check for command-line parameters.                                     */
    /*------------------------------------------------------------------------*/

    i_count = CurSession.AppFlags.LastRow;

    WHILE i_count > 0
    DO
        i_batchmode = TRUE;
        CASE CurSession.AppFlags[i_count].Name OF
                                        'jobfile': // Job description file
            BEGIN
                v_proxy = CurSession.AppFlags[i_count].FlagValues[1].Value;

                IF CurSession.FileExists( FileName = v_proxy ) = FALSE
                THEN
                    CurFrame.Trace( Text = v_proxy + ' cannot be found.' );
                    EXIT;
                ENDIF;

                v_proxy2 = v_proxy;
                WHILE 1=1
                DO
                    i_pos = LOCATE(v_proxy2,v_slash);
                    IF i_pos > LENGTH(v_proxy2)
                    THEN
                        ENDLOOP;
                    ENDIF;

                    v_dir = v_dir + LEFT(v_proxy2,i_pos - 1);

                    v_proxy2 = SHIFT(v_proxy2,-i_pos);
                    v_dir = v_dir + v_slash;

                ENDWHILE;
            END

          DEFAULT: // Unknown flag or parameter.
            BEGIN
                CurFrame.Trace( Text = 'Unknown option ' +
                    CurSession.AppFlags[i_count].Name );
                EXIT;
            END

        ENDCASE;
        i_count = i_count - 1;
    ENDWHILE;

    FIELD($Tree).ImageList[ $TVF_CLASS   ] = g_UCBitmaps.bo_class;
    FIELD($Tree).ImageList[ $TVF_CLASSES ] = g_UCBitmaps.bo_classes;
    FIELD($Tree).ImageList[ $TVF_SCP     ] = g_UCBitmaps.bo_scp;
    FIELD($Tree).ImageList[ $TVF_SCPS    ] = g_UCBitmaps.bo_scps;
    FIELD($Tree).ImageList[ $TVF_GLOBAL  ] = g_UCBitmaps.bo_global;
    FIELD($Tree).ImageList[ $TVF_PARAM   ] = g_UCBitmaps.bo_param;
    FIELD($Tree).ImageList[ $TVF_ATTR    ] = g_UCBitmaps.bo_attr;
    FIELD($Tree).ImageList[ $TVF_TYPES   ] = g_UCBitmaps.bo_types;
    FIELD($Tree).ImageList[ $TVF_TYPE    ] = g_UCBitmaps.bo_type;

    menu.mg_options.mg_language.tgl_none = FALSE;
    menu.mg_options.mg_language.tgl_java = TRUE;
    menu.mg_options.mg_language.tgl_user = FALSE;

    IF i_batchmode = TRUE
    THEN
        CurFrame.SendUserEvent( EventName = 'reload' );
        CurFrame.SendUserEvent( EventName = 'go' );
        CurFrame.SendUserEvent( EventName = 'exit' );
        CurFrame.WindowVisibility = WV_INVISIBLE;
    ELSE
        CALLPROC SetState( p_i_state = $STATE_INIT );
    ENDIF;
END

