/*------------------------------------------------------------------------------------------------*/
ON CHILDCLICK $PropertyOptMenu.btn_new=
DECLARE
    l_tn       = TreeNode DEFAULT NULL,
    l_tn_child = TreeNode DEFAULT NULL,
    l_arr      = ARRAY OF uc_batchreplace,
    l_v_name   = VARCHAR(65) NOT NULL,
ENDDECLARE
BEGIN
    l_tn = FIELD($Tree).CurNode;

    CASE l_tn.SelBmpLblIndx OF
    $TVF_CLASS:
    BEGIN
        IF CurFrame.TriggerField.ClientText = '1'
        THEN
            l_tn_child = FIELD($Tree).Tree.AddNode( Name = 'NewAttribute',
                                                    Relative = l_tn );
        ELSEIF CurFrame.TriggerField.ClientText = '2'
        THEN
            l_v_name = CALLFRAME choice_select(
                                         p_cl    = cl_popup,
                                         p_v_hdr = 'Attribute')
                       WITH WindowTitle = 'Select Attribute';

            CurFrame.BringToFront();

            IF l_v_name = ''
            THEN
                RESUME;
            ENDIF;

            l_tn_child = FIELD($Tree).Tree.AddNode(
                Name = l_v_name,
                KeyLabel = 'ATTR:' + l_v_name,
                Relative = l_tn );

        ELSE
            l_tn_child = FIELD($Tree).Tree.AddNode(
                Name = MENUBUTTON(CurFrame.TriggerField).TextLabel,
                Relative = l_tn );
        ENDIF;

        l_tn_child.SelBmpLblIndx = $TVF_ATTR;
        l_tn_child.BmpLblIndx    = $TVF_ATTR;

        IF uc_batchreplace(l_tn.ClientData).arr_ucbatch IS NULL
        THEN
            uc_batchreplace(l_tn.ClientData).arr_ucbatch = l_arr;
        ELSE
            l_arr = uc_batchreplace(l_tn.ClientData).arr_ucbatch;
        ENDIF;

    END

    $TVF_SCP:
    BEGIN
        IF CurFrame.TriggerField.ClientText = '1'
        THEN
            l_tn_child = FIELD($Tree).Tree.AddNode( Name = 'NewParameter',
                                                    Relative = l_tn );
        ELSEIF CurFrame.TriggerField.ClientText = '2'
        THEN
            l_v_name = CALLFRAME choice_select(
                                         p_cl    = cl_popup,
                                         p_v_hdr = 'Parameter')
                       WITH WindowTitle = 'Select Parameter';

            IF l_v_name = ''
            THEN
                RESUME;
            ENDIF;

            l_tn_child = FIELD($Tree).Tree.AddNode(
                Name = l_v_name,
                KeyLabel = 'PARAM:' + l_v_name,
                Relative = l_tn );

        ELSE
            l_tn_child = FIELD($Tree).Tree.AddNode(
                Name = MENUBUTTON(CurFrame.TriggerField).TextLabel,
                Relative = l_tn );
        ENDIF;

        l_tn_child.SelBmpLblIndx = $TVF_PARAM;
        l_tn_child.BmpLblIndx    = $TVF_PARAM;

        IF uc_batchreplace(l_tn.ClientData).arr_ucbatch IS NULL
        THEN
            uc_batchreplace(l_tn.ClientData).arr_ucbatch = l_arr;
        ELSE
            l_arr = uc_batchreplace(l_tn.ClientData).arr_ucbatch;
        ENDIF;
    END

    $TVF_CLASSES:
    BEGIN
        IF CurFrame.TriggerField.ClientText = '1'
        THEN
            l_tn_child = FIELD($Tree).Tree.AddNode( Name = 'NewClass',
                                                    Relative = l_tn );
        ELSEIF CurFrame.TriggerField.ClientText = '2'
        THEN
            l_v_name = CALLFRAME choice_select(
                                         p_cl    = cl_popup,
                                         p_v_hdr = 'Class')
                       WITH WindowTitle = 'Select Class';

            IF l_v_name = ''
            THEN
                RESUME;
            ENDIF;

            CurFrame.BringToFront();

            l_tn_child = FIELD($Tree).Tree.AddNode(
                Name = l_v_name,
                KeyLabel = 'CLASS:' + l_v_name,
                Relative = l_tn );

        ELSE
            l_tn_child = FIELD($Tree).Tree.AddNode(
                Name = MENUBUTTON(CurFrame.TriggerField).TextLabel,
                Relative = l_tn );
        ENDIF;

        l_tn_child.SelBmpLblIndx = $TVF_CLASS;
        l_tn_child.BmpLblIndx    = $TVF_CLASS;

        l_arr = srparser.arr_classreplace;

    END

    $TVF_SCPS:
    BEGIN
        IF CurFrame.TriggerField.ClientText = '1'
        THEN
            l_tn_child = FIELD($Tree).Tree.AddNode( Name = 'NewSCP',
                                                    Relative = l_tn );
        ELSEIF CurFrame.TriggerField.ClientText = '2'
        THEN
            l_v_name = CALLFRAME choice_select(
                                             p_cl    = cl_popup,
                                             p_v_hdr = 'SCP')
                       WITH WindowTitle = 'Select SCP';

            IF l_v_name = ''
            THEN
                RESUME;
            ENDIF;

            l_tn_child = FIELD($Tree).Tree.AddNode(
                Name = l_v_name,
                KeyLabel = 'SCP:' + l_v_name,
                Relative = l_tn );

        ELSE
            l_tn_child = FIELD($Tree).Tree.AddNode(
                Name = MENUBUTTON(CurFrame.TriggerField).TextLabel,
                Relative = l_tn );
        ENDIF;

        l_tn_child.SelBmpLblIndx = $TVF_SCP;
        l_tn_child.BmpLblIndx    = $TVF_SCP;

        l_arr = srparser.arr_scpreplace;
    END

    DEFAULT:
    BEGIN
        CurFrame.InfoPopup(
            MessageType = MT_ERROR,
            MessageText = 'An unexpected state was encountered in event ' +
                          'handler for $PropertyOptMenu.btn_new' );

        RESUME NEXT;
    END
    ENDCASE;

    l_tn_child.IsExpanded    = FALSE;
    l_tn_child.HasChildren   = FALSE;

    l_tn_child.ClientData = uc_batchreplace.Create();
    uc_batchreplace(l_tn_child.ClientData).v_name = l_tn_child.TextLabel;

    l_arr.InsertRow( RowObject = l_tn_child.ClientData,
                     RowNumber = l_arr.LastRow + 1);

    FIELD($Tree).CurNode        = l_tn_child;
    FIELD($Tree).AllowLabelEdit = TRUE;
    CurFrame.SendUserEvent( EventName = 'SimulateTreeClick' );

    CALLPROC SetState( p_i_state = $STATE_EDIT );
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT: CLICK PropertyOptMenu.btn_delete                                                        */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CLICK $PropertyOptMenu.btn_delete=
DECLARE
    l_i         = INTEGER NOT NULL,
    l_tn        = TreeNode DEFAULT NULL,
    l_tn_parent = TreeNode DEFAULT NULL,
ENDDECLARE
BEGIN
    l_tn = FIELD($Tree).CurNode;
    l_tn_parent = l_tn.ParentNode;

    CASE l_tn.SelBmpLblIndx OF

    $TVF_ATTR:  NEXTCASE;
    $TVF_PARAM:
    BEGIN
        uc_batchreplace(l_tn_parent.ClientData).RemoveBatch(
                                          p_ucbatch = l_tn.ClientData);
        l_tn.ClientData = NULL;
        FIELD($Tree).Tree.DeleteNode( Node = l_tn, AllNodes = TRUE );
    END

    $TVF_CLASS:
    BEGIN
        FOR l_i = 1 TO srparser.arr_classreplace.LastRow
        DO
            IF srparser.arr_classreplace[l_i] = l_tn.ClientData
            THEN
                srparser.arr_classreplace[l_i] = NULL;
                srparser.arr_classreplace.RemoveRow( RowNumber = l_i );

                l_tn.ClientData = NULL;
                FIELD($Tree).Tree.DeleteNode( Node = l_tn, AllNodes = TRUE );
                ENDLOOP;
            ENDIF;
        ENDFOR;
    END

    $TVF_SCP:
    BEGIN
        FOR l_i = 1 TO srparser.arr_scpreplace.LastRow
        DO
            IF srparser.arr_scpreplace[l_i] = l_tn.ClientData
            THEN
                srparser.arr_scpreplace[l_i] = NULL;
                srparser.arr_scpreplace.RemoveRow( RowNumber = l_i );

                l_tn.ClientData = NULL;
                FIELD($Tree).Tree.DeleteNode( Node = l_tn, AllNodes = TRUE );
                ENDLOOP;
            ENDIF;
        ENDFOR;
    END

    DEFAULT:
    BEGIN
        CurFrame.InfoPopup(
            MessageType = MT_ERROR,
            MessageText = 'An unexpected state was encountered in event ' +
                          'handler for $$PropertyOptMenu.btn_delete' );

    END
    ENDCASE;

    CALLPROC SetState(p_i_state = $STATE_EDIT );
    CurFrame.SendUserEvent( EventName = 'SimulateTreeClick' );

END

