/*------------------------------------------------------------------------------------------------*/
/* EVENT: CLICK Load or New                                                                       */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CLICK menu.mg_file.btn_new,
ON CLICK menu.mg_file.btn_load,
ON CLICK btn_tb_new,
ON CLICK btn_tb_load =
DECLARE
    l_i_status    = INTEGER NOT NULL;
    l_i_pos       = INTEGER NOT NULL;
    l_so_filename = STRINGOBJECT;
    l_v_dir       = VARCHAR(2000) NOT NULL;
    l_i_optype    = INTEGER NOT NULL;
    l_v_msg       = VARCHAR(512) NOT NULL;
    l_so_tmp      = STRINGOBJECT;
    l_so_package  = STRINGOBJECT;
    l_v_op        = VARCHAR(1) NOT NULL DEFAULT 'N';
ENDDECLARE
BEGIN
    IF RIGHT(CurFrame.OriginatorField.Name,5) = '_load'
    THEN
        l_v_op = 'O';
    ENDIF;

    IF l_v_op = 'N'
    THEN
        // User languages display filepop.
        // Java language, use hardcoded.

        IF menu.mg_options.mg_language.tgl_java = TRUE
        THEN
            l_so_tmp.FileHandle = v_iisystem + v_slash +
                                'ingres'   + v_slash +
                                'files'    + v_slash +
                                'javaproxygen.xml';
        ENDIF;

        IF menu.mg_options.mg_language.tgl_user = TRUE
        THEN
            l_so_filename.Value = '*.xml[XML Files]';

            l_i_status = CurFrame.FilePopup(
                MessageText = 'Select template job description file.',
                Reply       = l_so_filename,
                Operation   = FOP_OPEN );

            IF l_i_status <> PU_OK
            THEN
                RESUME;
            ENDIF;

            l_so_tmp.FileHandle = l_so_filename.Value;
        ENDIF;

        l_i_optype = FOP_SAVE;
        l_v_msg    = 'Enter location to save job description file.';
    ELSE
        l_i_optype = FOP_OPEN;
        l_v_msg    = 'Enter location to load job desription file.';
    ENDIF;

    l_so_filename.Value = '*.xml[XML Files]';

    l_i_status = CurFrame.FilePopup(
        MessageText = l_v_msg,
        Reply       = l_so_filename,
        Operation   = l_i_optype );

    IF l_i_status <> PU_OK
    THEN
        RESUME;
    ENDIF;

    v_proxy = l_so_filename.Value;

    IF  l_v_op = 'N'
    AND menu.mg_options.mg_language.tgl_none = TRUE
    THEN
        // Save a skeleton XML file.
        l_so_tmp.Value = '<root><jobs/><global>' +
            '<sub desc=' + HC_QUOTE +
                           'Nameserver connection name'
                         + HC_QUOTE +
            ' find=' + HC_QUOTE +
                        '${aka_name}'
                     + HC_QUOTE +
            ' replace=' + HC_QUOTE +
                        'Replace with Application Name'
                        + HC_QUOTE +
            '/>' +
            '<sub desc=' + HC_QUOTE +
                           'Metagen file location'
                         + HC_QUOTE +
            ' find=' + HC_QUOTE +
                        '${metagenfile}'
                     + HC_QUOTE +
            ' replace=' + HC_QUOTE +
                        'Blank to connect direct'
                        + HC_QUOTE +
            '/>' +
        '</global><types>';
        l_so_tmp.ConcatVarchar( Text = '<type name=' +
                                   HC_QUOTE + 'byte' + HC_QUOTE + '/>');
        l_so_tmp.ConcatVarchar( Text = '<type name=' +
                                   HC_QUOTE + 'bytearray' + HC_QUOTE + '/>');
        l_so_tmp.ConcatVarchar( Text = '<type name=' +
                                   HC_QUOTE + 'datetime' + HC_QUOTE + '/>');
        l_so_tmp.ConcatVarchar( Text = '<type name=' +
                                   HC_QUOTE + 'decimal' + HC_QUOTE + '/>');
        l_so_tmp.ConcatVarchar( Text = '<type name=' +
                                   HC_QUOTE + 'double' + HC_QUOTE + '/>');
        l_so_tmp.ConcatVarchar( Text = '<type name=' +
                                   HC_QUOTE + 'float' + HC_QUOTE + '/>');
        l_so_tmp.ConcatVarchar( Text = '<type name=' +
                                   HC_QUOTE + 'int' + HC_QUOTE + '/>');
        l_so_tmp.ConcatVarchar( Text = '<type name=' +
                                   HC_QUOTE + 'money' + HC_QUOTE + '/>');
        l_so_tmp.ConcatVarchar( Text = '<type name=' +
                                   HC_QUOTE + 'short' + HC_QUOTE + '/>');
        l_so_tmp.ConcatVarchar( Text = '<type name=' +
                                   HC_QUOTE + 'string' + HC_QUOTE + '/>');
        l_so_tmp.ConcatVarchar( Text = '</types></root>' );
    ENDIF;

    IF  l_i_optype <> FOP_OPEN
    THEN
        l_so_tmp.WriteToFile( FileName = v_proxy);
    ENDIF;

    l_v_dir = '';

    WHILE 1=1
    DO
        l_i_pos = LOCATE(l_so_filename.Value,v_slash);
        IF l_i_pos > LENGTH(l_so_filename.Value)
        THEN
            ENDLOOP;
        ENDIF;

        l_v_dir = l_v_dir + LEFT(l_so_filename.Value,l_i_pos - 1);

        l_so_filename.Value = SHIFT(l_so_filename.Value,-l_i_pos);
        l_v_dir = l_v_dir + v_slash;

    ENDWHILE;

    v_dir = l_v_dir;

    IF l_v_op = 'O'
    THEN
        l_i_status = CALLPROC ParseJobFile( pv_filename = v_proxy );
    ELSE
        l_i_status = CALLPROC ParseJobFile( pv_filename = v_proxy,
                                            pi_parsemetagen = FALSE );
    ENDIF;

    IF l_i_status <> ER_OK
    THEN
        RESUME;
    ENDIF;

    CALLPROC SetState(p_i_state = $STATE_VIEW);
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT: CHILDEXIT SubTable                                                                      */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CHILDEXIT $SubTable =
DECLARE
   l_i_row = INTEGER NOT NULL;
ENDDECLARE
BEGIN
   FIELD($SubTable).IsHighlighted = FALSE;

   l_i_row = FIELD($SubTable).CurRow;

   IF l_i_row = FIELD($SubTable).TargetRow
   THEN
       RESUME NEXT;
   ENDIF;

   IF SQUEEZE($SubTable[l_i_row].v_find) = ''
   THEN
       IF FIELD($SubTable).TargetRow >= l_i_row
       THEN
           FIELD($SubTable).TargetRow = FIELD($SubTable).TargetRow - 1;
       ENDIF;
       $SubTable.RemoveRow( RowNumber = l_i_row );
   ENDIF;

   IF FIELD($SubTable).IsAncestorOf( descendant = CurFrame.TargetField ) = TRUE
   OR FIELD($SubTable).IsAncestorOf( descendant = CurFrame.NextTargetField ) = TRUE
   THEN
       IF FIELD($SubTable).TargetRow - 1 > $SubTable.LastRow
       THEN
           FIELD($SubTable).TargetRow = $SubTable.LastRow;
       ENDIF;

       IF CurFrame.NextTargetField IS NOT NULL
       THEN
           FIELD($SubTable).SetInputFocus( Row    = FIELD($SubTable).TargetRow,
                                          Column = CurFrame.NextTargetField.Name );
       ELSE
           FIELD($SubTable).SetInputFocus( Row    = FIELD($SubTable).TargetRow,
                                          Column = CurFrame.TargetField.Name );
       ENDIF;
   ENDIF;
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT: CHILDENTRY JobTable                                                                     */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CHILDENTRY $JobTable =
DECLARE
   l_i_row = INTEGER NOT NULL;
ENDDECLARE
BEGIN
   FIELD($JobTable).IsHighlighted = True;

   FOR l_i_row = $JobTable.LastRow DOWNTO $JobTable.FirstRow
   DO
       IF  SQUEEZE($JobTable[l_i_row].v_inputfile) = ''
       AND l_i_row <> FIELD($JobTable).CurRow
       THEN
           $JobTable.RemoveRow( RowNumber = l_i_row );
       ENDIF;
   ENDFOR;
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT: CHILDEXIT JobTable                                                                      */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CHILDEXIT $JobTable=
DECLARE
    l_i_row = INTEGER NOT NULL,
ENDDECLARE
BEGIN

   FIELD($JobTable).IsHighLighted = FALSE;
   l_i_row = FIELD($JobTable).CurRow;

   IF  SQUEEZE($JobTable[l_i_row].v_inputfile) = ''
   AND FIELD($JobTable).TargetRow <> l_i_row
   THEN
       IF FIELD($JobTable).TargetRow > l_i_row
       THEN
           FIELD($JobTable).TargetRow = FIELD($JobTable).TargetRow - 1;
       ENDIF;
       $JobTable.RemoveRow( RowNumber = l_i_row );
   ENDIF;

   IF FIELD($JobTable).IsAncestorOf( descendant = CurFrame.TargetField ) = TRUE
   OR FIELD($JobTable).IsAncestorOf( descendant = CurFrame.NextTargetField ) = TRUE
   THEN
       IF FIELD($JobTable).TargetRow - 1 > $JobTable.LastRow
       THEN
           FIELD($JobTable).TargetRow = $JobTable.LastRow;
       ENDIF;

       IF CurFrame.NextTargetField IS NOT NULL
       THEN
           FIELD($JobTable).SetInputFocus( Row    = FIELD($JobTable).TargetRow,
                                          Column = CurFrame.NextTargetField.Name );
       ELSE
           FIELD($JobTable).SetInputFocus( Row    = FIELD($JobTable).TargetRow,
                                          Column = CurFrame.TargetField.Name );
       ENDIF;
   ENDIF;
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT: go                                                                                      */
/*------------------------------------------------------------------------------------------------*/
/* Start generating event.                                                                        */
/*------------------------------------------------------------------------------------------------*/
ON USEREVENT 'go',
ON CLICK menu.mg_generate.btn_go,
ON CLICK btn_tb_go =
DECLARE
    z            = uc_template_block DEFAULT NULL;
    l_so         = StringObject DEFAULT NULL;
    l_i          = INTEGER NOT NULL;
    l_j          = INTEGER NOT NULL;
    l_k          = INTEGER NOT NULL;
    l_i_procscps = INTEGER NOT NULL DEFAULT FALSE;
    l_UCClass    = uc_class_definition DEFAULT NULL;
    l_UCSCP      = uc_scp_definition DEFAULT NULL;
    l_v_package  = VARCHAR(32) NOT NULL;
    l_v_tmp      = VARCHAR(32) NOT NULL;
    l_v_dir      = VARCHAR(2000) NOT NULL;
    l_so_tmp     = StringObject;
    l_so_file    = StringObject;
    l_so_xml     = StringObject;
    l_i_pos      = INTEGER NOT NULL;
    l_i_connect  = SMALLINT NOT NULL;
    l_i_split    = INTEGER NOT NULL;
    l_i_ranblock = INTEGER NOT NULL;
    l_v_metagen  = VARCHAR(512) NOT NULL;
    l_v_akaname  = VARCHAR(512) NOT NULL;
    l_UCReplace  = uc_replace DEFAULT NULL;
    l_i_status   = INTEGER NOT NULL;
    l_tmpso      = StringObject;
ENDDECLARE
BEGIN
    FIELD(progress.bar_jobs).MinValue = 0;
    FIELD(progress.bar_jobs).MaxValue = $JobTable.LastRow;
    progress.bar_jobs = 0;

    FIELD(progress.bar).MinValue = 0;
    FIELD(progress.bar).MaxValue = 2;
    progress.bar = 0;

    FIELD(progress).CurBias = FB_VISIBLE;

    CurFrame.Flush();

    CurFrame.Trace('====================================');
    CurFrame.Trace('Generation started at ' + VARCHAR(DATE('now')));

    IF srparser.v_errortext <> ''
    THEN
        MESSAGE srparser.v_errortext;
        srparser.Dispose();
        RESUME;
    ENDIF;

    parser = metagenparser.Create();
    parser.fe_main = CurFrame;

    /*------------------------------------------------------------------------*/
    /* Either use the specified metagen file, or connect directly to the app  */
    /* server.                                                                */
    /*------------------------------------------------------------------------*/

    l_UCReplace = srparser.globalreplace.Find( pv_find = '${aka_name}' );

    IF l_UCReplace IS NOT NULL
    THEN
        l_v_akaname = l_UCReplace.v_replace;
    ENDIF;

    l_UCReplace = srparser.globalreplace.Find( pv_find = '${metagenfile}' );

    l_i_connect = TRUE;

    IF  l_UCReplace IS NOT NULL
    THEN
        IF SQUEEZE(l_UCReplace.v_replace) != ''
        THEN
            l_i_connect = FALSE;
        ENDIF;
    ENDIF;

    IF l_i_connect = FALSE
    THEN
        l_v_metagen = l_UCReplace.v_replace;
        CurFrame.StatusText = Inform( v_msg = 'Parsing Metagen file.');
        parser.load( pv_filename = l_v_metagen );
    ELSE
        CurFrame.StatusText = Inform( v_msg = 'Connecting to application.');

        /*--------------------------------------------------------------------*/
        /* Connect to appserver.                                              */
        /*--------------------------------------------------------------------*/

        IF CurFrame.SetExitTrap() = 0
        THEN
            CurRemoteServer = RemoteServer.Create();
            ASONameServer.Connect(p_v_name = l_v_akaname );

            l_i_status = CurRemoteServer.Call4GL('GetMetaDataInterface',
                                                 b_so_interface = BYREF(l_so_xml));

            parser.load(p_so_value = l_so_xml);
        ELSE
            // Connection Failed
            MESSAGE 'Unable to fetch Metagen information.';
        ENDIF;
    ENDIF;

    progress.bar = 1;

    CurFrame.Flush();
    parser.parse();


    IF parser.v_errortext <> ''
    THEN
        MESSAGE parser.v_errortext;
        parser.Dispose();
        RESUME;
    ENDIF;

    parser.arr_ucscpdef.Sort( v_application = AS_ASC );
    parser.arr_ucclassdef.Sort( v_qualified = AS_ASC );


    FOR l_j = 1 TO $JobTable.LastRow
    DO
        CurFrame.StatusText = Inform( v_msg = 'Executing Job ' + VARCHAR(l_j));

        progress.bar_jobs = l_j;
        progress.bar = 0;
        CurFrame.Flush();

        z = uc_template_block.Create();
        so_tmp.Value = $JobTable[l_j].v_inputfile;
        CALLPROC expand_envvars( p_so = so_tmp );
        /*
        srparser.SubGlobal( p_so = so_tmp );
        */
        CALLPROC string_replace( p_so = so_tmp,
                                 p_v_searchtext = '${root}',
                                 p_v_replacetext = v_dir );

        IF  $JobTable[l_j].i_job_set <> $RUNCOMMAND
        AND $JobTable[l_j].i_job_set <> $NONE
        THEN
            so_tmp.FileHandle = so_tmp.Value;
            z.parse( p_so_template = so_tmp );
        ENDIF;

        // For each class.
        IF $JobTable[l_j].i_job_set = $EACHCLASS
        THEN

            FIELD(progress.bar).MinValue = 0;
            FIELD(progress.bar).MaxValue = parser.arr_ucclassdef.LastRow ;
            progress.bar = 0;
            CurFrame.Flush();

            FOR l_i = 1 TO parser.arr_ucclassdef.LastRow
            DO
                l_i_ranblock = FALSE;

                progress.bar = l_i;

                CurFrame.Flush();
                l_so_file.Value = $JobTable[l_j].v_outputfile;

                l_so = StringObject.Create();
                l_UCClass = parser.arr_ucclassdef[l_i];

                l_v_package = LEFT(l_UCClass.v_qualified,
                                   LOCATE(l_UCClass.v_qualified,'!') - 1);

                l_v_package = LOWERCASE(l_v_package);

                z.RunBlock( p_so                  = l_so,
                            p_v_classname         = l_UCClass.v_qualified;
                            p_searchreplaceparser = srparser,
                            p_metagenparser       = parser );

                l_i_ranblock = TRUE;

                srparser.SubClass( p_v_classname = l_UCClass.v_qualified,
                                   p_so  = l_so );


                CALLPROC string_replace( p_so = l_so,
                                         p_v_searchtext = '${username}',
                                         p_v_replacetext = CurSession.UserName );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_searchtext = '${datenow}',
                                         p_v_replacetext = VARCHAR(DATE('now')) );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_searchtext = '${class_name}',
                                         p_v_replacetext = l_UCClass.v_name );

                l_tmpso.Value  = l_UCClass.v_name;

                srparser.SubMetaData( p_so = l_tmpso );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_searchtext = '${class_langname}',
                                         p_v_replacetext = l_tmpso.Value );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_searchtext = '${app_name}',
                                         p_v_replacetext = l_v_package );

                srparser.SubGlobal( p_so = l_so );

                /*------------------------------------------------------------*/
                /* Work out the file location.                                */
                /*------------------------------------------------------------*/

                CALLPROC expand_envvars( p_so = l_so_file );

                srparser.SubClass( p_v_classname = l_UCClass.v_qualified,
                                   p_so          = l_so_file );

                CALLPROC string_replace( p_so = l_so_file,
                                         p_v_searchtext = '${app_name}',
                                         p_v_replacetext = l_v_package );

                CALLPROC string_replace( p_so = l_so_file,
                                         p_v_searchtext = '${class_name}',
                                         p_v_replacetext = l_UCClass.v_name );

                CALLPROC string_replace( p_so = l_so_file,
                                         p_v_searchtext = '${class_langname}',
                                         p_v_replacetext = l_tmpso.Value );

                srparser.SubGlobal( p_so = l_so_file );

                                        /*------------------------------------*/
                                        /* Create all subdirectories          */
                                        /*------------------------------------*/

                l_so_tmp = l_so_file.Duplicate();

                l_v_dir = '';
                WHILE 1=1
                DO
                    l_i_pos = LOCATE(l_so_tmp.Value,v_slash);
                    IF l_i_pos > LENGTH(l_so_tmp.Value)
                    THEN
                        ENDLOOP;
                    ENDIF;

                    l_v_dir = l_v_dir + LEFT(l_so_tmp.Value,l_i_pos - 1);

                    l_so_tmp.Value = SHIFT(l_so_tmp.Value,-l_i_pos);

                    CurSession.CreateDirectory( directory = v_dir + l_v_dir );
                    l_v_dir = l_v_dir + '\';
                ENDWHILE;

                CurFrame.StatusText = Inform( v_msg = 'Writing file ' + v_dir
                                    + l_so_file.Value );
                l_so.WriteToFile(Filename = v_dir + l_so_file.Value );
            ENDFOR;

        ELSEIF $JobTable[l_j].i_job_set = $ALLSCPS
        THEN

            l_v_package = '';

            FIELD(progress.bar).MinValue = 0;
            FIELD(progress.bar).MaxValue = parser.arr_ucscpdef.LastRow ;


            progress.bar = 0;

            l_so_file.Value = $JobTable[l_j].v_outputfile;

            IF l_so_file.Value LIKE '%${app_name}%'
            THEN
                l_i_split = TRUE;
            ELSE
                l_i_split = FALSE;
            ENDIF;

            l_so = StringObject.Create();

            FOR l_k = 1 TO parser.arr_ucscpdef.LastRow
            DO

                progress.bar = l_k;

                CurFrame.Flush();

                l_i_ranblock = FALSE;

                IF  l_i_split = TRUE
                THEN
                    IF LOWERCASE(parser.arr_ucscpdef[l_k].v_application) <> l_v_package
                    THEN
                        l_so_file.Value = $JobTable[l_j].v_outputfile;

                        l_v_package = LOWERCASE(parser.arr_ucscpdef[l_k].v_application);

                        l_so = StringObject.Create();

                        z.RunBlock( p_so                  = l_so,
                                    p_metagenparser       = parser,
                                    p_searchreplaceparser = srparser,
                                    p_v_package           = l_v_package );

                        l_i_ranblock = TRUE;

                    ENDIF;
                ELSE
                    z.RunBlock( p_so                  = l_so,
                                p_metagenparser       = parser,
                                p_searchreplaceparser = srparser,
                                p_v_package           = '' );

                    l_i_ranblock = TRUE;
                    l_k = parser.arr_ucscpdef.LastRow; // Exit at end of FOR loop.
                ENDIF;

                IF l_i_ranblock = TRUE
                THEN

                    CALLPROC string_replace( p_so = l_so,
                                             p_v_searchtext = '${username}',
                                             p_v_replacetext = CurSession.UserName );

                    CALLPROC string_replace( p_so = l_so,
                                             p_v_searchtext = '${datenow}',
                                             p_v_replacetext = VARCHAR(DATE('now')) );

                    CALLPROC string_replace( p_so = l_so,
                                             p_v_searchtext = '${app_name}',
                                             p_v_replacetext = l_v_package );

                    srparser.SubGlobal( p_so = l_so );

                    /*--------------------------------------------------------*/
                    /* Work out the file location.                            */
                    /*--------------------------------------------------------*/

                    srparser.SubGlobal( p_so = l_so_file );

                    CALLPROC string_replace( p_so            = l_so_file,
                                             p_v_searchtext  = '${app_name}',
                                             p_v_replacetext = l_v_package );

                    CALLPROC expand_envvars( p_so = l_so_file );
                    srparser.SubGlobal( p_so = l_so_file );


                                        /*------------------------------------*/
                                        /* Create all subdirectories          */
                                        /*------------------------------------*/

                    l_so_tmp = l_so_file.Duplicate();

                    l_v_dir = '';
                    WHILE 1=1
                    DO
                        l_i_pos = LOCATE(l_so_tmp.Value,v_slash);
                        IF l_i_pos > LENGTH(l_so_tmp.Value)
                        THEN
                            ENDLOOP;
                        ENDIF;

                        l_v_dir = l_v_dir + LEFT(l_so_tmp.Value,l_i_pos - 1);

                        l_so_tmp.Value = SHIFT(l_so_tmp.Value,-l_i_pos);

                        CurSession.CreateDirectory( directory = v_dir + l_v_dir );

                        l_v_dir = l_v_dir + '\';
                    ENDWHILE;

                    CurFrame.StatusText = Inform( v_msg = 'Writing file ' + v_dir
                                          + l_so_file.Value);
                    l_so.WriteToFile(Filename = v_dir + l_so_file.Value );
                ENDIF;
            ENDFOR;

        ELSEIF $JobTable[l_j].i_job_set = $EACHSCP
        THEN
            FIELD(progress.bar).MinValue = 0;
            FIELD(progress.bar).MaxValue = parser.arr_ucscpdef.LastRow;
            progress.bar = 0;
            CurFrame.Flush();

            FOR l_i = 1 TO parser.arr_ucscpdef.LastRow
            DO
                progress.bar = l_i;

                CurFrame.Flush();

                l_i_ranblock = FALSE;
                l_so_file.Value = $JobTable[l_j].v_outputfile;

                l_so = StringObject.Create();
                l_UCSCP = parser.arr_ucscpdef[l_i];

                l_v_package = LOWERCASE(l_UCSCP.v_application);

                z.RunBlock( p_so                  = l_so,
                            p_metagenparser       = parser,
                            p_searchreplaceparser = srparser,
                            p_ucscpdefinition     = l_UCSCP,
                            p_v_package           = l_v_package );

                l_i_ranblock = TRUE;


                srparser.SubSCP( p_ucscpdefinition = l_UCSCP,
                                 p_so              = l_so );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_searchtext = '${username}',
                                         p_v_replacetext = CurSession.UserName );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_searchtext = '${datenow}',
                                         p_v_replacetext = VARCHAR(DATE('now')) );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_searchtext = '${app_name}',
                                         p_v_replacetext = l_v_package );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_replacetext = l_UCSCP.v_method,
                                         p_v_searchtext = '${scp_method}' );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_replacetext = l_UCSCP.v_procedure,
                                         p_v_searchtext = '${scp_procedure}' );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_replacetext = l_UCSCP.v_name,
                                         p_v_searchtext = '${scp_name}' );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_replacetext = l_UCSCP.v_class,
                                         p_v_searchtext = '${scp_class}' );

                CALLPROC string_replace( p_so = l_so,
                                         p_v_replacetext = l_UCSCP.v_name,
                                         p_v_searchtext = '${altscp_name}' );

                srparser.SubGlobal( p_so = l_so );

                /*------------------------------------------------------------*/
                /* Work out the file location.                                */
                /*------------------------------------------------------------*/

                srparser.SubSCP( p_ucscpdefinition = l_UCSCP,
                                 p_so              = l_so_file );

                srparser.SubGlobal( p_so = l_so_file );

                CALLPROC string_replace( p_so = l_so_file,
                                         p_v_searchtext = '${app_name}',
                                         p_v_replacetext = l_v_package );

                CALLPROC string_replace( p_so = l_so_file,
                                         p_v_replacetext = l_UCSCP.v_name,
                                         p_v_searchtext = '${scp_name}' );

                CALLPROC string_replace( p_so = l_so_file,
                                         p_v_replacetext = l_UCSCP.v_name,
                                         p_v_searchtext = '${altscp_name}' );

                CALLPROC expand_envvars( p_so = l_so_file );
                srparser.SubGlobal( p_so = l_so_file );

                                        /*------------------------------------*/
                                        /* Create all subdirectories          */
                                        /*------------------------------------*/

                l_so_tmp = l_so_file.Duplicate();

                l_v_dir = '';
                WHILE 1=1
                DO
                    l_i_pos = LOCATE(l_so_tmp.Value,v_slash);
                    IF l_i_pos > LENGTH(l_so_tmp.Value)
                    THEN
                        ENDLOOP;
                    ENDIF;

                    l_v_dir = l_v_dir + LEFT(l_so_tmp.Value,l_i_pos - 1);

                    l_so_tmp.Value = SHIFT(l_so_tmp.Value,-l_i_pos);

                    CurSession.CreateDirectory( directory = v_dir + l_v_dir );
                    l_v_dir = l_v_dir + '\';
                ENDWHILE;

                CurFrame.StatusText = Inform(v_msg = 'Writing file ' + v_dir
                                    + l_so_file.Value);
                l_so.WriteToFile(Filename = v_dir + l_so_file.Value );
            ENDFOR;
        ELSEIF $JobTable[l_j].i_job_set = $ALLCLASSES
        THEN
            l_v_package = '';

            FIELD(progress.bar).MinValue = 0;
            FIELD(progress.bar).MaxValue = parser.arr_ucclassdef.LastRow ;
            progress.bar = 0;
            CurFrame.Flush();

            l_so_file.Value = $JobTable[l_j].v_outputfile;

            IF l_so_file.Value LIKE '%${app_name}%'
            THEN
                l_i_split = TRUE;
            ELSE
                l_i_split = FALSE;
            ENDIF;

            l_so = StringObject.Create();

            FOR l_k = 1 TO parser.arr_ucclassdef.LastRow
            DO

                progress.bar = l_k;

                CurFrame.Flush();

                l_i_ranblock = FALSE;

                IF  l_i_split = TRUE
                THEN
                    IF LOWERCASE(LEFT(parser.arr_ucclassdef[l_k].v_qualified,
                                 LOCATE(parser.arr_ucclassdef[l_k].v_qualified,'!')-1)) <> l_v_package
                    THEN
                        l_so_file.Value = $JobTable[l_j].v_outputfile;

                        l_v_package = LEFT(parser.arr_ucclassdef[l_k].v_qualified,
                                           LOCATE(parser.arr_ucclassdef[l_k].v_qualified,'!') - 1);

                        l_v_package = LOWERCASE(l_v_package);

                        l_so = StringObject.Create();

                        z.RunBlock( p_so                  = l_so,
                                    p_metagenparser       = parser,
                                    p_searchreplaceparser = srparser,
                                    p_v_package           = l_v_package );

                        l_i_ranblock = TRUE;

                    ENDIF;
                ELSE
                    z.RunBlock( p_so                  = l_so,
                                p_metagenparser       = parser,
                                p_searchreplaceparser = srparser,
                                p_v_package           = '' );

                    l_i_ranblock = TRUE;
                    l_k = parser.arr_ucclassdef.LastRow; // Exit at end of FOR loop.

                    progress.bar = l_k;

                    CurFrame.Flush();
                ENDIF;

                IF l_i_ranblock = TRUE
                THEN


                    CALLPROC string_replace( p_so = l_so,
                                             p_v_searchtext = '${username}',
                                             p_v_replacetext = CurSession.UserName );

                    CALLPROC string_replace( p_so = l_so,
                                             p_v_searchtext = '${datenow}',
                                             p_v_replacetext = VARCHAR(DATE('now')) );

                    CALLPROC string_replace( p_so = l_so,
                                             p_v_searchtext = '${app_name}',
                                             p_v_replacetext = l_v_package );

                    srparser.SubGlobal( p_so = l_so );

                    /*--------------------------------------------------------*/
                    /* Work out the file location.                            */
                    /*--------------------------------------------------------*/

                    srparser.SubGlobal( p_so = l_so_file );

                    CALLPROC string_replace( p_so            = l_so_file,
                                             p_v_searchtext  = '${app_name}',
                                             p_v_replacetext = l_v_package );

                    CALLPROC expand_envvars( p_so = l_so_file );
                    srparser.SubGlobal( p_so = l_so_file );

                                        /*------------------------------------*/
                                        /* Create all subdirectories          */
                                        /*------------------------------------*/

                    l_so_tmp = l_so_file.Duplicate();

                    l_v_dir = '';
                    WHILE 1=1
                    DO
                        l_i_pos = LOCATE(l_so_tmp.Value,v_slash);
                        IF l_i_pos > LENGTH(l_so_tmp.Value)
                        THEN
                            ENDLOOP;
                        ENDIF;

                        l_v_dir = l_v_dir + LEFT(l_so_tmp.Value,l_i_pos - 1);

                        l_so_tmp.Value = SHIFT(l_so_tmp.Value,-l_i_pos);

                        CurSession.CreateDirectory( directory = v_dir + l_v_dir );

                        l_v_dir = l_v_dir + '\';
                    ENDWHILE;

                    CurFrame.StatusText = Inform( v_msg = 'Writing file ' + v_dir
                                          + l_so_file.Value);
                    l_so.WriteToFile(Filename = v_dir + l_so_file.Value );
                ENDIF;
            ENDFOR;
        ELSEIF $JobTable[l_j].i_job_set = $RUNCOMMAND
        THEN
            l_so = StringObject.Create();

            l_so.Value = $JobTable[l_j].v_inputfile;

            CALLPROC string_replace( p_so = l_so,
                                     p_v_searchtext = '${username}',
                                     p_v_replacetext = CurSession.UserName );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_searchtext = '${datenow}',
                                     p_v_replacetext = VARCHAR(DATE('now')) );

            srparser.SubGlobal( p_so = l_so );

            CALL SYSTEM l_so.Value;
        ENDIF;

        IF $JobTable[l_j].i_job_set <> $RUNCOMMAND
        AND $JobTable[l_j].i_job_set <> $NONE
        THEN
            z.Dispose();
        ENDIF;
    ENDFOR;

    FIELD(progress).CurBias = FB_INVISIBLE;

    parser.Dispose();
    parser = NULL;
    CurFrame.Trace('Generation ended at ' + VARCHAR(DATE('now')));
    CurFrame.Trace('====================================');
    CurFrame.StatusText = Inform( v_msg = 'Done' );
END

