/* EVENT: CLICK Tree                                                                              */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON USEREVENT 'SimulateTreeClick',
ON SETVALUE $Tree,
ON CLICK $Tree =
DECLARE
    i       = INTEGER NOT NULL,
    j       = INTEGER NOT NULL,
    i_test  = INTEGER NOT NULL,
    UCBatch = uc_batchreplace DEFAULT NULL;
    tn_node = TreeNode DEFAULT NULL;
    mb      = MenuButton DEFAULT NULL;
    l_class = uc_class_definition DEFAULT NULL;
    l_scp   = uc_scp_definition DEFAULT NULL;
ENDDECLARE
BEGIN

    tn_node  = FIELD($Tree).CurNode;

    IF tn_node IS NULL
    THEN
        RESUME NEXT;
    ENDIF;

    FIELD($SubTable).CurBias = FB_CHANGEABLE;

    /*------------------------------------------------------------------------*/
    /* Populate the tablefield.                                               */
    /*------------------------------------------------------------------------*/

    IF tn_node.ClientData IS NULL
    THEN
        $SubTable                = NULL;
        FIELD($SubTable).CurBias = FB_DIMMED;
    ELSE

        UCBatch = uc_batchreplace(tn_node.ClientData);

        $SubTable = UCBatch.arr_ucreplace;

        IF $SubTable.LastRow > FIELD($SubTable).NumVisibleRows
        THEN
            FIELD($SubTable).HasScrollBar = TRUE;
        ELSE
            FIELD($SubTable).HasScrollBar = FALSE;
        ENDIF;

    ENDIF;

    /*------------------------------------------------------------------------*/
    /* Populate the PropertyOptionMenu                                        */
    /*------------------------------------------------------------------------*/

    FOR i = FIELD($PropertyOptMenu.btn_new).ChildMenuFields.LastRow DOWNTO 4
    DO
        FIELD($PropertyOptMenu.btn_new).ChildMenuFields[i].ParentMenuGroup = NULL;
        FIELD($PropertyOptMenu.btn_new).ChildMenuFields.RemoveRow( RowNumber = i);
    ENDFOR;

    CASE tn_node.SelBmpLblIndx OF
    $TVF_ATTR:
    BEGIN
        FIELD($Tree).AllowLabelEdit = TRUE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_ENABLED;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_INVISIBLE;
    END
    $TVF_PARAM:
    BEGIN
        FIELD($Tree).AllowLabelEdit = TRUE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_ENABLED;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_INVISIBLE;
    END
    $TVF_CLASS:
    BEGIN
        l_class = parsercopy.GetClassByName( p_v_classname = tn_node.TextLabel );

        IF l_class IS NOT NULL
        THEN
            IF l_class.arr_ucdatadef.LastRow < $MAX_MENUENTRIES
            THEN
                i_test = FALSE;
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_INVISIBLE;
            ELSE
                i_test = TRUE;
                cl_popup.ChoiceItems.Clear();
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_ENABLED;
            ENDIF;

            j = 1;
            FOR i = 1 TO l_class.arr_ucdatadef.LastRow
            DO
                IF  i_test = TRUE
                AND FIELD($Tree).Tree.NodeByKey(KeyLabel = 'ATTR:' + l_class.arr_ucdatadef[i].v_name) IS NULL
                THEN
                    cl_popup.AddItem( EnumValue = j,
                                      TextValue = l_class.arr_ucdatadef[i].v_name,
                                      DisplayValue = l_class.arr_ucdatadef[i].v_name,
                                      BitmapValue = g_UCBitmaps.bo_attr );
                    j = j + 1;
                ELSE
                    mb = MenuButton.Create();
                    mb.TextLabel = l_class.arr_ucdatadef[i].v_name;
                    mb.ClientText = VARCHAR(i + 3);
                    mb.ParentMenuGroup = FIELD($PropertyOptMenu.btn_new);
                ENDIF;
            ENDFOR;
        ENDIF;

        FIELD($Tree).AllowLabelEdit = TRUE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_ENABLED;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_ENABLED;
    END
    $TVF_SCP:
    BEGIN
        l_scp = parsercopy.GetSCPByName( p_v_name = tn_node.TextLabel );

        IF l_scp IS NOT NULL
        THEN
            IF l_scp.arr_ucdatadef.LastRow < $MAX_MENUENTRIES
            THEN
                i_test = FALSE;
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_INVISIBLE;
            ELSE
                i_test = TRUE;
                cl_popup.ChoiceItems.Clear();
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_ENABLED;
            ENDIF;

            j = 1;
            FOR i = 1 TO l_scp.arr_ucdatadef.LastRow
            DO
                IF  i_test = TRUE
                AND FIELD($Tree).Tree.NodeByKey(KeyLabel = 'PARAM:' + l_scp.arr_ucdatadef[i].v_name) IS NULL
                THEN
                    cl_popup.AddItem( EnumValue    = j,
                                      TextValue    = l_scp.arr_ucdatadef[i].v_name,
                                      DisplayValue = l_scp.arr_ucdatadef[i].v_name,
                                      BitmapValue  = g_UCBitmaps.bo_param );
                    j = j + 1;
                ELSE
                    mb = MenuButton.Create();
                    mb.TextLabel       = l_scp.arr_ucdatadef[i].v_name;
                    mb.ClientText      = VARCHAR(i + 3);
                    mb.ParentMenuGroup = FIELD($PropertyOptMenu.btn_new);
                ENDIF;
            ENDFOR;
        ENDIF;

        FIELD($Tree).AllowLabelEdit = TRUE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_ENABLED;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_ENABLED;
    END

    $TVF_CLASSES:
    BEGIN
        IF parsercopy IS NULL
        THEN
            // Parse the metagen file
            CALLPROC GetMetaData();
        ENDIF;

        IF parsercopy IS NOT NULL THEN
            IF parsercopy.arr_ucclassdef.LastRow < $MAX_MENUENTRIES
            THEN
                i_test = FALSE;
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_INVISIBLE;
            ELSE
                i_test = TRUE;
                cl_popup.ChoiceItems.Clear();
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_ENABLED;
            ENDIF;

            j = 1;
            FOR i = 1 TO parsercopy.arr_ucclassdef.LastRow
            DO
                IF i_test = TRUE
                AND FIELD($Tree).Tree.NodeByKey(KeyLabel = 'CLASS:' + parsercopy.arr_ucclassdef[i].v_name) IS NULL
                THEN
                    cl_popup.AddItem( EnumValue = j,
                                      TextValue =
                                      parsercopy.arr_ucclassdef[i].v_name,
                                      DisplayValue = parsercopy.arr_ucclassdef[i].v_name,
                                      BitmapValue = g_UCBitmaps.bo_class );
                    j = j + 1;
                ELSE
                    mb = MenuButton.Create();
                    mb.TextLabel = parsercopy.arr_ucclassdef[i].v_qualified;
                    mb.ClientText = VARCHAR(i + 3);
                    mb.ParentMenuGroup = FIELD($PropertyOptMenu.btn_new);
                ENDIF;
            ENDFOR;
        ENDIF;

        FIELD($Tree).AllowLabelEdit = FALSE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_INVISIBLE;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_ENABLED;
    END

    $TVF_SCPS:
    BEGIN
        IF parsercopy IS NULL
        THEN
            // Parse the metagen file
            CALLPROC GetMetaData();
        ENDIF;

        IF parsercopy IS NOT NULL
        THEN
            IF parsercopy.arr_ucscpdef.LastRow < $MAX_MENUENTRIES
            THEN
                i_test = FALSE;
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_INVISIBLE;
            ELSE
                i_test = TRUE;
                cl_popup.ChoiceItems.Clear();
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_ENABLED;
            ENDIF;

            j = 1;
            FOR i = 1 TO parsercopy.arr_ucscpdef.LastRow
            DO
                IF  i_test = TRUE
                AND FIELD($Tree).Tree.NodeByKey(KeyLabel = 'SCP:' + parsercopy.arr_ucscpdef[i].v_name) IS NULL
                THEN
                    cl_popup.AddItem( EnumValue    = j,
                                      TextValue    = parsercopy.arr_ucscpdef[i].v_name,
                                      DisplayValue = parsercopy.arr_ucscpdef[i].v_name,
                                      BitmapValue  = g_UCBitmaps.bo_scp );
                    j = j + 1;
                ELSE
                    mb = MenuButton.Create();
                    mb.TextLabel = parsercopy.arr_ucscpdef[i].v_name;
                    mb.ClientText = VARCHAR(i + 3);
                    mb.ParentMenuGroup = FIELD($PropertyOptMenu.btn_new);
                ENDIF;
            ENDFOR;
        ENDIF;

        FIELD($Tree).AllowLabelEdit = FALSE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_INVISIBLE;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_ENABLED;
    END

    DEFAULT:
    BEGIN
        FIELD($Tree).AllowLabelEdit = FALSE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_INVISIBLE;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_INVISIBLE;
    END
    ENDCASE;

    FIELD($Tree).UpdField();
    tn_node.IsSelected = TRUE;
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT: EXPANDED Tree                                                                           */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON EXPANDED $Tree =
DECLARE
    i        = INTEGER NOT NULL;
    tn_node  = TreeNode DEFAULT NULL;
    tn_child = TreeNode DEFAULT NULL;
    UCBatch  = uc_batchreplace DEFAULT NULL;
    l_v_prefix = VARCHAR(10) NOT NULL;
ENDDECLARE
BEGIN
    tn_node = FIELD($Tree).TriggerNode;

    IF tn_node.Children = 0
    THEN
        tn_node.HasChildren = FALSE;
    ELSE
        tn_node.HasChildren = TRUE;
    ENDIF;

    IF tn_node.ClientData IS NULL
    THEN
        RESUME NEXT;
    ENDIF;

    /*------------------------------------------------------------------------*/
    /* Clear the subtree.                                                     */
    /*------------------------------------------------------------------------*/

    UCBatch = uc_batchreplace(tn_node.ClientData);

    IF tn_node.Children = 0
    THEN

        IF UCBatch.arr_ucbatch IS NOT NULL
        THEN
            IF tn_node.SelBmpLblIndx = $TVF_CLASS
            THEN
                l_v_prefix = 'ATTR:';
            ELSEIF tn_node.SelBmpLblIndx = $TVF_SCP
            THEN
                l_v_prefix = 'PARAM:';
            ELSEIF tn_node.SelBmpLblIndx = $TVF_CLASSES
            THEN
                l_v_prefix = 'CLASS:';
            ELSEIF tn_node.SelBmpLblIndx = $TVF_SCPS
            THEN
                l_v_prefix = 'SCP:';
            ENDIF;

            FOR i = 1 TO UCBatch.arr_ucbatch.LastRow
            DO
                tn_child = FIELD($Tree).Tree.AddNode(
                                        name = UCBatch.arr_ucbatch[i].v_name,
                                        KeyLabel = l_v_prefix + UCBatch.arr_ucbatch[i].v_name,
                                        relative = tn_node );
                tn_child.HasChildren = TRUE;
                tn_child.IsExpanded  = FALSE;
                tn_child.ClientData  = UCBatch.arr_ucbatch[i];

                IF tn_node.SelBmpLblIndx = $TVF_CLASS
                THEN
                    tn_child.BmpLblIndx    = $TVF_ATTR;
                    tn_child.SelBmpLblIndx = $TVF_ATTR;
                    tn_child.HasChildren   = FALSE;
                ELSEIF tn_node.SelBmpLblIndx = $TVF_SCP
                THEN
                    tn_child.BmpLblIndx    = $TVF_PARAM;
                    tn_child.SelBmpLblIndx = $TVF_PARAM;
                    tn_child.HasChildren   = FALSE;
                ENDIF;
            ENDFOR;
        ELSE
            tn_node.HasChildren = FALSE;
        ENDIF;

    ENDIF;

END

/*------------------------------------------------------------------------------------------------*/
/* EVENT: WINDOWRESIZED                                                                           */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON WINDOWRESIZED =
BEGIN
    IF CurFrame.WindowWidth < FIELD($JobTable).ParentField.Width
    THEN
        CurFrame.WindowWidth = FIELD($JobTable).ParentField.Width;
    ENDIF;

    WHILE FIELD($SubTable).Height < FIELD($Tree).Height
    DO
        FIELD($SubTable).NumVisibleRows = FIELD($SubTable).NumVisibleRows + 1;
        //CurFrame.Flush();
    ENDWHILE;

    WHILE FIELD($SubTable).Height > FIELD($Tree).Height
    DO
        FIELD($SubTable).NumVisibleRows = FIELD($SubTable).NumVisibleRows - 1;
        //CurFrame.Flush();
    ENDWHILE;

    FIELD($Tree).Height = FIELD($SubTable).Height;

    CurFrame.IsAutoSized = TRUE;
END

/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    PopulateTree                                                              */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE PopulateTree
(
)=
DECLARE
    i = INTEGER NOT NULL;
    tn_node = TreeNode DEFAULT NULL;
    tn_root = TreeNode DEFAULT NULL;
    tn_tmp  = TreeNode DEFAULT NULL;
ENDDECLARE
BEGIN

    FIELD($Tree).Tree.DeleteNode( node = FIELD($Tree).Tree.RootNode,
                                     allnodes = TRUE );

    tn_root = FIELD($Tree).Tree.AddNode( name = 'Substitutions' );
    tn_root.HasChildren   = TRUE;
    tn_root.IsExpanded    = TRUE;
    tn_root.BmpLblIndx    = $TVF_GLOBAL;
    tn_root.SelBmpLblIndx = $TVF_GLOBAL;

    tn_node = FIELD($Tree).Tree.AddNode( name = 'Default Values',
                                         relative = tn_root );
    tn_node.HasChildren = FALSE;
    tn_node.IsExpanded  = FALSE;
    tn_node.BmpLblIndx    = $TVF_GLOBAL;
    tn_node.SelBmpLblIndx = $TVF_GLOBAL;

    tn_node.ClientData = srparser.metadatareplace;

    tn_node = FIELD($Tree).Tree.AddNode( name = 'Globals',
                                            relative = tn_root );
    tn_node.HasChildren = FALSE;
    tn_node.IsExpanded  = FALSE;
    tn_node.BmpLblIndx    = $TVF_GLOBAL;
    tn_node.SelBmpLblIndx = $TVF_GLOBAL;

    tn_node.ClientData = srparser.globalreplace;

    tn_node = FIELD($Tree).Tree.AddNode( name = 'Types',
                                         relative = tn_root );
    tn_node.HasChildren = TRUE;
    tn_node.IsExpanded  = FALSE;
    tn_node.BmpLblIndx    = $TVF_TYPES;
    tn_node.SelBmpLblIndx = $TVF_TYPES;

    FOR i = 1 TO srparser.arr_typereplace.LastRow
    DO
        tn_tmp = FIELD($Tree).Tree.AddNode(
                        name     = srparser.arr_typereplace[i].v_name,
                        relative = tn_node );
        tn_tmp.HasChildren = FALSE;
        tn_tmp.IsExpanded  = FALSE;
        tn_tmp.BmpLblIndx    = $TVF_TYPE;
        tn_tmp.SelBmpLblIndx = $TVF_TYPE;
        tn_tmp.ClientData = srparser.arr_typereplace[i];
    ENDFOR;

    tn_node = FIELD($Tree).Tree.AddNode( name = 'Classes',
                                            relative = tn_root );
    tn_node.HasChildren   = TRUE;
    tn_node.IsExpanded    = FALSE;
    tn_node.BmpLblIndx    = $TVF_CLASSES;
    tn_node.SelBmpLblIndx = $TVF_CLASSES;

    FOR i = 1 TO srparser.arr_classreplace.LastRow
    DO
        tn_tmp = FIELD($Tree).Tree.AddNode(
                        name     = srparser.arr_classreplace[i].v_name,
                        keylabel = 'CLASS:' + srparser.arr_classreplace[i].v_name,
                        relative = tn_node );

        tn_tmp.HasChildren = TRUE;
        tn_tmp.IsExpanded  = FALSE;
        tn_tmp.BmpLblIndx    = $TVF_CLASS;
        tn_tmp.SelBmpLblIndx = $TVF_CLASS;
        tn_tmp.ClientData  = srparser.arr_classreplace[i];
    ENDFOR;

    tn_node = FIELD($Tree).Tree.AddNode( name = 'SCPs',
                                            relative = tn_root );
    tn_node.HasChildren   = TRUE;
    tn_node.IsExpanded    = FALSE;
    tn_node.BmpLblIndx    = $TVF_SCPS;
    tn_node.SelBmpLblIndx = $TVF_SCPS;

    FOR i = 1 TO srparser.arr_scpreplace.LastRow
    DO
        tn_tmp = FIELD($Tree).Tree.AddNode(
                        name     = srparser.arr_scpreplace[i].v_name,
                        keylabel = 'SCP:' + srparser.arr_scpreplace[i].v_name,
                        relative = tn_node );

        tn_tmp.HasChildren = TRUE;
        tn_tmp.IsExpanded  = FALSE;
        tn_tmp.ClientData  = srparser.arr_scpreplace[i];
        tn_tmp.BmpLblIndx    = $TVF_SCP;
        tn_tmp.SelBmpLblIndx = $TVF_SCP;
    ENDFOR;

    FIELD($Tree).CurNode=tn_root;

END


/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    SetState                                                                  */
/* Params in       :    New State                                                                 */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE SetState
(
    p_i_state = INTEGER NOT NULL;
)=
DECLARE
ENDDECLARE
BEGIN

    FIELD($ADVANCED).CurBias = FB_CHANGEABLE;
    FIELD(menu.mg_options.mg_language).CurBias = MB_ENABLED;

    CurFrame.IsAutoSized = TRUE;

    CASE p_i_state OF

    $STATE_INIT:
      BEGIN

        FIELD(btn_tb_new).CurBias    = FB_CHANGEABLE;
        FIELD(btn_tb_load).CurBias   = FB_CHANGEABLE;
        FIELD(btn_tb_reload).CurBias = FB_VISIBLE;
        FIELD(btn_tb_save).CurBias   = FB_VISIBLE;
        FIELD(btn_tb_go).CurBias     = FB_VISIBLE;

        FIELD(btn_tb_reload).BitmapLabel = g_UCBitmaps.bo_tb_reload_dim;
        FIELD(btn_tb_save  ).BitmapLabel = g_UCBitmaps.bo_tb_save_dim;
        FIELD(btn_tb_go    ).BitmapLabel = g_UCBitmaps.bo_tb_gen_dim;

        FIELD(menu.mg_file.btn_new).CurBias    = MB_ENABLED;
        FIELD(menu.mg_file.btn_load).CurBias   = MB_ENABLED;
        FIELD(menu.mg_file.btn_reload).CurBias = MB_DISABLED;
        FIELD(menu.mg_file.btn_save).CurBias   = MB_DISABLED;
        FIELD(menu.mg_generate.btn_go).CurBias = MB_DISABLED;

        FIELD($Tree).CurBias     = FB_DIMMED;
        FIELD($SubTable).CurBias = FB_DIMMED;
        FIELD($JobTable).CurBias = FB_DIMMED;
      END

    $STATE_VIEW:
      BEGIN
        FIELD(btn_tb_new).CurBias    = FB_CHANGEABLE;
        FIELD(btn_tb_load).CurBias   = FB_CHANGEABLE;
        FIELD(btn_tb_reload).CurBias = FB_CHANGEABLE;
        FIELD(btn_tb_save).CurBias   = FB_VISIBLE;
        FIELD(btn_tb_go).CurBias     = FB_CHANGEABLE;

        FIELD(btn_tb_reload).BitmapLabel = g_UCBitmaps.bo_tb_reload;
        FIELD(btn_tb_save  ).BitmapLabel = g_UCBitmaps.bo_tb_save_dim;
        FIELD(btn_tb_go    ).BitmapLabel = g_UCBitmaps.bo_tb_gen;

        FIELD(menu.mg_file.btn_new).CurBias    = MB_ENABLED;
        FIELD(menu.mg_file.btn_load).CurBias   = MB_ENABLED;
        FIELD(menu.mg_file.btn_reload).CurBias = MB_ENABLED;
        FIELD(menu.mg_file.btn_save).CurBias   = MB_DISABLED;
        FIELD(menu.mg_generate.btn_go).CurBias = MB_ENABLED;

        FIELD($Tree).CurBias     = FB_CHANGEABLE;
        FIELD($SubTable).CurBias = FB_CHANGEABLE;
        FIELD($JobTable).CurBias = FB_CHANGEABLE;
      END

    $STATE_EDIT:
      BEGIN
        FIELD(btn_tb_new).CurBias    = FB_CHANGEABLE;
        FIELD(btn_tb_load).CurBias   = FB_CHANGEABLE;
        FIELD(btn_tb_reload).CurBias = FB_CHANGEABLE;
        FIELD(btn_tb_save).CurBias   = FB_CHANGEABLE;
        FIELD(btn_tb_go).CurBias     = FB_CHANGEABLE;

        FIELD(btn_tb_reload).BitmapLabel = g_UCBitmaps.bo_tb_reload;
        FIELD(btn_tb_save  ).BitmapLabel = g_UCBitmaps.bo_tb_save;
        FIELD(btn_tb_go    ).BitmapLabel = g_UCBitmaps.bo_tb_gen;

        FIELD(menu.mg_file.btn_new).CurBias    = MB_ENABLED;
        FIELD(menu.mg_file.btn_load).CurBias   = MB_ENABLED;
        FIELD(menu.mg_file.btn_reload).CurBias = MB_ENABLED;
        FIELD(menu.mg_file.btn_save).CurBias   = MB_ENABLED;
        FIELD(menu.mg_generate.btn_go).CurBias = MB_ENABLED;

        FIELD($Tree).CurBias     = FB_CHANGEABLE;
        FIELD($SubTable).CurBias = FB_CHANGEABLE;
        FIELD($JobTable).CurBias = FB_CHANGEABLE;
      END

    DEFAULT:
        ;
    ENDCASE;

    // Ensure that dynamic biases are correct.
    CurFrame.SendUserEvent( EventName = 'SimulateTreeClick' );
    i_state = p_i_state;
END


/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    Inform                                                                    */
/* Params in       :    v_msg                                                                     */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE Inform
(
    v_msg = VARCHAR(256) NOT NULL;
)=
BEGIN
    IF  i_batchmode = TRUE
    AND v_msg <> ''
    THEN
        CurProcedure.Trace( Text = v_msg );
    ENDIF;

    RETURN v_msg;
END

PROCEDURE ParseJobFile
(
    pv_filename = VARCHAR(2000) NOT NULL;
    pso_filecontent = STRINGOBJECT DEFAULT NULL;
    pi_parsemetagen = INTEGER NOT NULL DEFAULT TRUE;
) =
DECLARE
    l_v_metagen = VARCHAR(512) NOT NULL;
    l_i_status  = INTEGER NOT NULL;
    l_UCReplace = uc_replace DEFAULT NULL;
    l_v_akaname = VARCHAR(100) NOT NULL;
    l_so_xml    = STRINGOBJECT;
    l_i_connect = SMALLINT NOT NULL;
ENDDECLARE
BEGIN
    IF pv_filename <> ''
    THEN
        CurFrame.StatusText = Inform( v_msg = 'Parsing proxy generator file:' + pv_filename);
    ELSE
        CurFrame.StatusText = Inform( v_msg = 'Parsing proxy generator filecontents.');
    ENDIF;

    CurFrame.Flush(); // Remove any screen garbage before long processing
    srparser = searchreplaceparser.Create();

    IF pv_filename <> ''
    THEN
        srparser.load( pv_filename = pv_filename );
    ELSE
        srparser.load( p_so_value = pso_filecontent );
    ENDIF;

    srparser.parse();

    IF srparser.v_errortext <> ''
    THEN
        CurFrame.Trace('Error parsing file ' + HC_QUOTE + pv_filename +
            HC_QUOTE + '.' + HC_RETURN + srparser.v_errortext );
        RETURN ER_FAIL;
    ENDIF;

    $JobTable = srparser.arr_uctemplatejob;
    CALLPROC PopulateTree();

    IF pi_parsemetagen = FALSE
    THEN
        CurFrame.StatusText = Inform( v_msg = 'Done.');

        RETURN ER_OK;
    ENDIF;

    RETURN GetMetaData();
END

/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    GetMetaData                                                               */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE GetMetaData
(
)=
DECLARE
    l_v_metagen = VARCHAR(512) NOT NULL;
    l_i_status  = INTEGER NOT NULL;
    l_UCReplace = uc_replace DEFAULT NULL;
    l_v_akaname = VARCHAR(100) NOT NULL;
    l_so_xml    = STRINGOBJECT;
    l_i_connect = SMALLINT NOT NULL;
ENDDECLARE
BEGIN
    parser = metagenparser.Create();
    parser.fe_main = CurFrame;

    /*--------------------------------------------------------------------------------------------*/
    /* Either use the specified metagen file, or connect directly to the app                      */
    /* server.                                                                                    */
    /*--------------------------------------------------------------------------------------------*/

    l_UCReplace = srparser.globalreplace.Find( pv_find = '${aka_name}' );

    IF l_UCReplace IS NOT NULL
    THEN
        l_v_akaname = l_UCReplace.v_replace;
    ENDIF;

    l_UCReplace = srparser.globalreplace.Find( pv_find = '${metagenfile}' );

    l_i_connect = TRUE;

    IF l_UCReplace IS NOT NULL
    THEN
        IF SQUEEZE(l_UCReplace.v_replace) != ''
        THEN
            l_i_connect = FALSE;
        ENDIF;
    ENDIF;

    IF l_i_connect = FALSE
    THEN
        l_v_metagen = l_UCReplace.v_replace;
        CurFrame.StatusText = Inform( v_msg = 'Parsing Metagen file.');
        parser.load( pv_filename = l_v_metagen );
    ELSE
        CurFrame.StatusText = Inform( v_msg = 'Connecting to application.');

        /*--------------------------------------------------------------------*/
        /* Connect to appserver.                                              */
        /*--------------------------------------------------------------------*/

        IF CurFrame.SetExitTrap() = 0
        THEN
            CurRemoteServer = RemoteServer.Create();
            ASONameServer.Connect(p_v_name = l_v_akaname);

            l_i_status = CurRemoteServer.Call4GL('GetMetaDataInterface',
                                                 b_so_interface = BYREF(l_so_xml));

            parser.load(p_so_value = l_so_xml);
        ELSE
            MESSAGE 'Could not load Metagen information.';
        ENDIF;

    ENDIF;

    parser.parse();

    IF parser.v_errortext <> ''
    THEN
        MESSAGE 'An error occurred attempting to fetch Metagen ' +
        'information from application ' + HC_QUOTE + l_v_akaname +
        HC_QUOTE + '. No information was retrieved.';
        parser.Dispose();
        RETURN ER_OK;
    ENDIF;

    IF parsercopy IS NOT NULL
    THEN
        parsercopy.Dispose();
    ENDIF;

    parsercopy = parser;
    parsercopy.arr_ucscpdef.Sort( v_application = AS_ASC );
    parsercopy.arr_ucclassdef.Sort( v_qualified = AS_ASC );

    CurFrame.StatusText = Inform( v_msg = 'Done.');

    RETURN ER_OK;
END

