COMPONENT.script:
			/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/* Frame           : Template editor                                                              */
/*                                                                                                */
/* Frame Name      : proxygen0050_template                                                        */
/*                                                                                                */
/* System Name     : ProxyGen                                                                     */
/*                                                                                                */
/* Sub-System Name : N/A                                                                          */
/*                                                                                                */
/* Author          : I. Utley       (Luminary Solutions)                                          */
/*                                                                                                */
/* Date            : 07/09/2002                                                                   */
/*                                                                                                */
/* Description     : Frame for editing templates.                                                 */
/*                                                                                                */
/* Version History                                                                                */
/*                                                                                                */
/* Version Date     Who   Description                                                             */
/* ------- -------- ----- -----------                                                             */
/* 1.0     07/09/02 IU    Original version.                                                       */
/* 1.1     08/02/08 AGS   Modified for open source release.                                       */
/* 1.2     31/03/08 TGR   Corrected error messages.                                               */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/

#define $MAYBE           '3'
#define $COLORS          'mtx_color'
#define $TYPES           'stk_types'
#define $TVF_CLASS       '1'
#define $TVF_CLASSES     '2'
#define $TVF_SCP         '3'
#define $TVF_SCPS        '4'
#define $TVF_GLOBAL      '5'
#define $TVF_PARAM       '6'
#define $TVF_ATTR        '7'
#define $TVF_TYPES       '8'
#define $TVF_TYPE        '9'

#define $MAX_MENUENTRIES '15'

#define $Tree            'tvf_subs'
#define $PropertyOptMenu '$Tree.popmenu_$Tree'

#define $EACHCLASS       '1'
#define $ALLSCPS         '2'
#define $ALLCLASSES      '3'
#define $EACHSCP         '4'

INITIALISE
(
/*------------------------------------------------------------------------------------------------*/
/* Parameters passed by value                                                                     */
/*------------------------------------------------------------------------------------------------*/

p_v_filename = VARCHAR(2000) NOT NULL;
parsercopy   = metagenparser DEFAULT NULL;
srparser     = searchreplaceparser DEFAULT NULL;

/*------------------------------------------------------------------------------------------------*/
/* Parameters passed BYREF                                                                        */
/*------------------------------------------------------------------------------------------------*/

/* none */

)=

DECLARE

/*------------------------------------------------------------------------------------------------*/
/* Variables local to this frame and its local procedures                                         */
/*------------------------------------------------------------------------------------------------*/

UCTemplateBlock = uc_template_block;
so              = StringObject;
so_dochistory   = StringObject;
i               = INTEGER NOT NULL;
j               = INTEGER NOT NULL;
k               = INTEGER NOT NULL;
arr_so          = ARRAY OF STRINGOBJECT;
v_match         = VARCHAR(2000);
i_size          = INTEGER NOT NULL;
i_edited        = INTEGER NOT NULL;
i_tbl_row       = INTEGER NOT NULL;
cl_popup        = CHOICELIST;

/*------------------------------------------------------------------------------------------------*/
/* Procedures local to this frame                                                                 */
/*------------------------------------------------------------------------------------------------*/

AddSource      = PROCEDURE RETURNING INTEGER NOT NULL;
ColourSource   = PROCEDURE RETURNING NONE;
ToggleSet      = PROCEDURE RETURNING INTEGER NOT NULL;
EncodeSource   = PROCEDURE RETURNING NONE;
UpdateTypes    = PROCEDURE RETURNING NONE;
PopulateTree   = PROCEDURE RETURNING NONE;
CompareBitmaps = PROCEDURE RETURNING INTEGER NOT NULL;

ENDDECLARE

BEGIN

    CurFrame.WindowTitle = CurFrame.WindowTitle + ': ' + p_v_filename;

    IF CurSession.FileExists( FileName = p_v_filename ) = TRUE
    THEN
        so.FileHandle = p_v_filename;
    ELSE
        so.Value = '';
        i_edited = TRUE; // New files are edited
    ENDIF;

    IF so.Value IS NULL
    THEN
        so.Value = '';
    ENDIF;

    IF UCTemplateBlock.parse( p_so_template = so ) <> ER_OK
    THEN
        CurFrame.InfoPopup(
            MessageType = MT_ERROR,
            MessageText = 'An error occurred parsing the template file. ' +
                          'The trace window should provide more information ' +
                          'on the cause of the error. Press OK to exit the ' +
                          'editor.');
        RETURN;
    ENDIF;

    k = 1;
    k = CALLPROC AddSource( p_i_lineno = 1,
                            p_ucblock  = UCTemplateBlock );

    IF k = 0
    THEN
        tbf_source[1].v_line ='';
    ENDIF;

    $COLORS.colorstk_common.SetDefaultColor( Color = CC_BLACK );
    $COLORS.colorstk_common.v_orientation = 'U';
    $COLORS.colorstk_array.SetDefaultColor( Color  = CC_RED);
    $COLORS.colorstk_array.v_orientation = 'U';
    $COLORS.colorstk_class.SetDefaultColor( Color  = CC_GREEN);
    $COLORS.colorstk_class.v_orientation = 'U';
    $COLORS.colorstk_scalar.SetDefaultColor( Color = CC_BLUE);
    $COLORS.colorstk_scalar.v_orientation = 'U';

    CurFrame.Window.Realize();

    CALLPROC ColourSource();

    FIELD($Tree).ImageList[ $TVF_CLASS   ] = FIELD(imgt_class).Image;
    FIELD($Tree).ImageList[ $TVF_CLASSES ] = FIELD(imgt_classes).Image;
    FIELD($Tree).ImageList[ $TVF_SCP     ] = FIELD(imgt_scp).Image;
    FIELD($Tree).ImageList[ $TVF_SCPS    ] = FIELD(imgt_scps).Image;
    FIELD($Tree).ImageList[ $TVF_GLOBAL  ] = FIELD(imgt_global).Image;
    FIELD($Tree).ImageList[ $TVF_PARAM   ] = FIELD(imgt_param).Image;
    FIELD($Tree).ImageList[ $TVF_ATTR    ] = FIELD(imgt_attr).Image;
    FIELD($Tree).ImageList[ $TVF_TYPES   ] = FIELD(imgt_types).Image;
    FIELD($Tree).ImageList[ $TVF_TYPE    ] = FIELD(imgt_type).Image;

    FIELD(tbf_subs).CurBias = FB_DIMMED;
    FIELD(tbf_source).DoScrollOnDrag = TRUE;
    CALLPROC PopulateTree();
    mef_note = so_dochistory;
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): CHILDCLICK popbtn                                                                    */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CHILDCLICK popbtn.mg_global,
ON CHILDCLICK popbtn.mg_application,
ON CHILDCLICK popbtn.mg_class,
ON CHILDCLICK popbtn.mg_attribute,
ON CHILDCLICK popbtn.mg_scp,
ON CHILDCLICK popbtn.mg_parameter =
DECLARE
    l_ef     = ENTRYFIELD DEFAULT NULL;
    l_tf     = TABLEFIELD DEFAULT NULL;
    l_i      = INTEGER NOT NULL;
    l_i_hs   = INTEGER NOT NULL;
    l_i_he   = INTEGER NOT NULL;
    l_v_name = VARCHAR(256) NOT NULL;
    l_v_val  = VARCHAR(256) NOT NULL;
    l_dynexpr= DynExpr DEFAULT NULL;
ENDDECLARE
BEGIN
    IF CurFrame.InputFocusField IS NOT NULL
    THEN
        IF CurFrame.InputFocusField.IsA( Class = EntryField ) = TRUE
        THEN
                                                  /*----------------------------------------------*/
                                                  /* If we are in a tablefield, then we cannot    */
                                                  /* just set the textvalue                       */
                                                  /*----------------------------------------------*/

            l_ef = ENTRYFIELD(CurFrame.InputFocusField);
            l_i_hs = l_ef.FirstMarked;
            l_i_he = l_ef.LastMarked;

            IF l_i_hs = 0
            THEN
                l_i_hs = l_ef.CursorPosition;
                l_i_he = l_ef.CursorPosition;
            ENDIF;

            l_tf = l_ef.WhichTableField();

            IF l_tf IS NOT NULL
            THEN
                l_i = l_tf.ActiveRow;
                l_v_name = l_tf.FullName + '[' + VARCHAR(l_i) + '].' +
                    l_ef.Name;
                l_dynexpr = CurEventScope.CreateDynExpr( String = l_v_name );

                l_dynexpr.GetValue( value = BYREF(l_v_val) );
                l_v_val = LEFT(l_ef.TextValue,l_i_hs-1) +
                          MENUBUTTON(CurFrame.TriggerField).TextLabel +
                          RIGHT(l_ef.TextValue,LENGTH(l_ef.TextValue) - l_i_he);

                l_dynexpr.SetValue(value = l_v_val );

                l_ef.CursorPosition = l_i_hs + LENGTH( MENUBUTTON(CurFrame.TriggerField).TextLabel);
            ELSE
                ENTRYFIELD(CurFrame.InputFocusField).TextValue =
                                MENUBUTTON(CurFrame.TriggerField).TextLabel;
            ENDIF;
        ENDIF;
    ENDIF;
END

