/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): CLICK menu.mg_edit.btn_clear                                                         */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CLICK menu.mg_edit.btn_clear =
DECLARE
    l_i  = INTEGER NOT NULL;
ENDDECLARE
BEGIN
    FOR l_i = tbf_source.LastRow DOWNTO 1
    DO
        IF  tbf_source[l_i]._RowSelected = TRUE
        THEN
            tbf_source.RemoveRow( RowNumber = l_i );
            i_edited = TRUE;
        ENDIF;

        IF tbf_source.LastRow = 0
        THEN
            tbf_source.InsertRow( RowNumber = 1,
                                  RowObject = source_line.Create());
        ENDIF;

    ENDFOR;

    CALLPROC ColourSource();
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT(S):  CLICK menu.mg_edit.btn_cut                                                          */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CLICK menu.mg_edit.btn_cut =
DECLARE
    l_so = StringObject;
    l_i  = INTEGER NOT NULL;
ENDDECLARE
BEGIN
    FOR l_i = tbf_source.LastRow DOWNTO 1
    DO
        IF  tbf_source[l_i]._RowSelected = TRUE
        AND tbf_source[l_i].i_comment = FALSE
        THEN
            l_so.ConcatVarchar( Text = tbf_source[l_i].v_line + HC_NEWLINE );
            tbf_source.RemoveRow( RowNumber = l_i );
            i_edited = TRUE;
        ENDIF;

        IF tbf_source.LastRow = 0
        THEN
            tbf_source.InsertRow( RowNumber = 1,
                                  RowObject = source_line.Create());
        ENDIF;

    ENDFOR;

    CALLFRAME proxygen0040_clipboard( b_so = l_so,
                                      c_op = 'X'   );

    CALLPROC ColourSource();
END


