/* EVENT(S): CLICK menu.mg_edit.btn_copy                                                          */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CLICK menu.mg_edit.btn_copy  =
DECLARE
    l_so = StringObject;
    l_i  = INTEGER NOT NULL;
ENDDECLARE
BEGIN
    FOR l_i = 1 TO tbf_source.LastRow
    DO
        IF tbf_source[l_i]._RowSelected = TRUE
        AND tbf_source[l_i].i_comment = FALSE
        THEN
            l_so.ConcatVarchar( Text = tbf_source[l_i].v_line + HC_NEWLINE );
        ENDIF;
    ENDFOR;

    CALLFRAME proxygen0040_clipboard( b_so = l_so,
                                      c_op = 'C'   );

END

/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): CLICK menu.mg_edit.btn_paste                                                         */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CLICK menu.mg_edit.btn_paste =
DECLARE
    l_so       = StringObject;
    l_arr_so   = ARRAY OF StringObject,
    l_i        = INTEGER NOT NULL;
    sourceline = source_line DEFAULT NULL;
ENDDECLARE
BEGIN
    CALLFRAME proxygen0040_clipboard( b_so = BYREF(l_so));

    CALLPROC split( p_c_split = HC_NEWLINE,
                    p_so_text = l_so,
                    b_arr_so = BYREF(l_arr_so));

    sourceline = tbf_source[i_tbl_row].Duplicate();

    sourceline.i_comment        = FALSE;
    sourceline.so_comment.Value = '';

    FOR l_i = 1 TO l_arr_so.LastRow
    DO
        sourceline.v_line = l_arr_so[l_i].Value;
        tbf_source.InsertRow( RowNumber = i_tbl_row + l_i,
                              RowObject = sourceline.Duplicate() );
    ENDFOR;

    CALLPROC ColourSource();
END

