/* EVENT(S): SELECTIONCHANGED tbf_source                                                          */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON SELECTIONCHANGED tbf_source =
DECLARE
    l_i = INTEGER NOT NULL;
ENDDECLARE
BEGIN
    l_i = tbf_source.LastRow;

    FIELD(menu.mg_edit.btn_copy).CurBias = MB_DISABLED;
    FIELD(menu.mg_edit.btn_copy).CurBias = MB_DISABLED;

    WHILE l_i > 0
    DO
        IF tbf_source[l_i]._RowSelected = TRUE
        THEN
            FIELD(menu.mg_edit.btn_copy).CurBias = MB_ENABLED;
            FIELD(menu.mg_edit.btn_copy).CurBias = MB_ENABLED;
        ENDIF;

        l_i = l_i - 1;
    ENDWHILE;

END


/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): Close window                                                                         */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CLICK menu.mg_file.btn_close,
ON WINDOWCLOSE =
DECLARE
    i_status = INTEGER NOT NULL;
    l_so     = STRINGOBJECT;
ENDDECLARE
BEGIN
    IF FIELD(tbf_source).HasDataChanged = TRUE
    OR i_edited = TRUE
    THEN
        i_status = CurFrame.ConfirmPopup(
                        MessageText = 'Do you want to save your changes to ' +
                            HC_QUOTE + p_v_filename + HC_QUOTE  );

        IF i_status = PU_OK
        THEN
            CALLPROC EncodeSource( p_so = l_so );
            l_so.WriteToFile( FileName = p_v_filename );
        ENDIF;
    ENDIF;

    RETURN;
END


/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): CHILDDOUBLECLICK tbf_source[*].bo_comment                                            */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CHILDDOUBLECLICK tbf_source[*].bo_comment =
DECLARE
    l_sourceline = source_line default null;
ENDDECLARE
BEGIN
    mef_note = StringObject.Create();
    mef_note.Value = 'Enter your comment here.';

    l_sourceline = source_line(IMAGEFIELD(CurFrame.TriggerField).Image.ClientData);

    FOR i = 1 TO tbf_source.LastRow
    DO
        IF tbf_source[i] = l_sourceline
        THEN
            ENDLOOP;
        ENDIF;
    ENDFOR;

    l_sourceline = l_sourceline.Duplicate();
    l_sourceline.i_comment  = TRUE;
    l_sourceline.v_line  = 'A new comment at ' + VARCHAR(DATE('now'));
    l_sourceline.so_comment = mef_note;
    tbf_source.InsertRow( RowNumber = i, RowObject = l_sourceline );

    CALLPROC ColourSource();
    i_edited = TRUE;
END


