/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): SETVALUE opti_block                                                                  */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON SETVALUE opti_block =
DECLARE
    i_row = INTEGER NOT NULL;
ENDDECLARE
BEGIN
    FOR i_row = 1 TO tbf_source.LastRow
    DO
        IF tbf_source[i_row]._RowSelected = TRUE
        OR i_row = FIELD(tbf_source).CurRow
        THEN
            CASE opti_block OF
            1:
            BEGIN
                tbf_source[i_row].i_foreachapp   = FALSE;
                tbf_source[i_row].i_foreachattr  = FALSE;
                tbf_source[i_row].i_foreachparam = FALSE;
                tbf_source[i_row].i_foreachscp   = FALSE;
                tbf_source[i_row].i_foreachclass = FALSE;
            END
            2:
            BEGIN
                tbf_source[i_row].i_foreachapp   = TRUE;
            END
            3:
            BEGIN
                tbf_source[i_row].i_foreachparam = FALSE;
                tbf_source[i_row].i_foreachattr  = TRUE;
            END
            4:
            BEGIN
                tbf_source[i_row].i_foreachattr  = FALSE;
                tbf_source[i_row].i_foreachparam = TRUE;
            END
            5:
            BEGIN
                tbf_source[i_row].i_foreachscp   = TRUE;
                tbf_source[i_row].i_foreachparam = FALSE;
                tbf_source[i_row].i_foreachattr  = FALSE;
            END
            6:
            BEGIN
                tbf_source[i_row].i_foreachclass = TRUE;
                tbf_source[i_row].i_foreachparam = FALSE;
                tbf_source[i_row].i_foreachattr  = FALSE;
            END
            DEFAULT:
             //
             ;
            ENDCASE;
        ENDIF;
    ENDFOR;

    CALLPROC ColourSource();
END

