                tbf_source[i_row].i_float      = $TYPES.tgl_float;
                tbf_source[i_row].i_byte       = $TYPES.tgl_byte;
                tbf_source[i_row].i_double     = $TYPES.tgl_double;
                tbf_source[i_row].i_short      = $TYPES.tgl_short;
                tbf_source[i_row].i_decimal    = $TYPES.tgl_decimal;
                tbf_source[i_row].i_int        = $TYPES.tgl_int;
                tbf_source[i_row].i_money      = $TYPES.tgl_money;
            ELSE
                tbf_source[i_row].i_bytearray  = $MAYBE;
                tbf_source[i_row].i_string     = $MAYBE;
                tbf_source[i_row].i_datetime   = $MAYBE;
                tbf_source[i_row].i_float      = $MAYBE;
                tbf_source[i_row].i_byte       = $MAYBE;
                tbf_source[i_row].i_double     = $MAYBE;
                tbf_source[i_row].i_short      = $MAYBE;
                tbf_source[i_row].i_decimal    = $MAYBE;
                tbf_source[i_row].i_int        = $MAYBE;
                tbf_source[i_row].i_money      = $MAYBE;
            ENDIF;

        ENDIF;
    ENDFOR;
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): CHILDKEYPRESS tbf_source[*].v_line                                                   */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CHILDKEYPRESS tbf_source[*].v_line =
DECLARE
    keyinfo    = KeyPressInfo,
    i_row      = INTEGER NOT NULL;
    v_tmp      = VARCHAR(2000) NOT NULL;
    SourceLine = source_line DEFAULT NULL;
ENDDECLARE
BEGIN
    keyinfo = KeyPressInfo(CurFrame.MessageObject);

    i_row = FIELD(tbf_source).CurRow;
    i_size = 1;

    IF (keyinfo.AnsiCode = 8) // Backspace C-h
    AND ENTRYFIELD(CurFrame.TriggerField).CursorPosition = 1
    AND i_row > 1
    THEN
        // Join lines if possible.
        i_size = LENGTH(tbf_source[i_row-1].v_line);
        tbf_source[i_row - 1].v_line =
            tbf_source[i_row - 1].v_line +
            ENTRYFIELD(CurFrame.TriggerField).BufferText;
        tbf_source.RemoveRow( RowNumber = i_row );
        FIELD(tbf_source).ActiveRow = i_row - 1;

        CALLPROC ColourSource( p_i_row = i_row);

    ENDIF;

    IF (keyinfo.AnsiCode = 13)
    THEN
        v_tmp = ENTRYFIELD(CurFrame.TriggerField).BufferText;

        SourceLine = tbf_source[i_row].Duplicate();
        SourceLine.v_line=RIGHT(tbf_source[i_row].v_line,
                    LENGTH(v_tmp) -
                    ENTRYFIELD(CurFrame.TriggerField).CursorPosition + 1);
        tbf_source[i_row].v_line=LEFT(v_tmp,
                    ENTRYFIELD(CurFrame.TriggerField).CursorPosition - 1);

        tbf_source.InsertRow( RowObject = SourceLine,
                              RowNumber = i_row+1 );
        CALLPROC ColourSource( p_i_start = i_row,
                               p_i_end   = i_row + 2);
    ENDIF;
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): CHILDENTRY tbf_source[*].v_line                                                      */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CHILDENTRY tbf_source[*].v_line =
DECLARE
    i       = INTEGER NOT NULL;
    i_row   = INTEGER NOT NULL;
    SourceLine = source_line DEFAULT NULL;
ENDDECLARE
BEGIN
    CurFrame.StatusText = '';

    i_row = FIELD(tbf_source).CurRow;
    i_tbl_row = i_row;

    SourceLine = tbf_source[i_row];

    IF SourceLine.i_array = TRUE
    THEN
        opti_type = 2;
    ELSEIF SourceLine.i_class = TRUE
    THEN
        opti_type = 3;
    ELSEIF SourceLine.i_scalar = TRUE
    THEN
        opti_type = 4;
    ELSE
        opti_type = 1;
    ENDIF;

    IF SourceLine.i_foreachattr = TRUE
    THEN
        opti_block = 3;
    ELSEIF SourceLine.i_foreachparam = TRUE
    THEN
        opti_block = 4;
    ELSEIF SourceLine.i_foreachscp = TRUE
    THEN
        opti_block = 5;
    ELSEIF SourceLine.i_foreachapp =  TRUE
    THEN
        opti_block = 2;
    ELSEIF SourceLine.i_foreachclass = TRUE
    THEN
        opti_block = 6;
    ELSE
        opti_block = 1;
    ENDIF;

    opti_scptype = SourceLine.i_genscp;

    IF SourceLine.i_nullable = TRUE
    THEN
        opti_null = 2;
    ELSEIF SourceLine.i_nullable = FALSE
    THEN
        opti_null = 3;
    ELSE
        opti_null = 1;
    ENDIF;

    IF SourceLine.i_dvnull = TRUE
    THEN
        opti_default = 3;
    ELSE
        opti_default = 2;
    ENDIF;

    IF SourceLine.i_bytearray != $MAYBE
    OR SourceLine.i_string    != $MAYBE
    OR SourceLine.i_datetime  != $MAYBE
    OR SourceLine.i_float     != $MAYBE
    OR SourceLine.i_byte      != $MAYBE
    OR SourceLine.i_double    != $MAYBE
    OR SourceLine.i_short     != $MAYBE
    OR SourceLine.i_decimal   != $MAYBE
    OR SourceLine.i_int       != $MAYBE
    OR SourceLine.i_money     != $MAYBE
    THEN
        $TYPES.tgl_applies = TRUE;

        $TYPES.tgl_bytearrays = ToggleSet(p_i_val = SourceLine.i_bytearray);
        $TYPES.tgl_strings    = ToggleSet(p_i_val = SourceLine.i_string);
        $TYPES.tgl_dates      = ToggleSet(p_i_val = SourceLine.i_datetime);
        $TYPES.tgl_float      = ToggleSet(p_i_val = SourceLine.i_float);
        $TYPES.tgl_byte       = ToggleSet(p_i_val = SourceLine.i_byte);
        $TYPES.tgl_double     = ToggleSet(p_i_val = SourceLine.i_double);
        $TYPES.tgl_short      = ToggleSet(p_i_val = SourceLine.i_short);
        $TYPES.tgl_decimal    = ToggleSet(p_i_val = SourceLine.i_decimal);
        $TYPES.tgl_int        = ToggleSet(p_i_val = SourceLine.i_int);
        $TYPES.tgl_money      = ToggleSet(p_i_val = SourceLine.i_money);

    ELSE
        $TYPES.tgl_applies = FALSE;
    ENDIF;

    CALLPROC UpdateTypes();

    mef_note = so_dochistory;
END

