ON CHILDSETVALUE tbf_subs=
BEGIN
    CurFrame.ParentFrame.SendUserEvent( EventName      = 'SetState',
                                        MessageInteger = 3 //Edit
                                      );
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): CHILDENTRY tbf_subs                                                                  */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CHILDENTRY tbf_subs =
DECLARE
   l_i_row = INTEGER NOT NULL;
ENDDECLARE
BEGIN
   FIELD(tbf_subs).IsHighlighted = True;

   FOR l_i_row = tbf_subs.LastRow DOWNTO tbf_subs.FirstRow
   DO
       IF  SQUEEZE(tbf_subs[l_i_row].v_find) = ''
       AND l_i_row <> FIELD(tbf_subs).CurRow
       THEN
           tbf_subs.RemoveRow( RowNumber = l_i_row );
       ENDIF;
   ENDFOR;

END


/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): CHILDEXIT tbf_subs                                                                   */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON CHILDEXIT tbf_subs =
DECLARE
   l_i_row = INTEGER NOT NULL;
ENDDECLARE
BEGIN
   FIELD(tbf_subs).IsHighlighted = FALSE;

   l_i_row = FIELD(tbf_subs).CurRow;

   IF SQUEEZE(tbf_subs[l_i_row].v_find) = ''
   THEN
       IF FIELD(tbf_subs).TargetRow >= l_i_row
       THEN
           FIELD(tbf_subs).TargetRow = FIELD(tbf_subs).TargetRow - 1;
       ENDIF;
       tbf_subs.RemoveRow( RowNumber = l_i_row );
   ENDIF;

   IF FIELD(tbf_subs).IsAncestorOf( descendant = CurFrame.TargetField ) = TRUE
   OR FIELD(tbf_subs).IsAncestorOf( descendant = CurFrame.NextTargetField ) = TRUE
   THEN
       IF FIELD(tbf_subs).TargetRow - 1 > tbf_subs.LastRow
       THEN
           FIELD(tbf_subs).TargetRow = tbf_subs.LastRow;
       ENDIF;

       IF CurFrame.NextTargetField IS NOT NULL
       THEN
           FIELD(tbf_subs).SetInputFocus( Row    = FIELD(tbf_subs).TargetRow,
                                          Column = CurFrame.NextTargetField.Name );
       ELSE
           FIELD(tbf_subs).SetInputFocus( Row    = FIELD(tbf_subs).TargetRow,
                                          Column = CurFrame.TargetField.Name );
       ENDIF;
   ENDIF;
END

/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): USEREVENT SimulateTreeClick                                                          */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON USEREVENT 'SimulateTreeClick',
ON CLICK $Tree =
DECLARE
    i       = INTEGER NOT NULL,
    j       = INTEGER NOT NULL,
    i_test  = INTEGER NOT NULL,
    UCBatch = uc_batchreplace DEFAULT NULL;
    tn_node = TreeNode DEFAULT NULL;
    mb      = MenuButton DEFAULT NULL;
    l_class = uc_class_definition DEFAULT NULL;
    l_scp   = uc_scp_definition DEFAULT NULL;
ENDDECLARE
BEGIN

    tn_node  = FIELD($Tree).CurNode;

    FIELD(tbf_subs).CurBias = FB_CHANGEABLE;

    /*--------------------------------------------------------------------------------------------*/
    /* Populate the tablefield.                                                                   */
    /*--------------------------------------------------------------------------------------------*/

    IF tn_node.ClientData IS NULL
    THEN
        tbf_subs                = NULL;
        FIELD(tbf_subs).CurBias = FB_DIMMED;
    ELSE

        UCBatch = uc_batchreplace(tn_node.ClientData);

        tbf_subs = UCBatch.arr_ucreplace;

        IF tbf_subs.LastRow > FIELD(tbf_subs).NumVisibleRows
        THEN
            FIELD(tbf_subs).HasScrollBar = TRUE;
        ELSE
            FIELD(tbf_subs).HasScrollBar = FALSE;
        ENDIF;

    ENDIF;

    /*--------------------------------------------------------------------------------------------*/
    /* Populate the PropertyOptionMenu                                                            */
    /*--------------------------------------------------------------------------------------------*/

    FOR i = FIELD($PropertyOptMenu.btn_new).ChildMenuFields.LastRow DOWNTO 4
    DO
        FIELD($PropertyOptMenu.btn_new).ChildMenuFields[i].ParentMenuGroup = NULL;
        FIELD($PropertyOptMenu.btn_new).ChildMenuFields.RemoveRow( RowNumber = i);
    ENDFOR;

    CASE tn_node.SelBmpLblIndx OF
    $TVF_ATTR:
    BEGIN
        FIELD($Tree).AllowLabelEdit = TRUE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_ENABLED;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_INVISIBLE;
    END
    $TVF_PARAM:
    BEGIN
        FIELD($Tree).AllowLabelEdit = TRUE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_ENABLED;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_INVISIBLE;
    END
    $TVF_CLASS:
    BEGIN
        l_class = parsercopy.GetClassByName( p_v_classname = tn_node.TextLabel );

        IF l_class IS NOT NULL
        THEN
            IF l_class.arr_ucdatadef.LastRow < $MAX_MENUENTRIES
            THEN
                i_test = FALSE;
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_INVISIBLE;
            ELSE
                i_test = TRUE;
                cl_popup.ChoiceItems.Clear();
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_ENABLED;
            ENDIF;

            FOR i = 1 TO l_class.arr_ucdatadef.LastRow
            DO
                IF i_test = TRUE
                THEN
                    cl_popup.AddItem( EnumValue = i,
                                      TextValue = l_class.arr_ucdatadef[i].v_name,
                                      DisplayValue = l_class.arr_ucdatadef[i].v_name,
                                      BitmapValue = FIELD(imgt_attr).Image );
                ELSE
                    mb = MenuButton.Create();
                    mb.TextLabel = l_class.arr_ucdatadef[i].v_name;
                    mb.ClientText = VARCHAR(i + 3);
                    mb.ParentMenuGroup = FIELD($PropertyOptMenu.btn_new);
                ENDIF;
            ENDFOR;
        ENDIF;

        FIELD($Tree).AllowLabelEdit = TRUE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_ENABLED;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_ENABLED;
    END
    $TVF_SCP:
    BEGIN
        l_scp = parsercopy.GetSCPByName( p_v_name = tn_node.TextLabel );

        IF l_scp IS NOT NULL
        THEN
            IF l_scp.arr_ucdatadef.LastRow < $MAX_MENUENTRIES
            THEN
                i_test = FALSE;
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_INVISIBLE;
            ELSE
                i_test = TRUE;
                cl_popup.ChoiceItems.Clear();
                FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_ENABLED;
            ENDIF;

            FOR i = 1 TO l_scp.arr_ucdatadef.LastRow
            DO
                IF i_test = TRUE
                THEN
                    cl_popup.AddItem( EnumValue = i,
                                      TextValue = l_scp.arr_ucdatadef[i].v_name,
                                      DisplayValue = l_scp.arr_ucdatadef[i].v_name,
                                      BitmapValue = FIELD(imgt_param).Image );
                ELSE
                    mb = MenuButton.Create();
                    mb.TextLabel = l_scp.arr_ucdatadef[i].v_name;
                    mb.ClientText = VARCHAR(i + 3);
                    mb.ParentMenuGroup = FIELD($PropertyOptMenu.btn_new);
                ENDIF;
            ENDFOR;
        ENDIF;

        FIELD($Tree).AllowLabelEdit = TRUE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_ENABLED;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_ENABLED;
    END

    $TVF_CLASSES:
    BEGIN
        IF parsercopy.arr_ucclassdef.LastRow < $MAX_MENUENTRIES
        THEN
            i_test = FALSE;
            FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_INVISIBLE;
        ELSE
            i_test = TRUE;
            cl_popup.ChoiceItems.Clear();
            FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_ENABLED;
        ENDIF;

        FOR i = 1 TO parsercopy.arr_ucclassdef.LastRow
        DO
            IF i_test = TRUE
            THEN
                cl_popup.AddItem( EnumValue = i,
                                  TextValue = parsercopy.arr_ucclassdef[i].v_name,
                                  DisplayValue = parsercopy.arr_ucclassdef[i].v_name,
                                  BitmapValue = FIELD(imgt_class).Image );
            ELSE
                mb = MenuButton.Create();
                mb.TextLabel = parsercopy.arr_ucclassdef[i].v_qualified;
                mb.ClientText = VARCHAR(i + 3);
                mb.ParentMenuGroup = FIELD($PropertyOptMenu.btn_new);
            ENDIF;
        ENDFOR;

        FIELD($Tree).AllowLabelEdit = FALSE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_INVISIBLE;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_ENABLED;
    END

    $TVF_SCPS:
    BEGIN
        IF parsercopy.arr_ucscpdef.LastRow < $MAX_MENUENTRIES
        THEN
            i_test = FALSE;
            FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_INVISIBLE;
        ELSE
            i_test = TRUE;
            cl_popup.ChoiceItems.Clear();
            FIELD($PropertyOptMenu.btn_new.btn_list).AllBias = MB_ENABLED;
        ENDIF;

        FOR i = 1 TO parsercopy.arr_ucscpdef.LastRow
        DO
            IF i_test = TRUE
            THEN
                cl_popup.AddItem( EnumValue    = i,
                                  TextValue    = parsercopy.arr_ucscpdef[i].v_name,
                                  DisplayValue = parsercopy.arr_ucscpdef[i].v_name,
                                  BitmapValue  = FIELD(imgt_scp).Image );
            ELSE
                mb = MenuButton.Create();
                mb.TextLabel = parsercopy.arr_ucscpdef[i].v_name;
                mb.ClientText = VARCHAR(i + 3);
                mb.ParentMenuGroup = FIELD($PropertyOptMenu.btn_new);
            ENDIF;
        ENDFOR;

        FIELD($Tree).AllowLabelEdit = FALSE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_INVISIBLE;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_ENABLED;
    END

    DEFAULT:
    BEGIN
        FIELD($Tree).AllowLabelEdit = FALSE;
        FIELD($PropertyOptMenu.btn_delete).AllBias = MB_INVISIBLE;
        FIELD($PropertyOptMenu.btn_new).AllBias    = MB_INVISIBLE;
    END
    ENDCASE;

    FIELD($Tree).UpdField();

END;

/*------------------------------------------------------------------------------------------------*/
/* EVENT(S): EXPANDED $Tree                                                                       */
/*------------------------------------------------------------------------------------------------*/
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
ON EXPANDED $Tree =
DECLARE
    i        = INTEGER NOT NULL;
    tn_node  = TreeNode DEFAULT NULL;
    tn_child = TreeNode DEFAULT NULL;
    UCBatch  = uc_batchreplace DEFAULT NULL;
ENDDECLARE
BEGIN
    tn_node = FIELD($Tree).TriggerNode;

    IF tn_node.Children = 0
    THEN
        tn_node.HasChildren = FALSE;
    ELSE
        tn_node.HasChildren = TRUE;
    ENDIF;

    IF tn_node.ClientData IS NULL
    THEN
        RESUME NEXT;
    ENDIF;

    /*--------------------------------------------------------------------------------------------*/
    /* Clear the subtree.                                                                         */
    /*--------------------------------------------------------------------------------------------*/

    UCBatch = uc_batchreplace(tn_node.ClientData);

    IF tn_node.Children = 0
    THEN

        IF UCBatch.arr_ucbatch IS NOT NULL
        THEN
            FOR i = 1 TO UCBatch.arr_ucbatch.LastRow
            DO
                tn_child = FIELD($Tree).Tree.AddNode(
                                        name = UCBatch.arr_ucbatch[i].v_name,
                                        relative = tn_node );
                tn_child.HasChildren = TRUE;
                tn_child.IsExpanded  = FALSE;
                tn_child.ClientData  = UCBatch.arr_ucbatch[i];

                IF tn_node.SelBmpLblIndx = $TVF_CLASS
                THEN
                    tn_child.BmpLblIndx    = $TVF_ATTR;
                    tn_child.SelBmpLblIndx = $TVF_ATTR;
                    tn_child.HasChildren   = FALSE;
                ELSEIF tn_node.SelBmpLblIndx = $TVF_SCP
                THEN
                    tn_child.BmpLblIndx    = $TVF_PARAM;
                    tn_child.SelBmpLblIndx = $TVF_PARAM;
                    tn_child.HasChildren   = FALSE;
                ENDIF;
            ENDFOR;
        ELSE
            tn_node.HasChildren = FALSE;
        ENDIF;

    ENDIF;

END;

/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    PopulateTree                                                              */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE PopulateTree
(
)=
DECLARE
    i = INTEGER NOT NULL;
    tn_node = TreeNode DEFAULT NULL;
    tn_root = TreeNode DEFAULT NULL;
    tn_tmp  = TreeNode DEFAULT NULL;
ENDDECLARE
BEGIN

    FIELD($Tree).Tree.DeleteNode( node = FIELD($Tree).Tree.RootNode,
                                     allnodes = TRUE );

    tn_root = FIELD($Tree).Tree.AddNode( name = 'Substitutions' );
    tn_root.HasChildren   = TRUE;
    tn_root.IsExpanded    = TRUE;
    tn_root.BmpLblIndx    = $TVF_GLOBAL;
    tn_root.SelBmpLblIndx = $TVF_GLOBAL;

    tn_node = FIELD($Tree).Tree.AddNode( name = 'Names and Values',
                                         relative = tn_root );
    tn_node.HasChildren = FALSE;
    tn_node.IsExpanded  = FALSE;
    tn_node.BmpLblIndx    = $TVF_GLOBAL;
    tn_node.SelBmpLblIndx = $TVF_GLOBAL;

    tn_node.ClientData = srparser.metadatareplace;

    tn_node = FIELD($Tree).Tree.AddNode( name = 'Globals',
                                            relative = tn_root );
    tn_node.HasChildren = FALSE;
    tn_node.IsExpanded  = FALSE;
    tn_node.BmpLblIndx    = $TVF_GLOBAL;
    tn_node.SelBmpLblIndx = $TVF_GLOBAL;

    tn_node.ClientData = srparser.globalreplace;

    tn_node = FIELD($Tree).Tree.AddNode( name = 'Types',
                                         relative = tn_root );
    tn_node.HasChildren = TRUE;
    tn_node.IsExpanded  = FALSE;
    tn_node.BmpLblIndx    = $TVF_TYPES;
    tn_node.SelBmpLblIndx = $TVF_TYPES;

    FOR i = 1 TO srparser.arr_typereplace.LastRow
    DO
        tn_tmp = FIELD($Tree).Tree.AddNode(
                        name     = srparser.arr_typereplace[i].v_name,
                        relative = tn_node );
        tn_tmp.HasChildren = FALSE;
        tn_tmp.IsExpanded  = FALSE;
        tn_tmp.BmpLblIndx    = $TVF_TYPE;
        tn_tmp.SelBmpLblIndx = $TVF_TYPE;
        tn_tmp.ClientData = srparser.arr_typereplace[i];
    ENDFOR;

    tn_node = FIELD($Tree).Tree.AddNode( name = 'Classes',
                                            relative = tn_root );
    tn_node.HasChildren   = TRUE;
    tn_node.IsExpanded    = FALSE;
    tn_node.BmpLblIndx    = $TVF_CLASSES;
    tn_node.SelBmpLblIndx = $TVF_CLASSES;

    FOR i = 1 TO srparser.arr_classreplace.LastRow
    DO
        tn_tmp = FIELD($Tree).Tree.AddNode(
                        name     = srparser.arr_classreplace[i].v_name,
                        relative = tn_node );

        tn_tmp.HasChildren = TRUE;
        tn_tmp.IsExpanded  = FALSE;
        tn_tmp.BmpLblIndx    = $TVF_CLASS;
        tn_tmp.SelBmpLblIndx = $TVF_CLASS;
        tn_tmp.ClientData  = srparser.arr_classreplace[i];
    ENDFOR;

    tn_node = FIELD($Tree).Tree.AddNode( name = 'SCPs',
                                            relative = tn_root );
    tn_node.HasChildren   = TRUE;
    tn_node.IsExpanded    = FALSE;
    tn_node.BmpLblIndx    = $TVF_SCPS;
    tn_node.SelBmpLblIndx = $TVF_SCPS;

    FOR i = 1 TO srparser.arr_scpreplace.LastRow
    DO
        tn_tmp = FIELD($Tree).Tree.AddNode(
                        name     = srparser.arr_scpreplace[i].v_name,
                        relative = tn_node );

        tn_tmp.HasChildren = TRUE;
        tn_tmp.IsExpanded  = FALSE;
        tn_tmp.ClientData  = srparser.arr_scpreplace[i];
        tn_tmp.BmpLblIndx    = $TVF_SCP;
        tn_tmp.SelBmpLblIndx = $TVF_SCP;
    ENDFOR;

END

/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    ColourSource                                                              */
/* Params in       :    p_i_row:                                                                  */
/*                      p_i_start:                                                                */
/*                      p_i_end:                                                                  */
/*                      p_i_bg:                                                                   */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE ColourSource
(
    p_i_row   = INTEGER NOT NULL,
    p_i_start = INTEGER DEFAULT NULL,
    p_i_end   = INTEGER DEFAULT NULL,
    p_i_bg    = INTEGER NOT NULL DEFAULT CC_WHITE
)=
DECLARE
    l_i                = INTEGER NOT NULL;
    l_i_depthflag      = INTEGER NOT NULL;
    l_i_prev_depthflag = INTEGER NOT NULL;
ENDDECLARE
BEGIN
    p_i_start = IFNULL(p_i_start,1);
    p_i_end   = IFNULL(p_i_end,tbf_source.LastRow);

    FOR l_i = 1 TO tbf_source.LastRow
    DO
        IF tbf_source[l_i].bo_margin IS NULL
        THEN
            tbf_source[l_i].bo_margin = FIELD(img_blank).Image;
        ENDIF;

        l_i_depthflag = 0;

        IF tbf_source[l_i].i_foreachapp = TRUE
        THEN
            l_i_depthflag = l_i_depthflag + 1;
        ENDIF;

        IF tbf_source[l_i].i_foreachattr = TRUE
        THEN
            l_i_depthflag = l_i_depthflag + 1;
        ENDIF;

        IF tbf_source[l_i].i_foreachparam = TRUE
        THEN
            l_i_depthflag = l_i_depthflag + 1;
        ENDIF;

        IF tbf_source[l_i].i_foreachscp = TRUE
        THEN
            l_i_depthflag = l_i_depthflag + 1;
        ENDIF;

        IF  (p_i_row = 0 OR p_i_row = l_i)
        AND (p_i_start <= l_i AND l_i <= p_i_end)
        THEN

            IF l_i_depthflag = 0
            THEN
                IF l_i_prev_depthflag > 1
                THEN
                    tbf_source[l_i - 1].bo_margin = FIELD(img_jointbottom).Image;
                ELSEIF l_i_prev_depthflag = 1
                THEN
                    IF CompareBitmaps( bo_1 = tbf_source[l_i - 1].bo_margin,
                                       bo_2 = FIELD(img_top).Image ) = TRUE
                    THEN
                        tbf_source[l_i - 1].bo_margin = FIELD(img_single).Image;
                    ELSE
                        tbf_source[l_i - 1].bo_margin = FIELD(img_bottom).Image;
                    ENDIF;
                ENDIF;

                tbf_source[l_i].bo_margin = FIELD(img_blank).Image;

            ELSEIF l_i_depthflag = l_i_prev_depthflag
            THEN
                IF CompareBitmaps( bo_1 = tbf_source[l_i - 1].bo_margin,
                                   bo_2 = FIELD(img_top).Image ) = TRUE
                THEN
                    tbf_source[l_i].bo_margin = FIELD(img_line).Image;
                ELSEIF CompareBitmaps( bo_1 = tbf_source[l_i - 1].bo_margin,
                                       bo_2 = FIELD(img_innertop).Image ) = TRUE
                THEN
                    tbf_source[l_i].bo_margin = FIELD(img_innerline).Image;
                ELSEIF CompareBitmaps( bo_1 = tbf_source[l_i - 1].bo_margin,
                                       bo_2 = FIELD(img_innerbottom).Image ) = TRUE
                THEN
                    tbf_source[l_i].bo_margin = FIELD(img_line).Image;
                ELSE
                    tbf_source[l_i].bo_margin = tbf_source[l_i - 1].bo_margin;
                ENDIF;
            ELSE
                IF l_i_depthflag < l_i_prev_depthflag
                THEN
                    IF CompareBitmaps( bo_1 = tbf_source[l_i-1].bo_margin,
                                       bo_2 = FIELD(img_innertop).Image) = TRUE
                    THEN
                        tbf_source[l_i - 1].bo_margin = FIELD(img_innersingle).Image;
                    ELSE
                        tbf_source[l_i-1].bo_margin = FIELD(img_innerbottom).Image;
                    ENDIF;

                    tbf_source[l_i].bo_margin = FIELD(img_line).Image;
                ELSE
                    IF l_i_prev_depthflag = 0
                    THEN
                        tbf_source[l_i].bo_margin = FIELD(img_top).Image;
                    ELSE
                        tbf_source[l_i].bo_margin = FIELD(img_innertop).Image;
                    ENDIF;
                ENDIF;
            ENDIF;

            CELLATTRIBUTE(FIELD(tbf_source[l_i].v_line)).BgColor      = p_i_bg;
            CELLATTRIBUTE(FIELD(tbf_source[l_i].v_line)).OutLineColor = p_i_bg;

            /*
            IF tbf_source[l_i].i_dvnull = TRUE
            THEN
                CELLATTRIBUTE(FIELD(tbf_source[l_i].v_line)).BgColor = CC_LIGHT_GRAY;
            ENDIF;
            */

            IF tbf_source[l_i].i_comment = TRUE
            THEN
                tbf_source[l_i].bo_comment = FIELD(img_note).Image.Duplicate();
            ELSE
                tbf_source[l_i].bo_comment = FIELD(img_blank).Image.Duplicate();
            ENDIF;

            tbf_source[l_i].bo_comment.ClientData = tbf_source[l_i];

            IF tbf_source[l_i].i_array = TRUE
            THEN
                CELLATTRIBUTE(FIELD(tbf_source[l_i].v_line)).FgColor =
                    $COLORS.colorstk_array.GetColor();
            ELSEIF tbf_source[l_i].i_class = TRUE
            THEN
                CELLATTRIBUTE(FIELD(tbf_source[l_i].v_line)).FgColor =
                    $COLORS.colorstk_class.GetColor();
            ELSEIF tbf_source[l_i].i_scalar = TRUE
            THEN
                CELLATTRIBUTE(FIELD(tbf_source[l_i].v_line)).FgColor =
                    $COLORS.colorstk_scalar.GetColor();
            ELSEIF tbf_source[l_i].i_comment = TRUE
            THEN
                CELLATTRIBUTE(FIELD(tbf_source[l_i].v_line)).FgColor = CC_LIGHT_GREEN;
            ELSE
                CELLATTRIBUTE(FIELD(tbf_source[l_i].v_line)).FgColor =
                    $COLORS.colorstk_common.GetColor();
            ENDIF;

        ENDIF;

        l_i_prev_depthflag = l_i_depthflag;

    ENDFOR;
END

/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    AddSource                                                                 */
/* Params in       :    p_i_lineno:                                                               */
/*                      p_v_type:                                                                 */
/*                      p_SourceLine:                                                             */
/*                      p_ucblock:                                                                */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE AddSource
(
    p_i_lineno   = INTEGER NOT NULL,
    p_v_type     = VARCHAR(512) NOT NULL;
    p_SourceLine = source_line;
    p_ucblock    = uc_template_block DEFAULT NULL
)=
DECLARE
    i = INTEGER NOT NULL;
    j = INTEGER NOT NULL;
    k = INTEGER NOT NULL;
    SourceLine = source_line DEFAULT NULL;
ENDDECLARE
BEGIN
    k = p_i_lineno;

    FOR i = 1 TO p_ucblock.arr_blocks.LastRow
    DO
        IF p_ucblock.arr_blocks[i].v_type = ''
        THEN
            CALLPROC split( p_c_split = HC_NEWLINE,
                p_so_text = p_ucblock.arr_blocks[i].so_line,
                b_arr_so = arr_so );
            FOR j = 1 TO arr_so.LastRow
            DO
                IF  j = 1
                AND arr_so[j].Value=''
                THEN
                    CONTINUE;
                ENDIF;

                SourceLine = p_SourceLine.Duplicate();

                SourceLine.v_line     = arr_so[j].Value;
                tbf_source.InsertRow( RowNumber = k,
                                      RowObject = SourceLine);
                k = k + 1;
            ENDFOR;
        ELSE
            SourceLine = p_SourceLine.Duplicate();

            IF p_ucblock.arr_blocks[i].v_type = 'COMMENT'
            THEN
                SourceLine.i_comment = TRUE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type = 'FOREACHAPP'
            THEN
                SourceLine.i_foreachapp = TRUE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type = 'FOREACHPARAM'
            THEN
                SourceLine.i_foreachparam = TRUE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type = 'FOREACHATTR'
            THEN
                SourceLine.i_foreachattr = TRUE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type = 'FOREACHSCP'
            THEN
                SourceLine.i_foreachscp = TRUE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type = 'FOREACHCLASS'
            THEN
                SourceLine.i_foreachclass = TRUE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type = 'GENSCP'
            THEN
                CASE SourceLine.i_genscp OF
                0:
                BEGIN
                    SourceLine.i_genscp = 1;

                    IF p_ucblock.arr_blocks[i].v_match LIKE '%(procedure)%'
                    THEN
                        SourceLine.i_genscp = 3;
                    ELSEIF p_ucblock.arr_blocks[i].v_match LIKE '%(method)%'
                    THEN
                        SourceLine.i_genscp = 2;
                    ENDIF;

                    IF p_ucblock.arr_blocks[i].v_match LIKE '%<<!GENSCP>>%'
                    THEN
                        SourceLine.i_genscp = SourceLine.i_genscp + 3;
                    ENDIF;
                END
                1: // GSCPS -> Method or Procedure only
                BEGIN
                    IF p_ucblock.arr_blocks[i].v_match LIKE '%(procedure)%'
                    THEN
                        SourceLine.i_genscp = 3;
                    ELSEIF p_ucblock.arr_blocks[i].v_match LIKE '%(method)%'
                    THEN
                        SourceLine.i_genscp = 2;
                    ENDIF;
                END
                5: // None method-> None GSCPS or Procedure
                BEGIN
                    IF p_ucblock.arr_blocks[i].v_match LIKE '%<<!GENSCP>>%'
                    THEN
                        SourceLine.i_genscp = 4;
                    ELSE
                        SourceLine.i_genscp = 3;
                    ENDIF;
                END
                6: // None Procedure->None GSCPs or method
                BEGIN
                    IF p_ucblock.arr_blocks[i].v_match LIKE '%<<!GENSCP>>%'
                    THEN
                        SourceLine.i_genscp = 4;
                    ELSE
                        SourceLine.i_genscp = 2;
                    ENDIF;
                END
                DEFAULT: SourceLine.i_genscp = 0;
                ENDCASE;

            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type LIKE '%<<ARRAY>>%'
            THEN
                SourceLine.i_array  = TRUE;
                SourceLine.i_class  = FALSE;
                SourceLine.i_scalar = FALSE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type LIKE '%<<CLASS>>%'
            THEN
                SourceLine.i_array  = FALSE;
                SourceLine.i_class  = TRUE;
                SourceLine.i_scalar = FALSE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type LIKE '%<<SCALAR>>%'
            THEN
                SourceLine.i_array  = FALSE;
                SourceLine.i_class  = FALSE;
                SourceLine.i_scalar = TRUE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type LIKE '%<<DV_NULL>>%'
            THEN
                SourceLine.i_dvnull   = TRUE;
                SourceLine.i_dvsystem = FALSE;
                SourceLine.i_dvuser   = FALSE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!DV_NULL>>%'
            THEN
                SourceLine.i_dvnull   = FALSE;
                SourceLine.i_dvsystem = TRUE;
                SourceLine.i_dvuser   = TRUE;
            ENDIF;

            /*
            IF p_ucblock.arr_blocks[i].v_type LIKE '%<<DV_SYSTEM>>%'
            THEN
                SourceLine.i_dvnull   = FALSE;
                SourceLine.i_dvsystem = TRUE;
                SourceLine.i_dvuser   = FALSE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type LIKE '%<<DV_USER>>%'
            THEN
                SourceLine.i_dvnull   = FALSE;
                SourceLine.i_dvsystem = FALSE;
                SourceLine.i_dvuser   = TRUE;
            ENDIF;
            */

            IF p_ucblock.arr_blocks[i].v_type LIKE '%<<NULLABLE>>%'
            THEN
                SourceLine.i_nullable = TRUE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!NULLABLE>>%'
            THEN
                SourceLine.i_nullable = FALSE;
            ENDIF;

            IF p_ucblock.arr_blocks[i].v_type LIKE '%<<ONLYIF>>%'
            THEN

                SourceLine.i_byte      = FALSE;
                SourceLine.i_bytearray = FALSE;
                SourceLine.i_datetime  = FALSE;
                SourceLine.i_decimal   = FALSE;
                SourceLine.i_double    = FALSE;
                SourceLine.i_float     = FALSE;
                SourceLine.i_int       = FALSE;
                SourceLine.i_money     = FALSE;
                SourceLine.i_short     = FALSE;
                SourceLine.i_string    = FALSE;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<BYTE>>%'
                THEN
                    SourceLine.i_byte = TRUE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<BYTEARRAY>>%'
                THEN
                    SourceLine.i_bytearray = TRUE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<DATETIME>>%'
                THEN
                    SourceLine.i_datetime = TRUE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<DECIMAL>>%'
                THEN
                    SourceLine.i_decimal = TRUE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<DOUBLE>>%'
                THEN
                    SourceLine.i_double = TRUE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<FLOAT>>%'
                THEN
                    SourceLine.i_float = TRUE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<INT>>%'
                THEN
                    SourceLine.i_int = TRUE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<MONEY>>%'
                THEN
                    SourceLine.i_money = TRUE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<SHORT>>%'
                THEN
                    SourceLine.i_short = TRUE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<STRING>>%'
                THEN
                    SourceLine.i_string = TRUE;
                ENDIF;

            ELSE

                SourceLine.i_byte      = $MAYBE;
                SourceLine.i_bytearray = $MAYBE;
                SourceLine.i_datetime  = $MAYBE;
                SourceLine.i_decimal   = $MAYBE;
                SourceLine.i_double    = $MAYBE;
                SourceLine.i_float     = $MAYBE;
                SourceLine.i_int       = $MAYBE;
                SourceLine.i_money     = $MAYBE;
                SourceLine.i_short     = $MAYBE;
                SourceLine.i_string    = $MAYBE;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!BYTE>>%'
                THEN
                    SourceLine.i_byte = FALSE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!BYTEARRAY>>%'
                THEN
                    SourceLine.i_bytearray = FALSE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!DATETIME>>%'
                THEN
                    SourceLine.i_datetime = FALSE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!DECIMAL>>%'
                THEN
                    SourceLine.i_decimal = FALSE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!DOUBLE>>%'
                THEN
                    SourceLine.i_double = FALSE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!FLOAT>>%'
                THEN
                    SourceLine.i_float = FALSE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!INT>>%'
                THEN
                    SourceLine.i_int = FALSE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!MONEY>>%'
                THEN
                    SourceLine.i_money = FALSE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!SHORT>>%'
                THEN
                    SourceLine.i_short = FALSE;
                ENDIF;

                IF p_ucblock.arr_blocks[i].v_type LIKE '%<<!STRING>>%'
                THEN
                    SourceLine.i_string = FALSE;
                ENDIF;

            ENDIF;

            IF SourceLine.i_comment = FALSE
            AND p_ucblock.arr_blocks[i].v_type <> 'DOCHISTORY'
            THEN

                k = k + AddSource( p_i_lineno   = k,
                                   p_v_type     = p_ucblock.v_type,
                                   p_SourceLine = SourceLine,
                                   p_ucblock    = p_ucblock.arr_blocks[i] );
            ELSE
                IF p_ucblock.arr_blocks[i].v_type = 'DOCHISTORY'
                THEN
                    so_dochistory = p_ucblock.arr_blocks[i].so_line;

                    mef_note = so_dochistory;
                ELSE
                    SourceLine.v_line = '<- Click on icon to view note. ' +
                                        'Double-Click to add a note. ' +
                                        'Right-Click to delete a note.';

                    tbf_source.InsertRow( RowNumber = k,
                                          RowObject = SourceLine);
                    k = k + 1;

                    SourceLine.so_comment = p_ucblock.arr_blocks[i].so_line;
                ENDIF;
            ENDIF;
        ENDIF;
    ENDFOR;

    RETURN k - p_i_lineno;
END

/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    AddSource                                                                 */
/* Params in       :    p_i_val:                                                                  */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE ToggleSet
(
    p_i_val = INTEGER NOT NULL
)=
BEGIN
    IF p_i_val = FALSE
    THEN
        RETURN FALSE;
    ELSE
        RETURN TRUE;
    ENDIF;
END

/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    UpdateTypes                                                               */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE UpdateTypes
(
)=
BEGIN
    IF ( $TYPES.tgl_float = 0
    OR $TYPES.tgl_byte = 0
    OR $TYPES.tgl_double = 0
    OR $TYPES.tgl_short = 0
    OR $TYPES.tgl_decimal = 0
    OR $TYPES.tgl_int = 0
    OR $TYPES.tgl_money = 0 )
    AND $TYPES.tgl_numbers = 1
    THEN
        $TYPES.tgl_numbers = 0;
    ENDIF;

    IF  $TYPES.tgl_float   = 1
    AND $TYPES.tgl_byte    = 1
    AND $TYPES.tgl_double  = 1
    AND $TYPES.tgl_short   = 1
    AND $TYPES.tgl_decimal = 1
    AND $TYPES.tgl_int     = 1
    AND $TYPES.tgl_money   = 1
    AND $TYPES.tgl_numbers = 0
    THEN
        $TYPES.tgl_numbers = 1;
    ENDIF;

    IF  $TYPES.tgl_numbers    = 1
    AND $TYPES.tgl_dates      = 1
    AND $TYPES.tgl_strings    = 1
    AND $TYPES.tgl_bytearrays = 1
    THEN
        $TYPES.tgl_applies = 0;
    ENDIF;

    IF $TYPES.tgl_applies = 0
    THEN
        $TYPES.tgl_dates      = 0;
        $TYPES.tgl_numbers    = 0;
        $TYPES.tgl_bytearrays = FALSE;
        $TYPES.tgl_strings    = FALSE;
        $TYPES.tgl_dates      = FALSE;
        $TYPES.tgl_float      = FALSE;
        $TYPES.tgl_byte       = FALSE;
        $TYPES.tgl_double     = FALSE;
        $TYPES.tgl_short      = FALSE;
        $TYPES.tgl_decimal    = FALSE;
        $TYPES.tgl_int        = FALSE;
        $TYPES.tgl_money      = FALSE;

        FIELD($TYPES.tgl_bytearrays).CurBias = FB_DIMMED;
        FIELD($TYPES.tgl_strings).CurBias    = FB_DIMMED;
        FIELD($TYPES.tgl_dates).CurBias      = FB_DIMMED;
        FIELD($TYPES.tgl_numbers).CurBias    = FB_DIMMED;
        FIELD($TYPES.tgl_bytearrays).CurBias = FB_DIMMED;
        FIELD($TYPES.tgl_bytearrays).CurBias = FB_DIMMED;
        FIELD($TYPES.tgl_float).CurBias      = FB_DIMMED;
        FIELD($TYPES.tgl_byte).CurBias       = FB_DIMMED;
        FIELD($TYPES.tgl_double).CurBias     = FB_DIMMED;
        FIELD($TYPES.tgl_short).CurBias      = FB_DIMMED;
        FIELD($TYPES.tgl_decimal).CurBias    = FB_DIMMED;
        FIELD($TYPES.tgl_int).CurBias        = FB_DIMMED;
        FIELD($TYPES.tgl_money).CurBias      = FB_DIMMED;
    ELSE
        FIELD($TYPES.tgl_bytearrays).CurBias = FB_CHANGEABLE;
        FIELD($TYPES.tgl_strings).CurBias    = FB_CHANGEABLE;
        FIELD($TYPES.tgl_dates).CurBias      = FB_CHANGEABLE;
        FIELD($TYPES.tgl_numbers).CurBias    = FB_CHANGEABLE;
        FIELD($TYPES.tgl_bytearrays).CurBias = FB_CHANGEABLE;
        FIELD($TYPES.tgl_bytearrays).CurBias = FB_CHANGEABLE;
        FIELD($TYPES.tgl_float).CurBias      = FB_CHANGEABLE;
        FIELD($TYPES.tgl_byte).CurBias       = FB_CHANGEABLE;
        FIELD($TYPES.tgl_double).CurBias     = FB_CHANGEABLE;
        FIELD($TYPES.tgl_short).CurBias      = FB_CHANGEABLE;
        FIELD($TYPES.tgl_decimal).CurBias    = FB_CHANGEABLE;
        FIELD($TYPES.tgl_int).CurBias        = FB_CHANGEABLE;
        FIELD($TYPES.tgl_money).CurBias      = FB_CHANGEABLE;
    ENDIF;

END

/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    EncodeSource                                                              */
/* Params in       :    p_so:                                                                     */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE EncodeSource
(
    p_so = StringObject DEFAULT NULL
)=
DECLARE
    l_i = INTEGER NOT NULL;
    l_sourceline     = source_line DEFAULT NULL;
    l_lastsourceline = source_line DEFAULT NULL;
    l_v_tmp          = VARCHAR(2000) NOT NULL;
    l_i_tag          = INTEGER NOT NULL;
    l_i_explicit     = INTEGER NOT NULL; // Subset of datatypes?
ENDDECLARE
BEGIN
    p_so.ConcatVarchar( Text = HC_NEWLINE + '<<DOCHISTORY>>' + HC_NEWLINE );
    p_so.ConcatString( String = so_dochistory );
    p_so.ConcatVarchar( Text = HC_NEWLINE + '<<DOCHISTORY>>' + HC_NEWLINE );

    FOR l_i = 1 TO tbf_source.LastRow
    DO
        l_sourceline = tbf_source[l_i];

        /*----------------------------------------------------------------------------------------*/
        /* Close any old tags.                                                                    */
        /*----------------------------------------------------------------------------------------*/

        IF l_lastsourceline IS NOT NULL
        THEN

            IF ((l_sourceline.i_bytearray <> l_lastsourceline.i_bytearray
            OR l_sourceline.i_string    <> l_lastsourceline.i_string
            OR l_sourceline.i_datetime  <> l_lastsourceline.i_datetime
            OR l_sourceline.i_float     <> l_lastsourceline.i_float
            OR l_sourceline.i_byte      <> l_lastsourceline.i_byte
            OR l_sourceline.i_double    <> l_lastsourceline.i_double
            OR l_sourceline.i_short     <> l_lastsourceline.i_short
            OR l_sourceline.i_decimal   <> l_lastsourceline.i_decimal
            OR l_sourceline.i_int       <> l_lastsourceline.i_int
            OR l_sourceline.i_money     <> l_lastsourceline.i_money)
            AND l_lastsourceline.i_scalar = TRUE)
            THEN
                l_v_tmp = '';

                IF l_lastsourceline.i_bytearray <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<BYTEARRAY>>';
                ENDIF;

                IF l_lastsourceline.i_string <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<STRING>>';
                ENDIF;

                IF l_lastsourceline.i_datetime <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<DATETIME>>';
                ENDIF;

                IF l_lastsourceline.i_float <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<FLOAT>>';
                ENDIF;

                IF l_lastsourceline.i_byte <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<BYTE>>';
                ENDIF;

                IF l_lastsourceline.i_double <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<DOUBLE>>';
                ENDIF;

                IF l_lastsourceline.i_short <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<SHORT>>';
                ENDIF;

                IF l_lastsourceline.i_decimal <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<DECIMAL>>';
                ENDIF;

                IF l_lastsourceline.i_int <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<INT>>';
                ENDIF;

                IF l_lastsourceline.i_int <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<MONEY>>';
                ENDIF;

                IF l_v_tmp <> ''
                AND (l_lastsourceline.i_byte      <> $MAYBE
                  OR l_lastsourceline.i_bytearray <> $MAYBE
                  OR l_lastsourceline.i_datetime  <> $MAYBE
                  OR l_lastsourceline.i_decimal   <> $MAYBE
                  OR l_lastsourceline.i_double    <> $MAYBE
                  OR l_lastsourceline.i_float     <> $MAYBE
                  OR l_lastsourceline.i_int       <> $MAYBE
                  OR l_lastsourceline.i_money     <> $MAYBE
                  OR l_lastsourceline.i_short     <> $MAYBE
                  OR l_lastsourceline.i_string    <> $MAYBE)
                THEN
                    l_v_tmp = '<<ONLYIF>>' + l_v_tmp;
                    p_so.ConcatVarchar(Text = l_v_tmp + HC_NEWLINE );
                ENDIF;
            ENDIF;

            l_i_tag = FALSE;

            IF  l_sourceline.i_nullable <> l_lastsourceline.i_nullable
            THEN
                IF l_lastsourceline.i_nullable = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<NULLABLE>>' );

                    l_i_tag = TRUE;
                ELSEIF l_lastsourceline.i_nullable = FALSE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<!NULLABLE>>' );

                    l_i_tag = TRUE;
                ENDIF;
            ENDIF;

            IF l_sourceline.i_dvnull <> l_lastsourceline.i_dvnull
            THEN
                IF l_lastsourceline.i_dvnull = TRUE
                THEN
                    p_so.ConcatVarchar( Text = '<<DV_NULL>>' );
                    l_i_tag = TRUE;
                ELSEIF l_lastsourceline.i_dvnull = FALSE
                THEN
                    p_so.ConcatVarchar( Text = '<<!DV_NULL>>' );
                    l_i_tag = TRUE;
                ENDIF;

            ENDIF;

            IF l_lastsourceline.i_comment = TRUE
            THEN
                p_so.ConcatVarchar( Text = '<<COMMENT>>' );
                l_i_tag = TRUE;
            ENDIF;

            IF l_i_tag = TRUE
            THEN
                p_so.ConcatVarchar( Text = HC_NEWLINE );
            ENDIF;

            IF l_sourceline.i_array <> l_lastsourceline.i_array
            THEN
                IF l_lastsourceline.i_array = TRUE
                THEN
                    p_so.ConcatVarchar( Text = '<<ARRAY>>' + HC_NEWLINE );
                    l_i_tag = TRUE;
                ENDIF;
            ENDIF;

            IF l_sourceline.i_class <> l_lastsourceline.i_class
            THEN
                IF l_lastsourceline.i_class = TRUE
                THEN
                    p_so.ConcatVarchar( Text = '<<CLASS>>' + HC_NEWLINE );
                    l_i_tag = TRUE;
                ENDIF;
            ENDIF;

            IF l_sourceline.i_scalar <> l_lastsourceline.i_scalar
            THEN
                IF l_lastsourceline.i_scalar = TRUE
                THEN
                    p_so.ConcatVarchar( Text = '<<SCALAR>>' + HC_NEWLINE );
                    l_i_tag = TRUE;
                ENDIF;
            ENDIF;

            IF  l_sourceline.i_genscp <> l_lastsourceline.i_genscp
            THEN
                CASE l_lastsourceline.i_genscp OF
                1: l_v_tmp = '<<GENSCP>>' + HC_NEWLINE;
                2: l_v_tmp = '<<GENSCP>>(method)' + HC_NEWLINE;
                3: l_v_tmp = '<<GENSCP>>(procedure)' + HC_NEWLINE;
                4: l_v_tmp = '<<!GENSCP>>' + HC_NEWLINE;
                5: l_v_tmp = '<<!GENSCP>>(method)' + HC_NEWLINE;
                6: l_v_tmp = '<<!GENSCP>>(procedure)' + HC_NEWLINE;
                DEFAULT: l_v_tmp = '';
                ENDCASE;

                p_so.ConcatVarchar( Text = l_v_tmp );
            ENDIF;

            IF  l_sourceline.i_foreachattr <> l_lastsourceline.i_foreachattr
            THEN
                IF l_lastsourceline.i_foreachattr = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<FOREACHATTR>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF  l_sourceline.i_foreachparam <> l_lastsourceline.i_foreachparam
            THEN
                IF l_lastsourceline.i_foreachparam = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<FOREACHPARAM>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF  l_sourceline.i_foreachscp <> l_lastsourceline.i_foreachscp
            THEN
                IF l_lastsourceline.i_foreachscp = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<FOREACHSCP>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF  l_sourceline.i_foreachclass <> l_lastsourceline.i_foreachclass
            THEN
                IF l_lastsourceline.i_foreachclass = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<FOREACHCLASS>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF  l_sourceline.i_foreachapp <> l_lastsourceline.i_foreachapp
            THEN
                IF l_lastsourceline.i_foreachapp = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<FOREACHAPP>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;
        ENDIF;

        /*----------------------------------------------------------------------------------------*/
        /* Attach any new tags.                                                                   */
        /*----------------------------------------------------------------------------------------*/

        IF l_lastsourceline IS NOT NULL
        THEN
            IF  l_sourceline.i_foreachapp <> l_lastsourceline.i_foreachapp
            THEN
                IF l_sourceline.i_foreachapp = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<FOREACHAPP>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF  l_sourceline.i_foreachclass <> l_lastsourceline.i_foreachclass
            THEN
                IF l_sourceline.i_foreachclass = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<FOREACHCLASS>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF  l_sourceline.i_foreachscp <> l_lastsourceline.i_foreachscp
            THEN
                IF l_sourceline.i_foreachscp = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<FOREACHSCP>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF  l_sourceline.i_foreachparam <> l_lastsourceline.i_foreachparam
            THEN
                IF l_sourceline.i_foreachparam = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<FOREACHPARAM>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF  l_sourceline.i_foreachattr <> l_lastsourceline.i_foreachattr
            THEN
                IF l_sourceline.i_foreachattr = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<FOREACHATTR>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF  l_sourceline.i_genscp <> l_lastsourceline.i_genscp
            THEN
                CASE l_sourceline.i_genscp OF
                1: l_v_tmp = '<<GENSCP>>' + HC_NEWLINE;
                2: l_v_tmp = '<<GENSCP>>(method)' + HC_NEWLINE;
                3: l_v_tmp = '<<GENSCP>>(procedure)' + HC_NEWLINE;
                4: l_v_tmp = '<<!GENSCP>>' + HC_NEWLINE;
                5: l_v_tmp = '<<!GENSCP>>(method)' + HC_NEWLINE;
                6: l_v_tmp = '<<!GENSCP>>(procedure)' + HC_NEWLINE;
                DEFAULT: l_v_tmp = '';
                ENDCASE;

                p_so.ConcatVarchar( Text = l_v_tmp );
            ENDIF;

            IF l_sourceline.i_array <> l_lastsourceline.i_array
            THEN
                IF l_sourceline.i_array = TRUE
                THEN
                    p_so.ConcatVarchar( Text = '<<ARRAY>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF l_sourceline.i_class <> l_lastsourceline.i_class
            THEN
                IF l_sourceline.i_class = TRUE
                THEN
                    p_so.ConcatVarchar( Text = '<<CLASS>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            IF l_sourceline.i_scalar <> l_lastsourceline.i_scalar
            THEN
                IF l_sourceline.i_scalar = TRUE
                THEN
                    p_so.ConcatVarchar( Text = '<<SCALAR>>' + HC_NEWLINE );
                ENDIF;
            ENDIF;

            l_i_tag = FALSE;

            IF  l_sourceline.i_nullable <> l_lastsourceline.i_nullable
            THEN
                IF l_sourceline.i_nullable = TRUE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<NULLABLE>>' );

                    l_i_tag = TRUE;
                ELSEIF l_sourceline.i_nullable = FALSE
                THEN
                    p_so.ConcatVarchar(
                        Text = '<<!NULLABLE>>' );

                    l_i_tag = TRUE;
                ENDIF;
            ENDIF;

            IF l_sourceline.i_dvnull <> l_lastsourceline.i_dvnull
            THEN
                IF l_sourceline.i_dvnull = TRUE
                THEN
                    p_so.ConcatVarchar( Text = '<<DV_NULL>>' );

                    l_i_tag = TRUE;
                ELSEIF l_sourceline.i_dvnull = FALSE
                THEN
                    p_so.ConcatVarchar( Text = '<<!DV_NULL>>' );

                    l_i_tag = TRUE;
                ENDIF;
            ENDIF;

            IF l_sourceline.i_comment = TRUE
            THEN
                p_so.ConcatVarchar( Text = '<<COMMENT>>' );
                l_i_tag = TRUE;
            ENDIF;

            IF l_i_tag = TRUE
            THEN
                p_so.ConcatVarchar( Text = HC_NEWLINE );
            ENDIF;

            IF ((l_sourceline.i_bytearray <> l_lastsourceline.i_bytearray
            OR l_sourceline.i_string    <> l_lastsourceline.i_string
            OR l_sourceline.i_datetime  <> l_lastsourceline.i_datetime
            OR l_sourceline.i_float     <> l_lastsourceline.i_float
            OR l_sourceline.i_byte      <> l_lastsourceline.i_byte
            OR l_sourceline.i_double    <> l_lastsourceline.i_double
            OR l_sourceline.i_short     <> l_lastsourceline.i_short
            OR l_sourceline.i_decimal   <> l_lastsourceline.i_decimal
            OR l_sourceline.i_int       <> l_lastsourceline.i_int
            OR l_sourceline.i_money     <> l_lastsourceline.i_money)
            AND l_sourceline.i_scalar = TRUE)
            THEN
                l_v_tmp = '';

                IF l_sourceline.i_bytearray <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<BYTEARRAY>>';
                ENDIF;

                IF l_sourceline.i_string <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<STRING>>';
                ENDIF;

                IF l_sourceline.i_datetime <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<DATETIME>>';
                ENDIF;

                IF l_sourceline.i_float <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<FLOAT>>';
                ENDIF;

                IF l_sourceline.i_byte <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<BYTE>>';
                ENDIF;

                IF l_sourceline.i_double <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<DOUBLE>>';
                ENDIF;

                IF l_sourceline.i_short <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<SHORT>>';
                ENDIF;

                IF l_sourceline.i_decimal <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<DECIMAL>>';
                ENDIF;

                IF l_sourceline.i_int <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<INT>>';
                ENDIF;

                IF l_sourceline.i_money <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<MONEY>>';
                ENDIF;

                IF l_v_tmp <> ''
                AND (l_sourceline.i_byte      <> $MAYBE
                  OR l_sourceline.i_bytearray <> $MAYBE
                  OR l_sourceline.i_datetime  <> $MAYBE
                  OR l_sourceline.i_decimal   <> $MAYBE
                  OR l_sourceline.i_double    <> $MAYBE
                  OR l_sourceline.i_float     <> $MAYBE
                  OR l_sourceline.i_int       <> $MAYBE
                  OR l_sourceline.i_money     <> $MAYBE
                  OR l_sourceline.i_short     <> $MAYBE
                  OR l_sourceline.i_string    <> $MAYBE)
                THEN
                    l_v_tmp = '<<ONLYIF>>' + l_v_tmp;
                    p_so.ConcatVarchar( Text = l_v_tmp + HC_NEWLINE );
                ENDIF;

            ENDIF;
        ELSE
            // No lastline
            IF l_sourceline.i_foreachapp = TRUE
            THEN
                p_so.ConcatVarchar(
                    Text = '<<FOREACHAPP>>' + HC_NEWLINE );
            ENDIF;

            IF l_sourceline.i_foreachclass = TRUE
            THEN
                p_so.ConcatVarchar(
                    Text = '<<FOREACHCLASS>>' + HC_NEWLINE );
            ENDIF;

            IF l_sourceline.i_foreachscp = TRUE
            THEN
                p_so.ConcatVarchar(
                    Text = '<<FOREACHSCP>>' + HC_NEWLINE );
            ENDIF;

            IF l_sourceline.i_foreachparam = TRUE
            THEN
                p_so.ConcatVarchar(
                    Text = '<<FOREACHPARAM>>' + HC_NEWLINE );
            ENDIF;

            IF l_sourceline.i_foreachattr = TRUE
            THEN
                p_so.ConcatVarchar(
                    Text = '<<FOREACHATTR>>' + HC_NEWLINE );
            ENDIF;

            CASE l_sourceline.i_genscp OF
            1: l_v_tmp = '<<GENSCP>>' + HC_NEWLINE;
            2: l_v_tmp = '<<GENSCP>>(method)' + HC_NEWLINE;
            3: l_v_tmp = '<<GENSCP>>(procedure)' + HC_NEWLINE;
            4: l_v_tmp = '<<!GENSCP>>' + HC_NEWLINE;
            5: l_v_tmp = '<<!GENSCP>>(method)' + HC_NEWLINE;
            6: l_v_tmp = '<<!GENSCP>>(procedure)' + HC_NEWLINE;
            DEFAULT: l_v_tmp = '';
            ENDCASE;

            p_so.ConcatVarchar( Text = l_v_tmp );

            IF l_sourceline.i_array = TRUE
            THEN
                p_so.ConcatVarchar( Text = '<<ARRAY>>' + HC_NEWLINE );
            ENDIF;

            IF l_sourceline.i_class = TRUE
            THEN
                p_so.ConcatVarchar( Text = '<<CLASS>>' + HC_NEWLINE );
            ENDIF;

            IF l_sourceline.i_scalar = TRUE
            THEN
                p_so.ConcatVarchar( Text = '<<SCALAR>>' + HC_NEWLINE );
            ENDIF;

            l_i_tag = FALSE;

            IF l_sourceline.i_nullable = TRUE
            THEN
                p_so.ConcatVarchar(
                    Text = '<<NULLABLE>>' );

                l_i_tag = TRUE;
            ELSEIF l_sourceline.i_nullable = FALSE
            THEN
                p_so.ConcatVarchar(
                    Text = '<<!NULLABLE>>' );

                l_i_tag = TRUE;
            ENDIF;

            IF l_sourceline.i_dvnull = TRUE
            THEN
                p_so.ConcatVarchar( Text = '<<DV_NULL>>' );

                l_i_tag = TRUE;
            ELSEIF l_sourceline.i_dvnull = FALSE
            THEN
                p_so.ConcatVarchar( Text = '<<!DV_NULL>>' );

                l_i_tag = TRUE;
            ENDIF;

            IF l_sourceline.i_comment = TRUE
            THEN
                p_so.ConcatVarchar( Text = '<<COMMENT>>' );
                l_i_tag = TRUE;
            ENDIF;

            IF l_i_tag = TRUE
            THEN
                p_so.ConcatVarchar( Text = HC_NEWLINE );
            ENDIF;

            IF (l_sourceline.i_bytearray <> $MAYBE
            OR l_sourceline.i_string    <> $MAYBE
            OR l_sourceline.i_datetime  <> $MAYBE
            OR l_sourceline.i_float     <> $MAYBE
            OR l_sourceline.i_byte      <> $MAYBE
            OR l_sourceline.i_double    <> $MAYBE
            OR l_sourceline.i_short     <> $MAYBE
            OR l_sourceline.i_decimal   <> $MAYBE
            OR l_sourceline.i_int       <> $MAYBE
            OR l_sourceline.i_money     <> $MAYBE )
            AND l_sourceline.i_scalar = TRUE
            THEN
                l_v_tmp = '';

                IF l_sourceline.i_bytearray <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<BYTEARRAY>>';
                ENDIF;

                IF l_sourceline.i_string <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<STRING>>';
                ENDIF;

                IF l_sourceline.i_datetime <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<DATETIME>>';
                ENDIF;

                IF l_sourceline.i_float  <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<FLOAT>>';
                ENDIF;

                IF l_sourceline.i_byte <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<BYTE>>';
                ENDIF;

                IF l_sourceline.i_double <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<DOUBLE>>';
                ENDIF;

                IF l_sourceline.i_short <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<SHORT>>';
                ENDIF;

                IF l_sourceline.i_decimal <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<DECIMAL>>';
                ENDIF;

                IF l_sourceline.i_int <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<INT>>';
                ENDIF;

                IF l_sourceline.i_int <> FALSE
                THEN
                    l_v_tmp = l_v_tmp + '<<MONEY>>';
                ENDIF;

                IF l_v_tmp <> ''
                THEN
                    l_v_tmp = '<<ONLYIF>>' + l_v_tmp;
                    p_so.ConcatVarchar( Text = l_v_tmp + HC_NEWLINE );
                ENDIF;
            ENDIF;
        ENDIF;

        /*----------------------------------------------------------------------------------------*/
        /* Add source text.                                                                       */
        /*----------------------------------------------------------------------------------------*/

        IF l_sourceline.i_comment = FALSE
        THEN
            p_so.ConcatVarchar( Text = l_sourceline.v_line + HC_NEWLINE );
        ELSE
            p_so.ConcatString( String = l_sourceline.so_comment );
            p_so.ConcatVarchar( Text = HC_NEWLINE );
        ENDIF;

        l_lastsourceline = l_sourceline;
    ENDFOR;

    //Close any remaining tags.Tags have to be done in reverse order to
    //first line tags.

    IF (l_sourceline.i_bytearray <> $MAYBE
    OR l_sourceline.i_string    <> $MAYBE
    OR l_sourceline.i_datetime  <> $MAYBE
    OR l_sourceline.i_float     <> $MAYBE
    OR l_sourceline.i_byte      <> $MAYBE
    OR l_sourceline.i_double    <> $MAYBE
    OR l_sourceline.i_short     <> $MAYBE
    OR l_sourceline.i_decimal   <> $MAYBE
    OR l_sourceline.i_int       <> $MAYBE
    OR l_sourceline.i_money     <> $MAYBE )
    AND l_sourceline.i_scalar = TRUE
    THEN
        l_v_tmp = '';

        IF l_sourceline.i_bytearray <> FALSE
        THEN
            l_v_tmp = l_v_tmp + '<<BYTEARRAY>>';
        ENDIF;

        IF l_sourceline.i_string <> FALSE
        THEN
            l_v_tmp = l_v_tmp + '<<STRING>>';
        ENDIF;

        IF l_sourceline.i_datetime <> FALSE
        THEN
            l_v_tmp = l_v_tmp + '<<DATETIME>>';
        ENDIF;

        IF l_sourceline.i_float  <> FALSE
        THEN
            l_v_tmp = l_v_tmp + '<<FLOAT>>';
        ENDIF;

        IF l_sourceline.i_byte <> FALSE
        THEN
            l_v_tmp = l_v_tmp + '<<BYTE>>';
        ENDIF;

        IF l_sourceline.i_double <> FALSE
        THEN
            l_v_tmp = l_v_tmp + '<<DOUBLE>>';
        ENDIF;

        IF l_sourceline.i_short <> FALSE
        THEN
            l_v_tmp = l_v_tmp + '<<SHORT>>';
        ENDIF;

        IF l_sourceline.i_decimal <> FALSE
        THEN
            l_v_tmp = l_v_tmp + '<<DECIMAL>>';
        ENDIF;

        IF l_sourceline.i_int <> FALSE
        THEN
            l_v_tmp = l_v_tmp + '<<INT>>';
        ENDIF;

        IF l_sourceline.i_int <> FALSE
        THEN
            l_v_tmp = l_v_tmp + '<<MONEY>>';
        ENDIF;

        IF l_v_tmp <> ''
        THEN
            l_v_tmp = '<<ONLYIF>>' + l_v_tmp;
            p_so.ConcatVarchar( Text = l_v_tmp + HC_NEWLINE );
        ENDIF;
    ENDIF;

    IF l_sourceline.i_comment = TRUE
    THEN
        p_so.ConcatVarchar( Text = '<<COMMENT>>' + HC_NEWLINE );
    ENDIF;

    IF l_sourceline.i_dvnull = TRUE
    THEN
        p_so.ConcatVarchar( Text = '<<DV_NULL>>' + HC_NEWLINE );

    ELSEIF l_sourceline.i_dvnull = FALSE
    THEN
        p_so.ConcatVarchar( Text = '<<!DV_NULL>>' + HC_NEWLINE);

    ENDIF;

    IF l_sourceline.i_nullable = TRUE
    THEN
        p_so.ConcatVarchar(
            Text = '<<NULLABLE>>' + HC_NEWLINE );

    ELSEIF l_sourceline.i_nullable = FALSE
    THEN
        p_so.ConcatVarchar(
            Text = '<<!NULLABLE>>' + HC_NEWLINE );

    ENDIF;

    IF l_sourceline.i_scalar = TRUE
    THEN
        p_so.ConcatVarchar( Text = '<<SCALAR>>' + HC_NEWLINE );
    ENDIF;

    IF l_sourceline.i_class = TRUE
    THEN
        p_so.ConcatVarchar( Text = '<<CLASS>>' + HC_NEWLINE );
    ENDIF;

    IF l_sourceline.i_array = TRUE
    THEN
        p_so.ConcatVarchar( Text = '<<ARRAY>>' + HC_NEWLINE );
    ENDIF;

    CASE l_sourceline.i_genscp OF
    1: l_v_tmp = '<<GENSCP>>' + HC_NEWLINE;
    2: l_v_tmp = '<<GENSCP>>(method)' + HC_NEWLINE;
    3: l_v_tmp = '<<GENSCP>>(procedure)' + HC_NEWLINE;
    4: l_v_tmp = '<<!GENSCP>>' + HC_NEWLINE;
    5: l_v_tmp = '<<!GENSCP>>(method)' + HC_NEWLINE;
    6: l_v_tmp = '<<!GENSCP>>(procedure)' + HC_NEWLINE;
    DEFAULT: l_v_tmp = '';
    ENDCASE;

    p_so.ConcatVarchar( Text = l_v_tmp );

    IF l_sourceline.i_foreachattr = TRUE
    THEN
        p_so.ConcatVarchar(
            Text = '<<FOREACHATTR>>' + HC_NEWLINE );
    ENDIF;

    IF l_sourceline.i_foreachparam = TRUE
    THEN
        p_so.ConcatVarchar(
            Text = '<<FOREACHPARAM>>' + HC_NEWLINE );
    ENDIF;

    IF l_sourceline.i_foreachscp = TRUE
    THEN
        p_so.ConcatVarchar(
            Text = '<<FOREACHSCP>>' + HC_NEWLINE );
    ENDIF;

    IF l_sourceline.i_foreachclass = TRUE
    THEN
        p_so.ConcatVarchar(
            Text = '<<FOREACHCLASS>>' + HC_NEWLINE );
    ENDIF;

    IF l_sourceline.i_foreachapp = TRUE
    THEN
        p_so.ConcatVarchar(
            Text = '<<FOREACHAPP>>' + HC_NEWLINE );
    ENDIF;

END

/*------------------------------------------------------------------------------------------------*/
/* Local Procedure :    CompareBitmaps                                                            */
/* Params in       :    bo_1:                                                                     */
/*                      bo_2:                                                                     */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
PROCEDURE CompareBitmaps
(
    bo_1 = bitmapobject,
    bo_2 = bitmapobject
)=
BEGIN
    IF bo_1.FileHandle = bo_2.FileHandle
    THEN
        RETURN TRUE;
    ELSE
        RETURN FALSE;
    ENDIF;
END

