BEGIN
    $_CurFld.cf_panel    = COMPOSITEFIELD(
                    FIELD($_CurFld).FieldByName( name = 'colormtx' ));
    $_CurFld.ff_selected = FIELD($_CurFld).FieldByName( name = 'selected' );

