/*------------------------------------------------------------------------------------------------*/
/* Method          :    ProcessStartTag                                                           */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     : Process the XML start tags prepopulated on this object.                      */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD ProcessStartTag
(
)=
DECLARE
    UCReplace     = uc_replace DEFAULT NULL;
    UCBatch       = uc_batchreplace DEFAULT NULL;
    UCTag_Current = _uc_tag DEFAULT NULL;
    i             = INTEGER NOT NULL;
    so_tmp        = StringObject DEFAULT NULL;
ENDDECLARE
BEGIN
    UCTag_Current = CurObject.arr_tags[ CurObject.i_depth ];

    CASE CurObject.v_current_tag OF

    'job':
    BEGIN
        i = CurObject.arr_uctemplatejob.LastRow + 1;

        so_tmp = UCTag_current.GetValue( p_v_name = 'set' );

        IF so_tmp IS NOT NULL
        THEN
            CurObject.arr_uctemplatejob[i].i_job_set = INT4(so_tmp.Value);
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'inputfile' );

        IF so_tmp IS NOT NULL
        THEN
            CurObject.arr_uctemplatejob[i].v_inputfile = so_tmp.Value;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'outputfile' );

        IF so_tmp IS NOT NULL
        THEN
            CurObject.arr_uctemplatejob[i].v_outputfile = so_tmp.Value;
        ENDIF;
    END

    'type':
    BEGIN
        UCBatch = uc_batchreplace.Create();

        so_tmp = UCTag_current.GetValue( p_v_name = 'name' );

        IF so_tmp IS NULL
        THEN
            CurObject.v_errortext = 'Missing ' + HC_QUOTE + 'name' + HC_QUOTE +
                                    'attribute from <type> tag.';
            RETURN;
        ENDIF;

        UCBatch.v_name    = so_tmp.Value;

        CurObject.UCBatch = UCBatch;
    END

    'scp':
    BEGIN
        UCBatch = uc_batchreplace.Create();

        so_tmp = UCTag_current.GetValue( p_v_name = 'name' );

        IF so_tmp IS NULL
        THEN
            CurObject.v_errortext = 'Missing ' + HC_QUOTE + 'name' + HC_QUOTE +
                                    'attribute from <scp> tag.';
            RETURN;
        ENDIF;

        UCBatch.v_name    = so_tmp.Value;

        CurObject.UCBatch = UCBatch;
    END

    'class':
    BEGIN
        UCBatch = uc_batchreplace.Create();

        so_tmp = UCTag_current.GetValue( p_v_name = 'name' );

        IF so_tmp IS NULL
        THEN
            CurObject.v_errortext = 'Missing ' + HC_QUOTE + 'name' + HC_QUOTE +
                                    'attribute from <class> tag.';
            RETURN;
        ENDIF;

        UCBatch.v_name    = so_tmp.Value;

        CurObject.UCBatch = UCBatch;
    END

    'metadata':
    BEGIN
        UCBatch = uc_batchreplace.Create();
        CurObject.UCBatch = UCBatch;
    END

    'global':
    BEGIN
        UCBatch = uc_batchreplace.Create();
        CurObject.UCBatch = UCBatch;
    END

    'sub':
    BEGIN
        UCReplace = uc_replace.Create();

        so_tmp = UCTag_current.GetValue( p_v_name = 'desc' );

        IF so_tmp IS NOT NULL
        THEN
            UCReplace.v_description = so_tmp.Value;
        ENDIF;

        so_tmp = UCTag_current.GetValue( p_v_name = 'find' );

        IF so_tmp IS NULL
        THEN
            CurObject.v_errortext = 'Missing ' + HC_QUOTE + 'find' + HC_QUOTE +
                                    'attribute from <sub> tag.';
            RETURN;
        ENDIF;

        UCReplace.v_find = so_tmp.Value;

        so_tmp = UCTag_current.GetValue( p_v_name = 'replace' );

        IF so_tmp IS NULL
        THEN
            CurObject.v_errortext = 'Missing ' + HC_QUOTE + 'replace' + HC_QUOTE +
                                    'attribute from <sub> tag.';
            RETURN;
        ENDIF;

        UCReplace.v_replace = so_tmp.Value;

        CurObject.UCBatch.AddReplace( p_ucreplace = UCReplace );
    END

    'attr':
    BEGIN
        so_tmp = UCTag_current.GetValue( p_v_name = 'name' );

        IF so_tmp IS NULL
        THEN
            CurObject.v_errortext = 'Missing ' + HC_QUOTE + 'name' + HC_QUOTE +
                                    'attribute from <attr> tag.';
            RETURN;
        ENDIF;

        CurObject.UCBatch.DeepOn( p_v_name = so_tmp.Value );
    END

    'param':
    BEGIN
        so_tmp = UCTag_current.GetValue( p_v_name = 'name' );

        IF so_tmp IS NULL
        THEN
            CurObject.v_errortext = 'Missing ' + HC_QUOTE + 'name' + HC_QUOTE +
                                    'attribute from <param> tag.';
            RETURN;
        ENDIF;

        CurObject.UCBatch.DeepOn( p_v_name = so_tmp.Value );
    END

    DEFAULT: ;

    ENDCASE;
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    ProcessEndTag                                                             */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     : Process XML end tag.                                                         */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD ProcessEndTag
(
)=
DECLARE
ENDDECLARE
BEGIN
    CASE CurObject.v_current_tag OF

    'type':
    BEGIN
        CurObject.arr_typereplace.InsertRow(
            RowNumber = CurObject.arr_typereplace.LastRow + 1,
            RowObject = CurObject.UCBatch );
    END

    'scp':
    BEGIN
        CurObject.arr_scpreplace.InsertRow(
            RowNumber = CurObject.arr_scpreplace.LastRow + 1,
            RowObject = CurObject.UCBatch );
    END

    'class':
    BEGIN
        CurObject.arr_classreplace.InsertRow(
            RowNumber = CurObject.arr_classreplace.LastRow + 1,
            RowObject = CurObject.UCBatch );
    END

    'global':
    BEGIN
        CurObject.globalreplace = CurObject.UCBatch;
    END

    'metadata':
    BEGIN
        CurObject.metadatareplace = CurObject.UCBatch;
    END

    'attr' : NEXTCASE;
    'param':
    BEGIN
        CurObject.UCBatch.DeepOff();
    END

    DEFAULT: ;

    ENDCASE;

END


