    p_ucdatadefinition = uc_data_definition DEFAULT NULL,
    p_so               = StringObject DEFAULT NULL,
)=
DECLARE
    i = INTEGER NOT NULL,
ENDDECLARE
BEGIN
    FOR i = 1 TO CurObject.arr_scpreplace.LastRow
    DO
        IF CurObject.arr_scpreplace[i].v_name = p_ucscpdefinition.v_name
        THEN
            RETURN CurObject.arr_scpreplace[i].DeepSubstitute(
                p_v_name = p_ucdatadefinition.v_name,
                p_so     = p_so );
        ENDIF;
    ENDFOR;
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    SubAttr                                                                   */
/* Params in       :    p_v_classname:                                                            */
/*                      p_ucdatadefinition:                                                       */
/*                      p_so:                                                                     */
/*                      p_v_find:                                                                 */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD SubAttr
(
    p_v_classname      = VARCHAR(65) NOT NULL,
    p_ucdatadefinition = uc_data_definition DEFAULT NULL,
    p_so               = StringObject DEFAULT NULL,
    p_v_find           = VARCHAR(65) NOT NULL,
)=
DECLARE
    i = INTEGER NOT NULL,
    v_unqualified = VARCHAR(32) NOT NULL,
ENDDECLARE
BEGIN
    v_unqualified = SHIFT(p_v_classname, -LOCATE(p_v_classname,'!'));

    p_v_classname = LOWERCASE(p_v_classname);
    v_unqualified = LOWERCASE(v_unqualified);

    FOR i = 1 TO CurObject.arr_classreplace.LastRow
    DO
        IF LOWERCASE(CurObject.arr_classreplace[i].v_name) = p_v_classname
        OR LOWERCASE(CurObject.arr_classreplace[i].v_name) = v_unqualified
        THEN
            IF p_v_find = ''
            THEN
                RETURN CurObject.arr_classreplace[i].DeepSubstitute(
                    p_v_name = p_ucdatadefinition.v_name,
                    p_so     = p_so );
            ELSE
                IF CurObject.arr_classreplace[i].DeepFind(
                             pv_find = p_v_find,
                             pv_name = p_ucdatadefinition.v_name ) IS NOT NULL
                THEN
                    RETURN TRUE;
                ELSE
                    RETURN FALSE;
                ENDIF;
            ENDIF;

        ENDIF;

    ENDFOR;
END


