/*------------------------------------------------------------------------------------------------*/
/* Method          :    SubClass                                                                  */
/* Params in       :    p_v_classname:                                                            */
/*                      p_so:                                                                     */
/*                      p_v_find:                                                                 */
/*                      p_i_deep:                                                                 */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD SubClass
(
    p_v_classname  = VARCHAR(65) NOT NULL,
    p_so           = StringObject DEFAULT NULL,
    p_v_find       = VARCHAR(65) NOT NULL,
    p_i_deep       = INTEGER NOT NULL DEFAULT FALSE,
)=
DECLARE
    i = INTEGER NOT NULL,
    v_unqualified = VARCHAR(32) NOT NULL,
ENDDECLARE
BEGIN
    v_unqualified = SHIFT(p_v_classname, -LOCATE(p_v_classname,'!'));
    p_v_classname = LOWERCASE(p_v_classname);
    v_unqualified = LOWERCASE(v_unqualified);

    FOR i = 1 TO CurObject.arr_classreplace.LastRow
    DO

        IF LOWERCASE(CurObject.arr_classreplace[i].v_name) = p_v_classname
        OR LOWERCASE(CurObject.arr_classreplace[i].v_name) = v_unqualified
        THEN
            IF p_v_find = ''
            THEN
                RETURN CurObject.arr_classreplace[i].Substitute( p_so = p_so );
            ELSE
                IF p_i_deep = FALSE
                THEN
                    IF CurObject.arr_classreplace[i].Find( pv_find = p_v_find )
                    IS NOT NULL
                    THEN
                        RETURN TRUE;
                    ENDIF;
                ELSE
                    IF CurObject.arr_classreplace[i].DeepFind( pv_find = p_v_find )
                    IS NOT NULL
                    THEN
                        RETURN TRUE;
                    ENDIF;
                ENDIF;
            ENDIF;
        ENDIF;

    ENDFOR;

    RETURN FALSE;
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    SaveToFile                                                                */
/* Params in       :    pv_filename:                                                              */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     : Save the job information in this object into the specified file.             */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD SaveToFile
(
    pv_filename = VARCHAR(2000) NOT NULL,
)=
DECLARE
    i = INTEGER NOT NULL,
    i_status = INTEGER NOT NULL,
    so_file  = StringObject
ENDDECLARE
BEGIN
    /*--------------------------------------------------------------------------------------------*/
    /* Attempt to write a blank file to this location.                                            */
    /*--------------------------------------------------------------------------------------------*/

    i_status = so_file.WriteToFile( FileName = pv_filename );

    IF i_status <> ER_OK
    THEN
        RETURN i_status;
    ENDIF;

    /*--------------------------------------------------------------------------------------------*/
    /* Reproduce the XML representation of the Search-Replace data.                               */
    /*--------------------------------------------------------------------------------------------*/

    so_file.ConcatVarchar( text = '<root>' );

    IF CurObject.arr_uctemplatejob.LastRow > 0
    THEN
        so_file.ConcatVarchar( text = HC_NEWLINE + '<jobs>' );

        FOR i = 1 TO CurObject.arr_uctemplatejob.LastRow
        DO
            so_file.ConcatVarchar( text = HC_NEWLINE + '<job set=' + HC_QUOTE +
                VARCHAR(CurObject.arr_uctemplatejob[i].i_job_set) + HC_QUOTE +
                ' inputfile=' + HC_QUOTE );

            so_file.ConcatVarchar( text = XMLTextEncode( p_v_text =
                 CurObject.arr_uctemplatejob[i].v_inputfile));

            so_file.ConcatVarchar( text = HC_QUOTE +
                ' outputfile=' + HC_QUOTE );

            so_file.ConcatVarchar( text = XMLTextEncode( p_v_text =
                 CurObject.arr_uctemplatejob[i].v_outputfile));

            so_file.ConcatVarchar( text = HC_QUOTE + ' />' );
        ENDFOR;

        so_file.ConcatVarchar( text  = HC_NEWLINE + '</jobs>' );
    ENDIF;

    IF CurObject.metadatareplace.arr_ucreplace.LastRow > 0
    THEN
        so_file.ConcatVarchar( text = HC_NEWLINE + '<metadata>' );

        /*
        FOR i = 1 TO CurObject.arr_metadatareplace.LastRow
        DO
            so_file.ConcatVarchar( text  = HC_NEWLINE);
            so_file.ConcatString( string = CurObject.arr_metadatareplace[i].SaveToFile());
        ENDFOR;
        */
        so_file.ConcatVarchar( text  = HC_NEWLINE);
        so_file.ConcatString( string = CurObject.metadatareplace.SaveToFile());

        so_file.ConcatVarchar( text = HC_NEWLINE + '</metadata>' );
    ENDIF;

    IF CurObject.globalreplace.arr_ucreplace.LastRow > 0
    THEN
        so_file.ConcatVarchar( text = HC_NEWLINE + '<global>' );

        /*
        FOR i = 1 TO CurObject.arr_globalreplace.LastRow
        DO
            so_file.ConcatVarchar( text  = HC_NEWLINE);
            so_file.ConcatString( string = CurObject.arr_globalreplace[i].SaveToFile());
        ENDFOR;
        */
        so_file.ConcatVarchar( text  = HC_NEWLINE);
        so_file.ConcatString( String = CurObject.globalreplace.SaveToFile());

        so_file.ConcatVarchar( text = HC_NEWLINE + '</global>' );
    ENDIF;

    IF CurObject.arr_typereplace.LastRow > 0
    THEN
        so_file.ConcatVarchar( text = HC_NEWLINE + '<types>' );

        FOR i = 1 TO CurObject.arr_typereplace.LastRow
        DO
            so_file.ConcatVarchar( text  = HC_NEWLINE);
            so_file.ConcatString( string = CurObject.arr_typereplace[i].SaveToFile(
                                                                p_v_tag1 = 'type'));
        ENDFOR;

        so_file.ConcatVarchar( text = HC_NEWLINE + '</types>' );
    ENDIF;

    IF CurObject.arr_classreplace.LastRow > 0
    THEN
        so_file.ConcatVarchar( text = HC_NEWLINE + '<classes>' );

        FOR i = 1 TO CurObject.arr_classreplace.LastRow
        DO
            so_file.ConcatVarchar( text  = HC_NEWLINE);
            so_file.ConcatString( string = CurObject.arr_classreplace[i].SaveToFile(
                                                            p_v_tag1 = 'class',
                                                            p_v_tag2 = 'attr'));
        ENDFOR;

        so_file.ConcatVarchar( text = HC_NEWLINE + '</classes>' );
    ENDIF;

    IF CurObject.arr_scpreplace.LastRow > 0
    THEN
        so_file.ConcatVarchar( text = HC_NEWLINE + '<scps>' );

        FOR i = 1 TO CurObject.arr_scpreplace.LastRow
        DO
            so_file.ConcatVarchar( text  = HC_NEWLINE);
            so_file.ConcatString( string = CurObject.arr_scpreplace[i].SaveToFile(
                                                            p_v_tag1 = 'scp',
                                                            p_v_tag2 = 'param'));
        ENDFOR;

        so_file.ConcatVarchar( text = HC_NEWLINE + '</scps>' );
    ENDIF;

    so_file.ConcatVarchar( text = HC_NEWLINE + '</root>' );

    i_status = so_file.WriteToFile( FileName = pv_filename );

    RETURN i_status;
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    Dispose                                                                   */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     : Cleanup method for this class.                                               */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD Dispose
(
)=
DECLARE
    i = INTEGER NOT NULL;
ENDDECLARE
BEGIN
    FOR i = CurObject.arr_classreplace.LastRow DOWNTO 1
    DO
        CurObject.arr_classreplace[i].Dispose();
        CurObject.arr_classreplace[i] = NULL;
        CurObject.arr_classreplace.RemoveRow( RowNumber = i );
    ENDFOR;

    CurObject.arr_classreplace.Clear();

    FOR i = CurObject.arr_scpreplace.LastRow DOWNTO 1
    DO
        CurObject.arr_scpreplace[i].Dispose();
        CurObject.arr_scpreplace[i] = NULL;
        CurObject.arr_scpreplace.RemoveRow( RowNumber = i );
    ENDFOR;

    CurObject.arr_scpreplace.Clear();

    FOR i = CurObject.arr_typereplace.LastRow DOWNTO 1
    DO
        CurObject.arr_typereplace[i].Dispose();
        CurObject.arr_typereplace[i] = NULL;
        CurObject.arr_typereplace.RemoveRow( RowNumber = i );
    ENDFOR;

    CurObject.arr_typereplace.Clear();

    CurObject.globalreplace.Dispose();
    CurObject.globalreplace = NULL;
    CurObject.metadatareplace.Dispose();
    CurObject.metadatareplace = NULL;
END


