END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    SaveToFile                                                                */
/* Params in       :    p_v_tag1:                                                                 */
/*                      p_v_tag2:                                                                 */
/*                      p_v_tag3:                                                                 */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    StringObject - contains XML representation of replaces and batch          */
/*                      replaces.                                                                 */
/*------------------------------------------------------------------------------------------------*/
/* Description     : Return a String Object containing the replace and batch replaces of this     */
/*                   object encoded as XML.                                                       */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD SaveToFile
(
    p_v_tag1 = VARCHAR(32) NOT NULL,
    p_v_tag2 = VARCHAR(32) NOT NULL,
    p_v_tag3 = VARCHAR(32) NOT NULL,
)=
DECLARE
    i    = INTEGER NOT NULL,
    so   = StringObject,
    l_so = StringObject,
ENDDECLARE
BEGIN

    IF p_v_tag1 <> ''
    THEN
        so.Value = '<' + p_v_tag1 + ' name=' + HC_QUOTE +
            XMLTextEncode(p_v_text = CurObject.v_name) + HC_QUOTE +
            '>' + HC_NEWLINE;
    ENDIF;

    FOR i = 1 TO CurObject.arr_ucreplace.LastRow
    DO
        l_so.Value = '<sub desc=' + HC_QUOTE;
        l_so.ConcatVarchar( Text =
                XMLTextEncode( p_v_text = CurObject.arr_ucreplace[i].v_description ));

        l_so.ConcatVarchar( Text = HC_QUOTE + ' find=' + HC_QUOTE );

        l_so.ConcatVarchar( Text = XMLTextEncode( p_v_text = CurObject.arr_ucreplace[i].v_find ));

        l_so.ConcatVarchar( Text = HC_QUOTE + ' replace=' + HC_QUOTE );

        l_so.ConcatVarchar( Text = XMLTextEncode( p_v_text =
                                                  CurObject.arr_ucreplace[i].v_replace));

        l_so.ConcatVarchar( Text = HC_QUOTE + '/>' + HC_NEWLINE );

        so.ConcatString( String = l_so.Duplicate() );
    ENDFOR;

    IF CurObject.arr_ucbatch IS NOT NULL
    THEN
        FOR i = 1 TO CurObject.arr_ucbatch.LastRow
        DO
            l_so.Value = '<' + p_v_tag2 + ' name=' + HC_QUOTE +
                XMLTextEncode(p_v_text = CurObject.arr_ucbatch[i].v_name) + HC_QUOTE + '>' +
                HC_NEWLINE;
            l_so.ConcatString( String = CurObject.arr_ucbatch[i].
                                                SaveToFile( p_v_tag1 = p_v_tag3 ));
            l_so.ConcatVarchar( Text = '</' + p_v_tag2 + '>' + HC_NEWLINE );
            so.ConcatString( String = l_so );
        ENDFOR;
    ENDIF;

    IF p_v_tag1 <> ''
    THEN
        so.ConcatVarchar( Text = '</' + p_v_tag1 + '>' + HC_NEWLINE );
    ENDIF;

    RETURN so;
END


