/* Params in       :    pv_find:                                                                  */
/*                      pv_replace:                                                               */
/*                      pv_description:                                                           */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :                                                                              */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD UpdateOrInsert
(
    pv_find        = VARCHAR(2000) NOT NULL,
    pv_replace     = VARCHAR(2000) NOT NULL,
    pv_description = VARCHAR(2000) NOT NULL,
)=
DECLARE
    i       = INTEGER NOT NULL;
    i_found = INTEGER NOT NULL DEFAULT FALSE;
    ucreplace = uc_replace;
ENDDECLARE
BEGIN
    FOR i = 1 TO CurObject.arr_ucreplace.LastRow
    DO
        IF CurObject.arr_ucreplace[i].v_find = pv_find
        THEN
            i_found = TRUE;
            ENDLOOP;
        ENDIF;
    ENDFOR;

    IF i_found = TRUE
    THEN
        CurObject.arr_ucreplace[i].v_replace = pv_replace;
    ELSE
        ucreplace.v_replace     = pv_replace;
        ucreplace.v_find        = pv_find;
        ucreplace.v_description = pv_description;

        CurObject.arr_ucreplace.InsertRow( RowObject = CurObject.arr_ucreplace.LastRow + 1,
            RowObject = ucreplace );
    ENDIF;
END


