/*------------------------------------------------------------------------------------------------*/
/* Method          :    GetDataTypeDisplay                                                        */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    Returns a description of this datatype.                                   */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD GetDataTypeDisplay
(
)=
DECLARE
    v_display = VARCHAR(2000) NOT NULL,
ENDDECLARE
BEGIN

     /*-------------------------------------------------------------------------------------------*/
     /* Build up a string describing the datatype by performing a series of checks on its type.   */
     /*-------------------------------------------------------------------------------------------*/

                                                  /*----------------------------------------------*/
                                                  /* Check whether the data type is an array.     */
                                                  /*----------------------------------------------*/

    IF CurObject.i_isarray = TRUE
    THEN
        v_display = 'array of ' + CurObject.v_datatype;
    ELSE
        v_display = CurObject.v_datatype;
    ENDIF;

    v_display = v_display + ' ';

                                                  /*----------------------------------------------*/
                                                  /* Check whether the data type can contain NULL */
                                                  /* values.                                      */
                                                  /*----------------------------------------------*/

    IF CurObject.i_isnullable = FALSE
    THEN
        v_display = v_display + 'not null';
    ELSE
        v_display = v_display + 'with null';
    ENDIF;

                                                  /*----------------------------------------------*/
                                                  /* Check whether the data type has a default    */
                                                  /* value.                                       */
                                                  /*----------------------------------------------*/

    v_display = v_display + ' ';

    IF CurObject.i_defaulttype = DV_NULL
    THEN
        v_display = v_display + 'default null';
    ELSEIF CurObject.i_defaulttype = DV_SYSTEM
    THEN
        v_display = v_display + 'with default';
    ELSEIF CurObject.i_defaulttype = DV_STRING
    THEN
        v_display = v_display + 'default ' + HC_QUOTE +
            CurObject.v_default + HC_QUOTE;
    ENDIF;

    RETURN v_display;
END


