/* Description     : Generates proxy code using template files.                                   */
/*                                                                                                */
/* Version History                                                                                */
/*                                                                                                */
/* Version Date     Who   Description                                                             */
/* ------- -------- ----- -----------                                                             */
/* 1.0     17/08/02 IU    Original version.                                                       */
/* 1.1     11/12/07 DJN   Prepared code for Open Source release.                                  */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/

INITIALISE =

DECLARE

/*------------------------------------------------------------------------------------------------*/
/* Procedures local to this user class                                                            */
/*------------------------------------------------------------------------------------------------*/

/* none */

ENDDECLARE


/*------------------------------------------------------------------------------------------------*/
/* Method          :    Parse                                                                     */
/* Params in       :    A string containing the contents of the template file                     */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    Success                                                                   */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    Deconstruct the passed in template file into template                     */
/*                      blocks.                                                                   */
/*------------------------------------------------------------------------------------------------*/
METHOD Parse
(
    p_so_template = StringObject;
)=
DECLARE
    i                       = INTEGER           NOT NULL;
    l_i_prev_line_break_pos = INTEGER           NOT NULL DEFAULT 1;
    l_v_match               = VARCHAR(2000)     NOT NULL;
    l_so                    = StringObject;
    blk                     = uc_template_block DEFAULT NULL;
    i_lnl                   = INTEGER           NOT NULL DEFAULT 1;
ENDDECLARE
BEGIN
                                                  /*----------------------------------------------*/
                                                  /* Break the stringobject into lines.           */
                                                  /*----------------------------------------------*/

    WHILE i < p_so_template.Length
    DO
        i = p_so_template.LocateString(match         = HC_NEWLINE + '<<',
                                       startposition = l_i_prev_line_break_pos);
        IF i = 0
        THEN
            i = p_so_template.Length;
        ENDIF;

        l_so  = p_so_template.ExtractString(startposition = l_i_prev_line_break_pos, length = i -
                                                            l_i_prev_line_break_pos );
        l_i_prev_line_break_pos = i + i_lnl;

        blk         = uc_template_block.Create();
        blk.v_type  = '';
        blk.so_line = l_so.Duplicate();

        CurObject.arr_blocks.InsertRow(RowNumber = CurObject.arr_blocks.LastRow + 1,
                                       RowObject = blk);

        IF i != p_so_template.Length
        THEN
                                                  /*----------------------------------------------*/
                                                  /* Find matching line and send the input into a */
                                                  /* new block.                                   */
                                                  /*----------------------------------------------*/

            l_v_match = p_so_template.ExtractString(startposition = l_i_prev_line_break_pos,
                                                    length        = 2000).Value;
            l_v_match = LEFT(l_v_match, LOCATE(l_v_match, HC_NEWLINE) - 1);
            l_i_prev_line_break_pos = l_i_prev_line_break_pos + LENGTH(l_v_match);

            l_so.Value = '';
            i = p_so_template.LocateString( match = l_v_match + HC_NEWLINE,
                                            startposition = l_i_prev_line_break_pos );

            IF i = 0
            THEN
                CurMethod.Trace('Could not find matching [' + l_v_match + ']');
                CurMethod.Trace('starting at ' + VARCHAR(l_i_prev_line_break_pos));
                RETURN ER_FAIL;
            ENDIF;

            l_so = p_so_template.ExtractString( startposition = l_i_prev_line_break_pos,
                                                length = i - l_i_prev_line_break_pos);

            l_i_prev_line_break_pos = i + LENGTH(l_v_match);

            blk = uc_template_block.Create();
            blk.v_match = l_v_match;

            IF l_v_match LIKE '%<<FOREACHPARAM>>%'
            THEN
                blk.v_type = 'FOREACHPARAM';
                blk.i_isloop = TRUE;
            ELSEIF l_v_match LIKE '%<<FOREACHAPP>>%'
            THEN
                blk.v_type = 'FOREACHAPP';
                blk.i_isloop = TRUE;
            ELSEIF l_v_match LIKE '%<<FOREACHSCP>>%'
            THEN
                blk.v_type = 'FOREACHSCP';
                blk.i_isloop = TRUE;
            ELSEIF l_v_match LIKE '%<<FOREACHCLASS>>%'
            THEN
                blk.v_type = 'FOREACHCLASS';
                blk.v_extra = l_v_match;
                blk.i_isloop = TRUE;
            ELSEIF l_v_match LIKE '%<<FOREACHATTR>>%'
            THEN
                blk.v_type = 'FOREACHATTR';
                blk.i_isloop = TRUE;
            ELSEIF l_v_match LIKE '%<<GENSCP>>%'
            OR     l_v_match LIKE '%<<!GENSCP>>%'
            THEN
                blk.v_type = 'GENSCP'
            ELSEIF l_v_match LIKE '%<<COMMENT>>%'
            THEN
                blk.v_type = 'COMMENT';
                /* Remove Initial and last newlines */
                blk.so_line = l_so.ExtractString( StartPosition = 2,
                                                  Length = l_so.Length-2);
            ELSEIF l_v_match LIKE '%<<DOCHISTORY>>%'
            THEN
                blk.v_type = 'DOCHISTORY';
                /* Remove Initial and last newlines */
                blk.so_line = l_so.ExtractString( StartPosition = 2,
                                                  Length = l_so.Length-2);
            ELSE

                blk.v_type = l_v_match;

            ENDIF;

            blk.parse( p_so_template = l_so );

            CurObject.arr_blocks.InsertRow( RowNumber = CurObject.arr_blocks.LastRow + 1,
                                            RowObject = blk );

        ENDIF;

    ENDWHILE;

    RETURN ER_OK;

END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    RunBlock                                                                  */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    Builds up a section of generated proxy code based upon the template block */
/*                      and search/replace data.                                                  */
/*------------------------------------------------------------------------------------------------*/
METHOD RunBlock
(
    p_metagenparser       = metagenparser       DEFAULT NULL;
    p_searchreplaceparser = searchreplaceparser DEFAULT NULL;
    p_v_package           = VARCHAR(32)         NOT NULL;
    p_v_classname         = VARCHAR(65)         NOT NULL;
    p_ucscpdefinition     = uc_scp_definition   DEFAULT NULL;
    p_ucdatadefinition    = uc_data_definition  DEFAULT NULL;
    p_so                  = StringObject        DEFAULT NULL;
    p_i_last              = INTEGER             NOT NULL DEFAULT FALSE;

    p_parent_block        = uc_template_block DEFAULT NULL;
)=
DECLARE
    i          = INTEGER             NOT NULL,
    j          = INTEGER             NOT NULL,
    k          = INTEGER             NOT NULL,
    i_status   = INTEGER             NOT NULL,
    l_so       = StringObject        DEFAULT NULL;
    l_class    = uc_class_definition DEFAULT NULL;
    l_class2   = uc_class_definition DEFAULT NULL;
    v_apps     = VARCHAR(2000)       NOT NULL;
    v_test     = VARCHAR(36)         NOT NULL;
    v_app      = VARCHAR(32)         NOT NULL;
    v_class    = VARCHAR(32)         NOT NULL;
    l_i_last   = INTEGER             NOT NULL;
    v_name     = VARCHAR(65)         NOT NULL;
    v_char     = VARCHAR(1)          NOT NULL;
    l_arrscp   = ARRAY OF uc_scp_definition;
    l_arrclass = ARRAY OF uc_class_definition;
    l_tmpso    = StringObject;
ENDDECLARE
BEGIN
    CASE CurObject.v_type OF
    'COMMENT': NEXTCASE;
    'DOCHISTORY':
    {
        // Do nothing for a comment.
    }
    'FOREACHAPP':
    {

        FOR i = 1 TO p_metagenparser.arr_includedapps.LastRow
        DO
            l_so = StringObject.Create();

            k = CurObject.arr_blocks.LastRow;

            IF i = p_metagenparser.arr_includedapps.LastRow
            THEN
                l_i_last = TRUE;
            ELSE
                l_i_last = FALSE;
            ENDIF;

            FOR j = 1 TO k
            DO

                CurObject.arr_blocks[j].RunBlock(
                    p_metagenparser       = p_metagenparser,
                    p_searchreplaceparser = p_searchreplaceparser,
                    p_v_package           = p_v_package,
                    p_v_classname         = p_v_classname,
                    p_ucscpdefinition     = p_ucscpdefinition,
                    p_ucdatadefinition    = p_ucdatadefinition,
                    p_i_last              = l_i_last,
                    p_parent_block        = CurObject,
                    p_so = l_so );
            ENDFOR;

            /*------------------------------------------------------------------------------------*/
            /* Substitute ${includedapp} for the appname                                          */
            /*------------------------------------------------------------------------------------*/

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext =
                                     p_metagenparser.arr_includedapps[i].Value,
                                     p_v_searchtext = '${includedapp}' );

            p_so.ConcatString( String = l_so );
        ENDFOR;

    }
    'FOREACHPARAM':{

        FOR i = 1 TO p_ucscpdefinition.arr_ucdatadef.LastRow
        DO
            l_so = StringObject.Create();

            k = CurObject.arr_blocks.LastRow;

            IF i = p_ucscpdefinition.arr_ucdatadef.LastRow
            THEN
                l_i_last = TRUE;
            ELSE
                l_i_last = FALSE;
            ENDIF;

            FOR j = 1 TO k
            DO

                CurObject.arr_blocks[j].RunBlock(
                    p_metagenparser       = p_metagenparser,
                    p_searchreplaceparser = p_searchreplaceparser,
                    p_v_package           = p_v_package,
                    p_ucscpdefinition     = p_ucscpdefinition,
                    p_ucdatadefinition    = p_ucscpdefinition.arr_ucdatadef[i],
                    p_v_classname         = p_v_classname,
                    p_i_last              = l_i_last,
                    p_parent_block        = CurObject,
                    p_so                  = l_so );

            ENDFOR;

            p_searchreplaceparser.SubParam(
                 p_ucscpdefinition  = p_ucscpdefinition,
                 p_ucdatadefinition = p_ucscpdefinition.arr_ucdatadef[i],
                 p_so               = l_so );

            /*------------------------------------------------------------------------------------*/
            /* Substitute ${name} for the attribute name.                                         */
            /*------------------------------------------------------------------------------------*/

            l_tmpso.Value = p_ucscpdefinition.arr_ucdatadef[i].v_name;

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = l_tmpso.Value,
                                     p_v_searchtext = '${name}' );

            p_searchreplaceparser.SubMetaData( p_so = l_tmpso );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = l_tmpso.Value,
                                     p_v_searchtext = '${langname}' );

            /*------------------------------------------------------------------------------------*/
            /* Substitute ${default_value} for the default value                                  */
            /*------------------------------------------------------------------------------------*/

                                                  /*----------------------------------------------*/
                                                  /* But first, perform metadata substitutions.   */
                                                  /* e.g ' to ${hc_quote}                         */
                                                  /*----------------------------------------------*/


            IF p_ucscpdefinition.arr_ucdatadef[i].i_defaulttype <> DV_STRING
            THEN
                l_tmpso.Value = '${default_value}';
                p_searchreplaceparser.SubType(
                    p_v_type = p_ucscpdefinition.arr_ucdatadef[i].v_datatype,
                    p_so = l_tmpso );
            ELSE
                l_tmpso.Value = p_ucscpdefinition.arr_ucdatadef[i].v_default;
            ENDIF;

            p_searchreplaceparser.SubMetaData( p_so = l_tmpso );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = l_tmpso.Value,
                                     p_v_searchtext = '${default_value}' );

            i_status = p_searchreplaceparser.SubType(
                 p_v_type = p_ucscpdefinition.arr_ucdatadef[i].v_datatype,
                 p_so     = l_so );

            IF i_status = 0
            THEN
                p_searchreplaceparser.SubClass(
                 p_v_classname = p_ucscpdefinition.arr_ucdatadef[i].v_datatype,
                 p_so          = l_so );
            ENDIF;

            /*------------------------------------------------------------------------------------*/
            /* Substitute ${type} for the default value                                           */
            /*------------------------------------------------------------------------------------*/

            l_tmpso.Value = p_ucscpdefinition.arr_ucdatadef[i].v_datatype;

            p_searchreplaceparser.SubMetaData( p_so = l_tmpso );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = l_tmpso.Value,
                                     p_v_searchtext = '${type}' );


            p_so.ConcatString( String = l_so );
        ENDFOR;
    }
    'FOREACHATTR':{
        l_class = p_metagenparser.GetClassByName( p_v_classname = p_v_classname );

        FOR i = 1 TO l_class.arr_ucdatadef.LastRow
        DO
            l_so = StringObject.Create();

            k = CurObject.arr_blocks.LastRow;

            IF i = l_class.arr_ucdatadef.LastRow
            THEN
                l_i_last = TRUE;
            ELSE
                l_i_last = FALSE;
            ENDIF;

            FOR j = 1 TO k
            DO
                CurObject.arr_blocks[j].RunBlock(
                    p_metagenparser       = p_metagenparser,
                    p_searchreplaceparser = p_searchreplaceparser,
                    p_v_package           = p_v_package,
                    p_ucscpdefinition     = p_ucscpdefinition,
                    p_ucdatadefinition    = l_class.arr_ucdatadef[i],
                    p_v_classname         = p_v_classname,
                    p_i_last              = l_i_last,
                    p_parent_block        = CurObject,
                    p_so = l_so );

            ENDFOR;

            p_searchreplaceparser.SubAttr(
                 p_ucdatadefinition = l_class.arr_ucdatadef[i],
                 p_v_classname      = p_v_classname,
                 p_so               = l_so );

            /*------------------------------------------------------------------------------------*/
            /* Substitute ${name} for the attribute name.                                         */
            /*------------------------------------------------------------------------------------*/

            l_tmpso.Value = l_class.arr_ucdatadef[i].v_name;

            IF l_tmpso.Value = 'UCItemListDTO'
            THEN
                CurMethod.Trace('Debug');
            ENDIF;

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = l_tmpso.Value,
                                     p_v_searchtext = '${name}' );

            p_searchreplaceparser.SubMetaData( p_so = l_tmpso );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = l_tmpso.Value,
                                     p_v_searchtext = '${langname}' );

            /*------------------------------------------------------------------------------------*/
            /* Substitute ${default_value} for the default value                                  */
            /*------------------------------------------------------------------------------------*/

                                                  /*----------------------------------------------*/
                                                  /* But first, perform metadata substitutions.   */
                                                  /* e.g ' to ${hc_quote}                         */
                                                  /*----------------------------------------------*/

            IF l_class.arr_ucdatadef[i].i_defaulttype <> DV_STRING
            THEN
                l_tmpso.Value = '${default_value}';
                p_searchreplaceparser.SubType(
                    p_v_type = l_class.arr_ucdatadef[i].v_datatype,
                    p_so = l_tmpso );
            ELSE
                l_tmpso.Value = l_class.arr_ucdatadef[i].v_default;
            ENDIF;

            p_searchreplaceparser.SubMetaData( p_so = l_tmpso );

            CALLPROC string_replace( p_so            = l_so,
                                     p_v_replacetext = l_tmpso.Value,
                                     p_v_searchtext  = '${default_value}' );

            i_status = p_searchreplaceparser.SubType(
                 p_v_type = l_class.arr_ucdatadef[i].v_datatype,
                 p_so     = l_so );

            IF i_status = 0
            THEN
                p_searchreplaceparser.SubClass(
                 p_v_classname = l_class.arr_ucdatadef[i].v_datatype,
                 p_so          = l_so );
            ENDIF;

                                                  /*----------------------------------------------*/
                                                  /* Substitute ${type} for the default value     */
                                                  /*----------------------------------------------*/

            l_tmpso.Value = l_class.arr_ucdatadef[i].v_datatype;

            p_searchreplaceparser.SubMetaData( p_so = l_tmpso );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = l_tmpso.Value,
                                     p_v_searchtext = '${type}' );

            p_so.ConcatString( String = l_so );
        ENDFOR;
    }

    'FOREACHCLASS':
    {
        l_arrclass = p_metagenparser.arr_ucclassdef;

        FOR i = 1 TO l_arrclass.LastRow
        DO
            l_so = StringObject.Create();
            p_v_classname = l_arrclass[i].v_qualified;
            v_app = LEFT(l_arrclass[i].v_qualified,
                        LOCATE(l_arrclass[i].v_qualified,'!')-1);

            IF  p_v_package <> ''
            AND LOWERCASE(v_app) <> LOWERCASE(p_v_package)
            THEN
                CONTINUE;
            ENDIF;

            k = CurObject.arr_blocks.LastRow;

            IF i = l_arrclass.LastRow
            THEN
                l_i_last = TRUE;
            ELSE
                l_i_last = FALSE;
            ENDIF;

            FOR j = 1 TO k
            DO
                CurObject.arr_blocks[j].RunBlock(
                    p_metagenparser       = p_metagenparser,
                    p_searchreplaceparser = p_searchreplaceparser,
                    p_v_package           = p_v_package,
                    p_v_classname         = p_v_classname,
                    p_ucdatadefinition    = p_ucdatadefinition,
                    p_ucscpdefinition     = p_ucscpdefinition,
                    p_i_last              = l_i_last,
                    p_parent_block        = CurObject,
                    p_so = l_so );
            ENDFOR;

            p_searchreplaceparser.SubClass(
                 p_v_classname = p_v_classname,
                 p_so          = l_so );

            /*
            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = p_v_classname,
                                     p_v_searchtext = '${class_name}' );
            */
            /* Always replace ${class_name} with unqualified name */
            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = l_arrclass[i].v_name,
                                     p_v_searchtext = '${class_name}' );

            l_tmpso.Value = l_arrclass[i].v_name;

            p_searchreplaceparser.SubMetaData( p_so = l_tmpso );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = l_tmpso.Value,
                                     p_v_searchtext = '${class_langname}' );


            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = LOWERCASE(v_app),
                                     p_v_searchtext = '${app_name}' );

            p_so.ConcatString( String = l_so );
        ENDFOR;
    }

    'FOREACHSCP':
    {
        IF p_v_classname <> ''
        THEN
            l_arrscp = p_metagenparser.GetSCPsByClass( p_v_classname = p_v_classname);
        ELSE
            l_arrscp = p_metagenparser.arr_ucscpdef;
        ENDIF;

        FOR i = 1 TO l_arrscp.LastRow
        DO
            l_so = StringObject.Create();
            p_ucscpdefinition = l_arrscp[i];

            IF  p_v_package <> ''
            AND LOWERCASE(p_ucscpdefinition.v_application) <> LOWERCASE(p_v_package)
            THEN
                CONTINUE;
            ENDIF;

            k = CurObject.arr_blocks.LastRow;

            IF i = l_arrscp.LastRow
            THEN
                l_i_last = TRUE;
            ELSE
                l_i_last = FALSE;
            ENDIF;

            FOR j = 1 TO k
            DO

                CurObject.arr_blocks[j].RunBlock(
                    p_metagenparser       = p_metagenparser,
                    p_searchreplaceparser = p_searchreplaceparser,
                    p_v_package           = p_v_package,
                    p_v_classname         = p_v_classname,
                    p_ucdatadefinition    = p_ucdatadefinition,
                    p_ucscpdefinition     = p_ucscpdefinition,
                    p_i_last              = l_i_last,
                    p_parent_block        = CurObject,
                    p_so                  = l_so );
            ENDFOR;

            p_searchreplaceparser.SubSCP(
                 p_ucscpdefinition  = p_ucscpdefinition,
                 p_so               = l_so );

            /*------------------------------------------------------------------------------------*/
            /* Substitute ${scp_method} for method name.                                          */
            /*------------------------------------------------------------------------------------*/

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = p_ucscpdefinition.v_method,
                                     p_v_searchtext = '${scp_method}' );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = p_ucscpdefinition.v_procedure,
                                     p_v_searchtext = '${scp_procedure}' );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = p_ucscpdefinition.v_name,
                                     p_v_searchtext = '${scp_name}' );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = p_ucscpdefinition.v_class,
                                     p_v_searchtext = '${scp_class}' );

            l_tmpso.Value = p_ucscpdefinition.v_name;

            p_searchreplaceparser.SubMetaData( p_so = l_tmpso );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = l_tmpso.Value,
                                     p_v_searchtext = '${altscp_name}' );

            CALLPROC string_replace( p_so = l_so,
                                     p_v_replacetext = LOWERCASE(p_ucscpdefinition.v_application),
                                     p_v_searchtext = '${app_name}' );

            p_so.ConcatString( String = l_so );
        ENDFOR;

    }

    'GENSCP':
    {
            IF CurObject.v_match LIKE '%<<GENSCP>>%'
            THEN
                IF p_ucscpdefinition.v_type = 'user'
                OR p_ucscpdefinition.v_type = 'system'
                THEN
                    RETURN ER_OK;
                ENDIF;

                IF CurObject.v_match LIKE '%(method)%'
                THEN
                    IF p_ucscpdefinition.v_procedure <> ''
                    THEN
                        RETURN ER_OK;
                    ENDIF;
                ENDIF;

                IF CurObject.v_match LIKE '%(procedure)%'
                THEN
                    IF p_ucscpdefinition.v_method <> ''
                    THEN
                        RETURN ER_OK;
                    ENDIF;
                ENDIF;
            ENDIF;

            IF CurObject.v_match LIKE '%<<!GENSCP>>%'
            THEN
                IF CurObject.v_match LIKE '%(method)%'
                THEN
                    IF p_ucscpdefinition.v_method <> ''
                    THEN
                        RETURN ER_OK;
                    ENDIF;
                ELSEIF CurObject.v_match LIKE '%(procedure)%'
                THEN
                    IF p_ucscpdefinition.v_procedure <> ''
                    THEN
                        RETURN ER_OK;
                    ENDIF;
                ELSE
                    IF  p_ucscpdefinition.v_type <> 'user'
                    AND p_ucscpdefinition.v_type <> 'system'
                    THEN
                        RETURN ER_OK;
                    ENDIF;
                ENDIF;
            ENDIF;

            IF CurObject.arr_blocks.LastRow = 0
            THEN
                p_so.ConcatString( String = CurObject.so_line );
            ELSE
                l_so = StringObject.Create();
                FOR j = 1 TO CurObject.arr_blocks.LastRow
                DO
                        CurObject.arr_blocks[j].RunBlock(
                            p_metagenparser = p_metagenparser,
                            p_searchreplaceparser = p_searchreplaceparser,
                            p_v_package        = p_v_package,
                            p_ucscpdefinition = p_ucscpdefinition,
                            p_ucdatadefinition = p_ucdatadefinition,
                            p_v_classname = p_v_classname,
                            p_parent_block        = CurObject,
                            p_i_last = p_i_last,
                            p_so = l_so );
                ENDFOR;

                p_so.ConcatString( String = l_so );
            ENDIF;
    }

    DEFAULT:
    {

        IF CurObject.v_type LIKE '%<<DEFINED>>%'
        OR CurObject.v_type LIKE '%<<!DEFINED>>%'
        THEN
            i_status = 0;
            j = 0; // counter
            FOR k = 1 TO LENGTH(CurObject.v_type)
            DO
                v_char = CHAREXTRACT(CurObject.v_type,k);
                CASE v_char OF
                '(': i_status = 1;
                ')':
                {
                    i_status = 0;

                    IF p_parent_block.v_type = 'FOREACHCLASS'
                    THEN
                        IF p_searchreplaceparser.SubClass(
                                 p_v_classname = p_v_classname,
                                 p_v_find      = v_name,
                                 p_i_deep      = TRUE ) > 0
                        THEN
                            j = j + 1;
                        ENDIF;
                    ELSEIF p_parent_block.v_type = 'FOREACHATTR'
                    THEN
                        IF p_searchreplaceparser.SubAttr(
                             p_ucdatadefinition = p_ucdatadefinition,
                             p_v_classname      = p_v_classname,
                             p_v_find           = v_name ) > 0
                        THEN
                            j = j + 1;
                        ENDIF;
                    ELSEIF p_parent_block.v_type = ''
                    THEN
                        IF p_searchreplaceparser.SubClass(
                                 p_v_classname = p_v_classname,
                                 p_v_find      = v_name,
                                 p_i_deep      = TRUE ) > 0
                        THEN
                            j = j + 1;
                        ENDIF;
                    ENDIF;

                    v_name = '';
                }
                DEFAULT:
                {
                    IF i_status = 1
                    THEN
                        v_name = v_name + v_char;
                    ENDIF;
                }
                ENDCASE;

            ENDFOR;

            IF CurObject.v_type LIKE '%<<DEFINED>>%'
            AND j <= 0
            THEN
                RETURN ER_FAIL;
            ELSEIF CurObject.v_type LIKE '%<<!DEFINED>>%'
            AND j > 0
            THEN
                RETURN ER_FAIL;
            ENDIF;

        ELSEIF CurObject.v_type LIKE '%<<!NAME=>>%'
        OR     CurObject.v_type LIKE '%<<NAME=>>%'
        THEN
            IF p_parent_block.v_type = 'FOREACHCLASS'
            THEN
                v_test = '%(' + p_v_classname + '%)';

                j = 0;
                IF CurObject.v_type LIKE v_test
                THEN
                    j = 1;
                ENDIF;

                IF (CurObject.v_type LIKE '%<<NAME=>>%' AND j = 0)
                OR (CurObject.v_type LIKE '%<<!NAME=>>%' AND j != 0)
                THEN
                    RETURN ER_FAIL
                ENDIF;

            ELSEIF p_parent_block.v_type = 'FOREACHPARAM'
            THEN
                v_test = '%('+p_ucdatadefinition.v_name + ')%';

                j = 0;
                IF CurObject.v_type LIKE v_test
                THEN
                    j = 1;
                ENDIF;

                IF (CurObject.v_type LIKE '%<<NAME=>>%' AND j = 0)
                OR (CurObject.v_type LIKE '%<<!NAME=>>%' AND j != 0)
                THEN
                    RETURN ER_FAIL
                ENDIF;
            ELSEIF p_parent_block.v_type = 'FOREACHSCP'
            THEN
                v_test = '%('+p_ucscpdefinition.v_name + ')%';

                j = 0;
                IF CurObject.v_type LIKE v_test
                THEN
                    j = 1;
                ENDIF;

                IF (CurObject.v_type LIKE '%<<NAME=>>%' AND j = 0)
                OR (CurObject.v_type LIKE '%<<!NAME=>>%' AND j != 0)
                THEN
                    RETURN ER_FAIL
                ENDIF;

            ENDIF;

        ELSEIF CurObject.v_type <> ''
        AND    CurObject.v_type <> '<<FLAT>>'
        THEN

            IF p_ucdatadefinition IS NULL
            THEN
                RETURN ER_FAIL;
            ENDIF;

            IF CurObject.v_type LIKE '%<<ARRAY>>%'
            THEN
                IF p_ucdatadefinition.isArray() = FALSE
                THEN
                    RETURN ER_FAIL;
                ENDIF;
            ENDIF;

            IF CurObject.v_type LIKE '%<<CLASS>>%'
            THEN
                IF p_ucdatadefinition.isArray()  = TRUE
                OR p_ucdatadefinition.isScalar() = TRUE
                THEN
                    RETURN ER_FAIL;
                ENDIF;
            ENDIF;

            IF CurObject.v_type LIKE '%<<SCALAR>>%'
            THEN
                IF p_ucdatadefinition.isScalar() = FALSE
                THEN
                    RETURN ER_FAIL;
                ENDIF;
            ENDIF;

            IF CurObject.v_type LIKE '%<<DV_NULL>>%'
            THEN
                IF p_ucdatadefinition.i_defaulttype <> DV_NULL
                THEN
                    RETURN ER_FAIL;
                ENDIF;
            ENDIF;

            IF CurObject.v_type LIKE '%<<!DV_NULL>>%'
            THEN
                IF p_ucdatadefinition.i_defaulttype = DV_NULL
                THEN
                    RETURN ER_FAIL;
                ENDIF;
            ENDIF;
            /*
            IF CurObject.v_type LIKE '%<<DV_USER>>%'
            THEN
                IF p_ucdatadefinition.i_defaulttype <> DV_STRING
                THEN
                    RETURN ER_FAIL;
                ENDIF;
            ENDIF;

            IF CurObject.v_type LIKE '%<<DV_SYSTEM>>%'
            THEN
                IF p_ucdatadefinition.i_defaulttype <> DV_SYSTEM
                THEN
                    RETURN ER_FAIL;
                ENDIF;
            ENDIF;
            */

            IF CurObject.v_type LIKE '%<<NULLABLE>>%'
            THEN
                IF p_ucdatadefinition.i_isnullable = FALSE
                THEN
                    RETURN ER_FAIL;
                ENDIF;
            ENDIF;

            IF CurObject.v_type LIKE '%<<!NULLABLE>>%'
            THEN
                IF p_ucdatadefinition.i_isnullable = TRUE
                THEN
                    RETURN ER_FAIL;
                ENDIF;
            ENDIF;

            IF CurObject.v_type LIKE '%<<ONLYIF>>%'
            THEN
                v_test = '%<<' + UPPERCASE(p_ucdatadefinition.v_datatype)
                     + '>>%';

                IF CurObject.v_type NOT LIKE v_test
                THEN
                    RETURN ER_FAIL;
                ENDIF;
            ENDIF;

            v_test = '%<<!' + UPPERCASE(p_ucdatadefinition.v_datatype)
                     + '>>%';

            IF  CurObject.v_type LIKE v_test
            THEN
                RETURN ER_FAIL;
            ENDIF;

            IF  CurObject.v_type LIKE '%<<!LAST>>%'
            AND p_i_last = TRUE
            THEN
                RETURN ER_FAIL;
            ENDIF;

        ENDIF;

        IF CurObject.arr_blocks.LastRow = 0
        THEN
            p_so.ConcatString( String = CurObject.so_line );
        ELSE
            l_so = StringObject.Create();
            FOR j = 1 TO CurObject.arr_blocks.LastRow
            DO
                    CurObject.arr_blocks[j].RunBlock(
                        p_metagenparser       = p_metagenparser,
                        p_searchreplaceparser = p_searchreplaceparser,
                        p_v_package           = p_v_package,
                        p_ucscpdefinition     = p_ucscpdefinition,
                        p_ucdatadefinition    = p_ucdatadefinition,
                        p_v_classname         = p_v_classname,
                        p_parent_block        = CurObject,
                        p_i_last = p_i_last,
                        p_so                  = l_so );
            ENDFOR;

            IF CurObject.v_type = '<<FLAT>>'
            THEN
                CALLPROC string_replace( p_so            = l_so,
                                         p_v_searchtext  = HC_NEWLINE,
                                         p_v_replacetext = '' );
            ENDIF;

            p_so.ConcatString( String = l_so );
        ENDIF;
    }
    ENDCASE;

    RETURN ER_OK;
END


/*------------------------------------------------------------------------------------------------*/
/* Method          :    Dispose                                                                   */
/* Params in       :    <none>                                                                    */
/* Params BYREF    :    <none>                                                                    */
/* Returncode      :    <none>                                                                    */
/*------------------------------------------------------------------------------------------------*/
/* Description     :    Clean up memory.                                                          */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/
METHOD Dispose
(
)=
DECLARE
    i = INTEGER NOT NULL;
ENDDECLARE
BEGIN
    FOR i = CurObject.arr_blocks.LastRow DOWNTO 1
    DO
        CurObject.arr_blocks[i].Dispose();
        CurObject.arr_blocks[i] = NULL;
        CurObject.arr_blocks.RemoveRow( RowNumber = i );
    ENDFOR;

    CurObject.so_line = NULL;
    CurObject.arr_blocks.Clear();
    CurObject.arr_blocks = NULL;
END

