/*                                                                                                */
/* Global Procedure: XML String Encode                                                            */
/*                                                                                                */
/* Procedure Name  : xmlstringencode                                                              */
/*                                                                                                */
/* System Name     : ProxyGen                                                                     */
/*                                                                                                */
/* Sub-System Name : N/A                                                                          */
/*                                                                                                */
/* Author          : I. Utley       (Luminary Solutions)                                          */
/*                                                                                                */
/* Date            : 10/10/2002                                                                   */
/*                                                                                                */
/* Description     : Converts a supplied string to XML standard by replacing ampersands with      */
/*                   &amp, '<' with &lt;, '>' with &gt, double quotes with &quot and single       */
/*                   quotes with &apos.                                                           */
/*                   Returns the encoded XML string.                                              */
/*                                                                                                */
/* Version History                                                                                */
/*                                                                                                */
/* Version Date     Who   Description                                                             */
/* ------- -------- ----- -----------                                                             */
/* 1.0     10/10/02 IU    Original version.                                                       */
/* 1.1     07/12/07 DJN   Added more detailed commenting and header details.                      */
/*                                                                                                */
/*------------------------------------------------------------------------------------------------*/

PROCEDURE xmlstringencode
(
    p_so = StringObject,
) =
DECLARE

ENDDECLARE
BEGIN
                                                  /*----------------------------------------------*/
                                                  /* Replace & with &amp; , < with &lt; , > with  */
                                                  /* &gt; , " with &quot; and ' with &apos;       */
                                                  /*----------------------------------------------*/

    CALLPROC string_replace( p_so            = p_so,
                             p_v_searchtext  = '&',
                             p_v_replacetext = '&amp;' );

    CALLPROC string_replace( p_so            = p_so,
                             p_v_searchtext  = '<',
                             p_v_replacetext = '&lt;' );

    CALLPROC string_replace( p_so            = p_so,
                             p_v_searchtext  = '>',
                             p_v_replacetext = '&gt;' );

    CALLPROC string_replace( p_so            = p_so,
                             p_v_searchtext  = HC_DOUBLEQUOTE,
                             p_v_replacetext = '&quot;' );

    CALLPROC string_replace( p_so            = p_so,
                             p_v_searchtext  = HC_QUOTE,
                             p_v_replacetext = '&apos;' );

    RETURN p_so;
END

